040,1,NULL,'__temp_fzufpdjrjhhmjtirqadtzecsbqiqzcffxczo',NULL,'{\"32026899-b103-417b-b8bf-9bf932c15b6e\": \"Special Occasions\", \"39e47c53-5179-4ae5-b33d-8decc8842b98\": \"Occasions\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','029aba25-581d-4c46-9a45-5ec08da337d2'),(1041,1041,1,NULL,NULL,NULL,'{\"3e5918ed-78ce-4c03-9865-40127df22225\": \"<p><strong>Wedding Hairstyles</strong></p><p>It’s your special day and we know fully that no bride or wedding is the same as another. We understand how important this is for both you and your family, that’s why it is imperative to have a trial so you can be completely confident with your look, style and of course your stylist.</p><p>On the trial day you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. It’s good to know that our stylists are all professionally trained and some have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands. Our wedding team are available at your disposal, both on site within the salon or at a venue or location of your choice.</p><p><strong>Proms</strong></p><p>Our experienced and professional team will ensure that we create the look you are looking for to compliment your dress making you feel beautiful and confident. We have been catering for teenagers on prom nights for over 7 years and we work with professional MAC make-up artists who are able to deliver your desired look.</p><p>As with weddings you will be advised to have a trial day where you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. Some of our stylists and make-up artists have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands.</p>\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','24ad2d61-5dfe-41e7-bc4a-14d984624a24'),(1042,1042,1,'Plaits','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £12\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','b17824da-d65f-4e6a-81ae-dfefccdcde8f'),(1043,1043,1,'Trial Hair-Up from','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £18\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','0741420d-73dc-4f20-bc49-7ff07788702c'),(1044,1044,1,'Hair Up','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £28\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','e851bf5e-29d6-4ed3-b70d-a15d49bfdcf0'),(1045,1045,1,'Curls with straighteners','curls-with-straighteners',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£20\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','895e5d7f-198a-4fda-9e43-3a49ef40fe9e'),(1046,1046,1,'Blow Bar','blow-bar',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£30\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','7f800579-19f5-44a3-8282-63878b1c7f66'),(1047,1047,1,'Clip-in Extensions Styling / Fitting','clip-in-extensions-styling-fitting',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £30\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','15f510db-00ee-498d-bb06-c07e759d9ecf'),(1048,1048,1,'Micro-Ring Extensions','micro-ring-extensions',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £50\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','3210f68d-b78a-4a01-a3ae-e844969871de'),(1049,1049,1,'Bridal Hair Services','bridal-hair-services',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"On Consultation\"}',1,'2025-07-31 09:39:00','2025-07-31 09:39:00','f892f398-9ce9-4c2a-ba29-8225ad2eac7b'),(1056,1056,1,NULL,'__temp_dahagafbtmlhqfyfzibjsbpuevogjcolisij',NULL,'{\"32026899-b103-417b-b8bf-9bf932c15b6e\": \"Pamper Parties!\", \"39e47c53-5179-4ae5-b33d-8decc8842b98\": \"Pamper Parties!\"}',1,'2025-07-31 09:47:12','2025-07-31 09:47:28','c218ae9d-a6fc-4e40-b8c3-061dc49d48ce'),(1057,1057,1,NULL,NULL,NULL,'{\"3e5918ed-78ce-4c03-9865-40127df22225\": \"<p>If you’re planning a hen party