ll ensure that we create the look you are looking for to compliment your dress making you feel beautiful and confident. We have been catering for teenagers on prom nights for over 7 years and we work with professional MAC make-up artists who are able to deliver your desired look.</p><p>As with weddings you will be advised to have a trial day where you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. Some of our stylists and make-up artists have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands.</p>\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','c568572c-f82a-4b38-9ca0-0189d545090c'),(1186,1186,1,'Plaits','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £12\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','16839664-57f6-4370-9ec4-b96a43cfca0b'),(1187,1187,1,'Trial Hair-Up from','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £18\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','156145f5-b14c-46c7-8ab5-02066c3f2d3a'),(1188,1188,1,'Hair Up','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £28\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','68734524-b4f3-4f40-9ee0-6fc13e82b036'),(1189,1189,1,'Curls with straighteners','curls-with-straighteners',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£20\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','a404e939-023d-4490-9a2b-2756fe3a89b7'),(1190,1190,1,'Blow Bar','blow-bar',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£30\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','965ef46c-9e46-471f-8f88-e8b313029083'),(1191,1191,1,'Clip-in Extensions Styling / Fitting','clip-in-extensions-styling-fitting',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £30\"}',1,'2025-07-31 10:02:59','2025-07-31 10:02:59','df8dce61-314d-4f00-b989-1b4b40aaed3a'),(1192,1192,1,'Micro-Ring Extensions','micro-ring-ex