perienced and professional team will ensure that we create the look you are looking for to compliment your dress making you feel beautiful and confident. We have been catering for teenagers on prom nights for over 7 years and we work with professional MAC make-up artists who are able to deliver your desired look.</p><p>As with weddings you will be advised to have a trial day where you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. Some of our stylists and make-up artists have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands.</p>\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','d4140e21-c8ec-4e53-be07-804cd53a01cc'),(1251,1251,1,'Plaits','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £12\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','f8c59ee5-7a8d-49d5-9533-8f8981f6736f'),(1252,1252,1,'Trial Hair-Up from','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £18\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','d7fbe24e-f75f-44d0-b5a4-b7b808d62366'),(1253,1253,1,'Hair Up','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £28\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','60b9e8b6-9343-4c71-ad09-69fa24f30b65'),(1254,1254,1,'Curls with straighteners','curls-with-straighteners',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£20\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','4b47f050-36e8-4f68-89ce-4dc67bab2dd1'),(1255,1255,1,'Blow Bar','blow-bar',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£30\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','81bd7d33-7b23-4117-b102-4e5e1e22ef3d'),(1256,1256,1,'Clip-in Extensions Styling / Fitting','clip-in-extensions-styling-fitting',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £30\"}',1,'2025-07-31 10:03:01','2025-07-31 10:03:01','bb006692-b7e3-42e7-ae49-b13008613d18'),(1257,1257,1,'Mic