dding is the same as another. We understand how important this is for both you and your family, that’s why it is imperative to have a trial so you can be completely confident with your look, style and of course your stylist.</p><p>On the trial day you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. It’s good to know that our stylists are all professionally trained and some have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands. Our wedding team are available at your disposal, both on site within the salon or at a venue or location of your choice.</p><p><strong>Proms</strong></p><p>Our experienced and professional team will ensure that we create the look you are looking for to compliment your dress making you feel beautiful and confident. We have been catering for teenagers on prom nights for over 7 years and we work with professional MAC make-up artists who are able to deliver your desired look.</p><p>As with weddings you will be advised to have a trial day where you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. Some of our stylists and make-up artists have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands.</p>\"}',1,'2025-07-31 10:04:58','2025-07-31 10:04:58','a0e32c59-fade-41fa-a832-bae7e05ad0e6'),(1372,1372,1,'Plaits','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £12\"}',1,'2025-07-31 10:04:58','2025-07-31 10:04:58','c788e946-0a5a-432b-b726-8545c1b5b3f1'),(1373,1373,1,'Trial Hair-Up from','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £18\"}',1,'2025-07-31 10:04:58','2025-07-31 10:04:58','14ae1cb4-cd85-4af9-8822-d125238fdd63'),(1374,1374,1,'Hair Up','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \