ridal for a number of years so you can be sure you are in safe hands. Our wedding team are available at your disposal, both on site within the salon or at a venue or location of your choice.</p><p><strong>Proms</strong></p><p>Our experienced and professional team will ensure that we create the look you are looking for to compliment your dress making you feel beautiful and confident. We have been catering for teenagers on prom nights for over 7 years and we work with professional MAC make-up artists who are able to deliver your desired look.</p><p>As with weddings you will be advised to have a trial day where you will have plenty of time to try a range of looks and styles, whether it be a natural or a glamorous look you go for to compliment your dress. Some of our stylists and make-up artists have worked in film, television, fashion and bridal for a number of years so you can be sure you are in safe hands.</p>\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','cd093a4f-75c8-4663-9ce4-620ab4d934fa'),(1429,1429,1,'Plaits','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £12\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','530e377c-bbe7-47f4-84ae-228faf98ab3a'),(1430,1430,1,'Trial Hair-Up from','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £18\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','d9a6b887-8be7-43dc-ae1a-cbfe23d38f2b'),(1431,1431,1,'Hair Up','bridal-hair',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"From £28\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','817edcd0-3861-44e5-84f2-e4352482f76d'),(1432,1432,1,'Curls with straighteners','curls-with-straighteners',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£20\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','d43ba4ea-6c5e-4c6e-97bc-4bd395a94fe7'),(1433,1433,1,'Blow Bar','blow-bar',NULL,'{\"c2b0540a-1814-4abe-8b0b-e8b9583e9c72\": \"£30\"}',1,'2025-07-31 10:04:59','2025-07-31 10:04:59','11269af1-fd26-4d34-aa96-504307bf942d'),(1434,1434,1,'Clip-in Ex