9:46:39','89fa329b-b25c-42cd-b7f1-9ab5a7026ba1'),(1814,1814,1,'Kerastraight','kerastraight','kerastraight','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The fantastic Kerastraight service is available in all our salons as its the market leading brand in the hair straightening sector.</p><p>See the recent example and how best to fight the Frizz.</p><p>Frizz. It’s a word that sends shockwaves through gorgeous hair lovers everywhere. Its not often you can create the perfect sleek look and by the time you arrive at the office, party or date your hair is like a fright wig?</p>\\n<p>For some, frizz is an ever-present hassle, something to battle every day before leaving the house, adding hours to your morning routine and starting the day off badly. In short, frizz is the enemy, but we can help you beat it! </p><p>Come and experience the Kerastraight phenomena at one of our salons. </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','7e45cb7f-c99a-455d-be69-f0355e7c1969'),(1815,1815,1,'Kerastraight','kerastraight','kerastraight','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The fantastic Kerastraight service is available in all our salons as its the market leading brand in the hair straightening sector.</p><p>See the recent example and how best to fight the Frizz.</p><p>Frizz. It’s a word that sends shockwaves through gorgeous hair lovers everywhere. Its not often you can create the perfect sleek look and by the time you arrive at the office, party or date your hair is like a fright wig?</p>\\n<p>For some, frizz is an ever-present hassle, something to battle every day before leaving the house, adding hours to your morning routine and starting the day off badly. In short, frizz is the enemy, but we can help you beat it! </p><p>Come and experience the Kerastraight phenomena at one of our salons. </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','c2dba443-a594-4d7b-9cf9-ebe4eee0a71c'),(1816,1816,1,'MP J Reynolds & the Openreach team from BT visit the salon to celebrate business Growth from High speed Broadband','mp-j-reynolds-and-open-reach-team-visit-salon-to-celebrate-business-growth-from-high-speed-braodband','mp-j-reynolds-and-open-reach-team-visit-salon-to-celebrate-business-growth-from-high-speed-braodband','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hyde hair and beauty salon sees sales up by ten per cent and creates new jobs\\n</p>\\n<p>Local MP for Stalybridge and Hyde, Jonathan Reynolds, visited a small business in his constituency, which has seen a ten per cent rise in sales year-on-year and created two new jobs as a result of upgrading to fibre broadband. The Leading Edge Hair and Beauty salon in Hyde, Greater Manchester, has used the new technology to enhance business systems and communications to engage better with customers. The number of new clients is up by 64 per cent, with almost 90 per cent saying they found the salon through the internet.</p>\\n<p>GetFileAttachment [1476957]</p>\\n<p>Jonathan Reynolds MP said: “Well done to Alan and all at The Leading Edge for making such a success of their superfast broadband. They’ve created a salon fit for the future that’s engaging customers in great new ways. I’m delighted they are seeing the rewards from their innovations.”</p>\\n<p>Alan Havery, co-owner of The Leading Edge, said: “The growth of our business wouldn’t have been possible without the faster broadband speeds. There are 36,000 regulated hair salons in the UK, so it’s really important to attract clients. We can provide good customer service once they are through the doors, but it’s about bringing in new people and maintaining strong customer retention rates. What we’re doing is innovating using technology. Instead of a picture of the outside of the salon, when people find us online, they can experience a video walk through of the inside. Lots of businesses do this, but not many hair salons so we’re able to get ahead of the competition.”</p>\\n<p>As well as helping them to market themselves better, fibre broadband has changed the way customers book appointments. Alan explains: “Convenience is what people want so we’ve introduced systems that allow customers to book appointments whenever they want and from wherever, using the new app we launched in July, on the website or through social media channels. A fireman on a night shift made a booking at ten past midnight for a time both him and his wife could come in. Since launching the app, online bookings are up by 98 per cent on the previous year, and now provide almost 19 per cent of overall bookings.”</p>\\n<p>The new systems have benefited staff as well as customers. Alan explains: “Salon staff can consult the online booking system from their smartphones either in the morning or the night before to better plan their time. We’ve significantly reduced the number of no shows as we’re able to contact customers via their preferred channel to confirm appointments. They can re-book, so we free up appointments at busy times and it saves the business money. Also, reviews influence 89 per cent of people’s purchasing decisions, so we ask for feedback and publish these reviews on social media channels. We have a five star rating on Facebook now.”</p>\\n<p>Mark Chamberlain, BT’s Get Digital Faster programme manager, said: “Businesses and consumers are seeing the benefits high speed broadband can provide.  Access to everyday products and services becomes easier, quicker and people can get better value for money, while job hunting, homework, running a business, using social media and finding entertainment are all at your fingertips. As we continue to fill in gaps in coverage, I’d urge people to check availability for their postcode and upgrade now as there are good deals available through a wide range of internet service providers.”</p>\\n<p>Fibre broadband has been deployed in parts of Hyde and Greater Manchester by the Get Digital Faster programme which reaches postcodes not covered by existing commercial networks. It is a £15 million partnership between BT and eight local authorities – with Stockport as the lead, Bolton, Bury, Oldham, Rochdale, Tameside, Trafford and Wigan – the Government’s Broadband Delivery UK (BDUK) and European Union Regional Development Fund. Overseen by Transport for Greater Manchester, more than 47,000 homes and businesses will be able to access fibre broadband by Spring 2017, meaning 99 per cent of the area will be covered when combined with private sector commercial networks.</p>\\n<p>Under the Get Digital Faster programme, engineers from BT’s local network business, Openreach, have installed 540 green roadside cabinets and 50km of fibre-optic cable to bring high-speed broadband to more than 46,000 properties across the region. In total, almost 740,000 properties across Greater Manchester can now access faster speeds when combined with BT’s own commercial network rollout. The Openreach network is open to all broadband service providers on an equal wholesale basis.</p>\\n<p>Find out more about Get Digital Faster at www.get-digital-faster.info.</p>\\n<p>For press/media inquiries please contact:</p>\\n<p>Janet Hare, BT Regional Press Office on 0800 085 0660</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','906b714e-779b-4879-ae0b-1133be023c08'),(1817,1817,1,'MP J Reynolds & the Openreach team from BT visit the salon to celebrate business Growth from High speed Broadband','mp-j-reynolds-and-open-reach-team-visit-salon-to-celebrate-business-growth-from-high-speed-braodband','mp-j-reynolds-and-open-reach-team-visit-salon-to-celebrate-business-growth-from-high-speed-braodband','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hyde hair and beauty salon sees sales up by ten per cent and creates new jobs\\n</p>\\n<p>Local MP for Stalybridge and Hyde, Jonathan Reynolds, visited a small business in his constituency, whi