 year, and now provide almost 19 per cent of overall bookings.”</p>\\n<p>The new systems have benefited staff as well as customers. Alan explains: “Salon staff can consult the online booking system from their smartphones either in the morning or the night before to better plan their time. We’ve significantly reduced the number of no shows as we’re able to contact customers via their preferred channel to confirm appointments. They can re-book, so we free up appointments at busy times and it saves the business money. Also, reviews influence 89 per cent of people’s purchasing decisions, so we ask for feedback and publish these reviews on social media channels. We have a five star rating on Facebook now.”</p>\\n<p>Mark Chamberlain, BT’s Get Digital Faster programme manager, said: “Businesses and consumers are seeing the benefits high speed broadband can provide.  Access to everyday products and services becomes easier, quicker and people can get better value for money, while job hunting, homework, running a business, using social media and finding entertainment are all at your fingertips. As we continue to fill in gaps in coverage, I’d urge people to check availability for their postcode and upgrade now as there are good deals available through a wide range of internet service providers.”</p>\\n<p>Fibre broadband has been deployed in parts of Hyde and Greater Manchester by the Get Digital Faster programme which reaches postcodes not covered by existing commercial networks. It is a £15 million partnership between BT and eight local authorities – with Stockport as the lead, Bolton, Bury, Oldham, Rochdale, Tameside, Trafford and Wigan – the Government’s Broadband Delivery UK (BDUK) and European Union Regional Development Fund. Overseen by Transport for Greater Manchester, more than 47,000 homes and businesses will be able to access fibre broadband by Spring 2017, meaning 99 per cent of the area will be covered when combined with private sector commercial networks.</p>\\n<p>Under the Get Digital Faster programme, engineers from BT’s local network business, Openreach, have installed 540 green roadside cabinets and 50km of fibre-optic cable to bring high-speed broadband to more than 46,000 properties across the region. In total, almost 740,000 properties across Greater Manchester can now access faster speeds when combined with BT’s own commercial network rollout. The Openreach network is open to all broadband service providers on an equal wholesale basis.</p>\\n<p>Find out more about Get Digital Faster at www.get-digital-faster.info.</p>\\n<p>For press/media inquiries please contact:</p>\\n<p>Janet Hare, BT Regional Press Office on 0800 085 0660</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','614cd8f5-be55-4926-88fa-7b10db073721'),(1818,1818,1,'Brand New Collagen Booster Sunbeds available at Hyde Salon','brand-new-collagen-booster-sunbeds-available-at-hyde-salon','brand-new-collagen-booster-sunbeds-available-at-hyde-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>NEW fast tanning lay down sunbed with Collagen face booster and Body and Leg booster tubes now available in our Hyde salon. The bed is fitted with collagen face booster tubes which stimulate and increase collagen production to regenerate skin by reducing fine lines, Wrinkles and Scars!\\n  </p>\\n<p>The beds body and leg booster tubes are designed to increase tanning production. £1 for 3 mins\\n  </p>\\n<p>*Please note we do NOT allow any person under the age of 18 to use the sunbeds\\n  </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','b7bd2889-6353-4570-90b4-fb7cc30f9b7e'),(1819,1819,1,'Brand New Collagen Booster Sunbeds available at Hyde Salon','brand-new-collagen-booster-sunbeds-available-at-hyde-salon','brand-new-collagen-booster-sunbeds-available-at-hyde-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>NEW fast tanning lay down sunbed with Collagen face booster and Body and Leg booster tubes now available in our Hyde salon. The bed is fitted with collagen face booster tubes which stimulate and increase collagen production to regenerate skin by reducing fine lines, Wrinkles and Scars!\\n  </p>\\n<p>The beds body and leg booster tubes are designed to increase tanning production. £1 for 3 mins\\n  </p>\\n<p>*Please note we do NOT allow any person under the age of 18 to use the sunbeds\\n  </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','a1fb9246-eed7-493c-8e1c-63517bdec8a3'),(1820,1820,1,'International clairvoyant to visit Leading Edge Hyde','international-clairvoyant-to-visit-hyde-salon','international-clairvoyant-to-visit-hyde-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Tracy Poskitt International clairvoyant / medium is at The Leading Edge Hair &amp; Beauty and available for private readings Friday 4th March 2016. I am a Natural clairvoyant medium. This means that I do readings without using any tools or gimmicks. With over 30 years of professional experience, I have become Internationally renowned and I am one of the country\'s leading genuine Natural psychic clairvoyant / medium I cover past, present and future in all areas of your life and give messages from loved ones who are in spirit. Whether you are seeking advice, guidance or just reassurance or if you have experienced a loved one passing, please call me and you will be amazed at how accurate, specific and helpful my readings are!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','1dc50548-737a-437e-bb90-5f8436aea3d4'),(1821,1821,1,'International clairvoyant to visit Leading Edge Hyde','international-clairvoyant-to-visit-hyde-salon','international-clairvoyant-to-visit-hyde-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Tracy Poskitt International clairvoyant / medium is at The Leading Edge Hair &amp; Beauty and available for private readings Friday 4th March 2016. I am a Natural clairvoyant medium. This means that I do readings without using any tools or gimmicks. With over 30 years of professional experience, I have become Internationally renowned and I am one of the country\'s leading genuine Natural psychic clairvoyant / medium I cover past, present and future in all areas of your life and give messages from loved ones who are in spirit. Whether you are seeking advice, guidance or just reassurance or if you have experienced a loved one passing, please call me and you will be amazed at how accurate, specific and helpful my readings are!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','1f8e79e4-cf74-4d83-b2e7-0fdad1bfb5e4'),(1822,1822,1,'Models Required for \"Wella Trend Vision\" 2018','models-required-for-wella-trend-vision-2018','models-required-for-wella-trend-vision-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Its that time of year again where we are looking for model\'s to enter this years Wella Trend Vision 2018. Last year we had a fantastic response and we were lucky enough to get to the final with 2 entries. This year we are looking for models between 15 and 30 who must allow us to be creative with their hair. We are particularly interested in short hair where we will add lots of pastel colours to your hair. If this is something you are interested in please contact Sarah our style director in our Stockport salon 0161-493-3330 where you can chat through the process and find out about our audition date.</p><p>You will get a free cut and colour and be able to choose a free picture of yourself for your portfolio from the professional photo shoot which we will hold.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','e8fa26df-6988-4aaa-a371-97c2586dfa36'),(1823,1823,1,'Models Required for \"Wella Trend Vision\" 2018','models-required-for-wella-trend-vision-2018','models-required-for-wella-trend-vision-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Its that time of year again where we are looking for model\'s to enter this years Wella Trend Vision 2018. Last year we had a fantastic response and we were lucky enough to get to the final with 2 entries. This year we are looking for models between 15 and 30 who must allow us to be creative with their hair. We are particularly interested in short hair where we will add lots of pastel colours to your hair. If this is something you are interested in please contact Sarah our style director in our Stockport salon 0161-493-3330 where you can chat through the process and find out about our audition date.</p><p>You will get a free cut and colour and be able to choose a free picture of yourself for your portfolio from the professional photo shoot which we will hold.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','6042f1f0-79af-471a-bc6a-97ee3cbda0cc'),(1824,1824,1,'INTRODUCING OUR NEW SERVICE \"WELLA COLOUR FRESH CREATE\"','introducing-our-new-service-wella-colour-fresh-create','introducing-our-new-service-wella-colour-fresh-create','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The 1970’s was a truly transformative decade, not only for its influence on fashion but as it also spawned a care-free attitude to experimentation that extended from lifestyle to hair color. The trend for bold, bright hair took hold with provocateurs from the 70’s during the punk period, who created a legacy that lasted – and has grown – through the decades. After all, creativity thrives where colour lives – we see colour in every creative sphere, from designer’s catwalk creations to celebrity transformations on camera. Expressive colour is here and ready to go mainstream.\\n  </p>\\n<p> A few decades later the hair care colour space is experiencing a boom with the return of bold and pastel palettes. Coty’s Wella Professionals introduces new Colour Fresh CREATE, ex expressive semi-permanent palette of 12 specially crafted fully intermixable pure vibrant shades and one Clear shade. Co-created with 9 Global Creative Artists, each Color Fresh CREATE line has distinctive packaging featuring unique logo expressions on each shade. Color Fresh CREATE offers limitless colour creativity colour choices to transform your client’s creative inspiration into real hair colour creations.</p>\\n<p>Meet the 9 color creators: </p>\\n<ul><li>Suzi Weiss-Fischmann, First Lady Of Nails OPI Founder\\n  </li><li>Clayde Baumann, Wella UK Top Artist\\n  </li><li>Jutta Gsell, Wella Dach Top Artist\\n  </li><li>Alexis Ferrer, Wella Global Creative Artist\\n  </li><li>Ash Crocker, Wella Australia Top Artist\\n  </li><li>Sonya Dove, Wella Global Creative Artist\\n  </li><li>Egidio Borri, Wella Italy Top Artist\\n  </li><li>Reiner Sauter, Wella VP Creative Hair\\n  </li><li>Jason Gray, Wella Global Creative Artist\\n</li></ul><p><i>“What I love about the arrival of Color Fresh CREATE is I now have the ability to expand my color communication in more imaginative ways. Every hue in the portfolio is richly saturated and has a unique personality that provokes the next level of artistry for me. I’m inspired to want to get to know each character and what they’re capable of alone, together, or in ways unimaginable!”</i>\\n  </p>\\n<p><b>Sonya Dove, Wella Professionals Global Creative Artist</b>\\n  </p>\\n<p> \\n  </p>\\n<p><i>“If I had to choose a fun color to dye my hair, it would be difficult to pick just one, I’d choose multiple colors, I think rainbow hair would be fun. If I was pushed to pick just one, it would be pink because everyone loves pink and it’s a fun festival look”</i>\\n  </p>\\n<p><b><i>Sophie Turner, Wella Professionals Global Brand Ambassador</i></b>    </p>\\n<p> \\n  </p>\\n<p>A true creative, semi-permanent* colour cream which fades true to tone over time and pastelizes during each wash, Wella Professionals Color Fresh CREATE, gradually fades into beautiful soft pastel hues and lasts up to 20 washes*, thanks to the carefully selected dyes that avoid an off tone fade, allowing clients to enjoy full creativity and freedom to change! Its Precision Cream formula enables controlled application and unlimited colouring techniques, while it is ammonia-free, fragrance-free and peroxide-free. Make your clients feel as unique as your creation with the new Color Fresh CREATE by Wella Professionals new semi-permanent expressive colour palette.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','b52cbbba-3a25-4eb4-8728-7c2322c117ff'),(1825,1825,1,'INTRODUCING OUR NEW SERVICE \"WELLA COLOUR FRESH CREATE\"','introducing-our-new-service-wella-colour-fresh-create','introducing-our-new-service-wella-colour-fresh-create','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The 1970’s was a truly transformative decade, not only for its influence on fashion but as it also spawned a care-free attitude to experimentation that extended from lifestyle to hair color. The trend for bold, bright hair took hold with provocateurs from the 70’s during the punk period, who created a legacy that lasted – and has grown – through the decades. After all, creativity thrives where colour lives – we see colour in every creative sphere, from designer’s catwalk creations to celebrity transformations on camera. Expressive colour is here and ready to go mainstream.\\n  </p>\\n<p> A few decades later the hair care colour space is experiencing a boom with the return of bold and pastel palettes. Coty’s Wella Professionals introduces new Colour Fresh CREATE, ex expressive semi-permanent palette of 12 specially crafted fully intermixable pure vibrant shades and one Clear shade. Co-created with 9 Global Creative Artists, each Color Fresh CREATE line has distinctive packaging featuring unique logo expressions on each shade. Color Fresh CREATE offers limitless colour creativity colour choices to transform your client’s creative inspiration into real hair colour creations.</p>\\n<p>Meet the 9 color creators: </p>\\n<ul><li>Suzi Weiss-Fischmann, First Lady Of Nails OPI Founder\\n  </li><li>Clayde Baumann, Wella UK Top Artist\\n  </li><li>Jutta Gsell, Wella Dach Top Artist\\n  </li><li>Alexis Ferrer, Wella Global Creative Artist\\n  </li><li>Ash Crocker, Wella Australia Top Artist\\n  </li><li>Sonya Dove, Wella Global Creative Artist\\n  </li><li>Egidio Borri, Wella Italy Top Artist\\n  </li><li>Reiner Sauter, Wella VP Creative Hair\\n  </li><li>Jason Gray, Wella Global Creative Artist\\n</li></ul><p><i>“What I love about the arrival of Color Fresh CREATE is I now have the ability to expand my color communication in more imaginative ways. Every hue in the portfolio is richly saturated and has a unique personality that provokes the next level of artistry for me. I’m inspired to want to get to know each character and what they’re capable of alone, together, or in ways unimaginable!”</i>\\n  </p>\\n<p><b>Sonya Dove, Wella Professionals Global Creative Artist</b>\\n  </p>\\n<p> \\n  </p>\\n<p><i>“If I had to choose a fun color to dye my hair, it would be difficult to pick just one, I’d choose multiple colors, I think rainbow hair would be fun. If I was pushed to pick just one, it would be pink because everyone loves pink and it’s a fun festival look”</i>\\n  </p>\\n<p><b><i>Sophie Turner, Wella Professionals Global Brand Ambassador</i></b>    </p>\\n<p> \\n  </p>\\n<p>A true creative, semi-permanent* colour cream which fades true to tone over time and pastelizes during each wash, Wella Professionals Color Fresh CREATE, gradually fades into beautiful soft pastel hues and lasts up to 20 washes*, thanks to the carefully selected dyes that avoid an off tone fade, allowing clients to enjoy full creativity and freedom to change! Its Precision Cream formula enables controlled application and unlimited colouring techniques, while it is ammonia-free, fragrance-free and peroxide-free. Make your clients feel as unique as your creation with the new Color Fresh CREATE by Wella Professionals new semi-permanent expressive colour palette.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','8aa4356e-b597-46cb-bfc0-8a864a1f1e42'),(1826,1826,1,'Valentine\'s Day Gift Vouchers','valentines-day-gift-vouchers','valentines-day-gift-vouchers','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<h3><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Great valentine\'s day gift idea. Why not pamper your loved one? Buy vouchers</a></h3>\\n<h2><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\"></a></h2>\\n<h2><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\"></a></h2>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','361e5ba8-77aa-4698-a192-471052ff1a83'),(1827,1827,1,'Valentine\'s Day Gift Vouchers','valentines-day-gift-vouchers','valentines-day-gift-vouchers','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<h3><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Great valentine\'s day gift idea. Why not pamper your loved one? Buy vouchers</a></h3>\\n<h2><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\"></a></h2>\\n<h2><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\"></a></h2>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','1f336ae8-e7ef-4616-983e-998bc5035576'),(1828,1828,1,'Apprentice Hairdresser','apprentice-hairdresser','apprentice-hairdresser','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is an amazing opportunity for someone who has a passion for hairdressing and wanting to develop their creative side. The apprentice will receive training both in the salon and one day a week at Terence Paul training academy.</p><p>The Level 2 apprentice will learn all the practical skills and communication skills related to the profession of hairdressing. Working to the best of their ability to get good results, develop good relationships with clients, be aware of the changing new looks and fashion trends. A hairdressing career is very rewarding and opens a lot of opportunities for future career progressions in various directions.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','0343b88c-06c3-4306-890d-604615cd651e'),(1829,1829,1,'Apprentice Hairdresser','apprentice-hairdresser','apprentice-hairdresser','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is an amazing opportunity for someone who has a passion for hairdressing and wanting to develop their creative side. The apprentice will receive training both in the salon and one day a week at Terence Paul training academy.</p><p>The Level 2 apprentice will learn all the practical skills and communication skills related to the profession of hairdressing. Working to the best of their ability to get good results, develop good relationships with clients, be aware of the changing new looks and fashion trends. A hairdressing career is very rewarding and opens a lot of opportunities for future career progressions in various directions.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','9fb5faef-3b75-4220-b2d8-e73d15667442'),(1830,1830,1,'Channel 4 on location in the salon random acts','channel-4-on-location-in-the-salon-random-acts','channel-4-on-location-in-the-salon-random-acts','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We were delighted when we were contacted by channel 4 to use one of our salons to shoot a short film for the Random Acts Project 2018. </p>\\n<p>Random Acts is Channel 4\'s short film strand dedicated to the arts, founded in 2011 to escape the conventions of arts broadcasting and to expand its possibilities.\\nThe world is full of TV about artists; Random Acts should instead be TV by artists. We want to encourage creative practitioners of all kinds to use the screen as a canvas. The brief is deliberately broad: we\'re after \\\"bold expressions of creativity\\\" and those could come from art, music, dance, animation, spoken word, performance, or some uncategorisable combination of the above. \\nWe don’t commission short docs or profile films, and we rarely commission short scripted dramas (although we will consider them if they are exceptional). We ask that the films be roughly 3-4 minutes in length. \\nPlease only pitch having first familiarised yourself with the kind of work that we commission: <a href=\\\"http://www.channel4.com/programmes/random-acts\\\" title=\\\"Random Acts page\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">http://www.channel4.com/programmes/random-acts </a>\\nRandom Acts should push boundaries, provoke thought and play with form. The strand showcases work from as diverse a range of creative people as we can find from across the UK and beyond - giving breaks to new talents and premiering work by established ones.\\nTo date, the strand has featured Riz Ahmed, Zawe Ashton, Shia La Beouf, Gemma Chan, Jake and Dinos Chapman, Ai Weiwei, Tinie Tempah, Kate Tempest, Gillian Wearing, Kwes, Marina Abramovic and many more. \\nSeries 1 - 4 of Random Acts premiered 2016 - 2017, with Series 5 and 6 of Random Acts set to air in 2018.</p>\\n<p>Filmmakers will be commissioned directly by Catherine Bray. To submit an idea, email <a href=\\\"mailto:catherine.bray@littledotstudios.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">c</a><a href=\\\"mailto:catherine.bray@littledotstudios.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">atherine.bray@littledotstudios.com</a>, copying in her assistant Jake Cunningham on <a href=\\\"mailto:copying%20in%20her%20assistant%20Jake%20Cunningham%20on%20jake.cunningham@littledotstudios.com\\\" title=\\\"Jake Cunningham\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">jake.cunningham@littledotstudios.com</a>, in the first instance with one paragraph outlining your idea and one paragraph outlining the talent involved in the film. She will let you know if we would like to see more.\\nWe do not require detailed treatments, shot lists or scripts at this stage, just a clear, concise idea of what the concept is and a coherent description of what we are going to see.</p>\\n<p>Please include links to previous work from the filmmakers and producer.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','55294820-bb41-419a-8ffe-44937e32fa98'),(1831,1831,1,'Channel 4 on location in the salon random acts','channel-4-on-location-in-the-salon-random-acts','channel-4-on-location-in-the-salon-random-acts','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We were delighted when we were contacted by channel 4 to use one of our salons to shoot a short film for the Random Acts Project 2018. </p>\\n<p>Random Acts is Channel 4\'s short film strand dedicated to the arts, founded in 2011 to escape the conventions of arts broadcasting and to expand its possibilities.\\nThe world is full of TV about artists; Random Acts should instead be TV by artists. We want to encourage creative practitioners of all kinds to use the screen as a canvas. The brief is deliberately broad: we\'re after \\\"bold expressions of creativity\\\" and those could come from art, music, dance, animation, spoken word, performance, or some uncategorisable combination of the above. \\nWe don’t commission short docs or profile films, and we rarely commission short scripted dramas (although we will consider them if they are exceptional). We ask that the films be roughly 3-4 minutes in length. \\nPlease only pitch having first familiarised yourself with the kind of work that we commission: <a href=\\\"http://www.channel4.com/programmes/random-acts\\\" title=\\\"Random Acts page\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">http://www.channel4.com/programmes/random-acts </a>\\nRandom Acts should push boundaries, provoke thought and play with form. The strand showcases work from as diverse a range of creative people as we can find from across the UK and beyond - giving breaks to new talents and premiering work by established ones.\\nTo date, the strand has featured Riz Ahmed, Zawe Ashton, Shia La Beouf, Gemma Chan, Jake and Dinos Chapman, Ai Weiwei, Tinie Tempah, Kate Tempest, Gillian Wearing, Kwes, Marina Abramovic and many more. \\nSeries 1 - 4 of Random Acts premiered 2016 - 2017, with Series 5 and 6 of Random Acts set to air in 2018.</p>\\n<p>Filmmakers will be commissioned directly by Catherine Bray. To submit an idea, email <a href=\\\"mailto:catherine.bray@littledotstudios.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">c</a><a href=\\\"mailto:catherine.bray@littledotstudios.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">atherine.bray@littledotstudios.com</a>, copying in her assistant Jake Cunningham on <a href=\\\"mailto:copying%20in%20her%20assistant%20Jake%20Cunningham%20on%20jake.cunningham@littledotstudios.com\\\" title=\\\"Jake Cunningham\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">jake.cunningham@littledotstudios.com</a>, in the first instance with one paragraph outlining your idea and one paragraph outlining the talent involved in the film. She will let you know if we would like to see more.\\nWe do not require detailed treatments, shot lists or scripts at this stage, just a clear, concise idea of what the concept is and a coherent description of what we are going to see.</p>\\n<p>Please include links to previous work from the filmmakers and producer.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','84adff98-3611-4962-b159-17a9c00dffd1'),(1832,1832,1,'Mothers Day Gift Idea','mothers-day-gift-idea','mothers-day-gift-idea','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Why not treat your mother to a real treat and have her pampered from head to foot with our vouchers which are now available to be delivered direct to your door without moving from your armchair.</p>\\n<p><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\">Buy Vouchers On-line</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','6a91f2fb-7a9e-4af8-ab39-ae7984d84bba'),(1833,1833,1,'Mothers Day Gift Idea','mothers-day-gift-idea','mothers-day-gift-idea','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Why not treat your mother to a real treat and have her pampered from head to foot with our vouchers which are now available to be delivered direct to your door without moving from your armchair.</p>\\n<p><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/collections/gift-vouchers\\\">Buy Vouchers On-line</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','e0d8c765-a7cd-4b01-8743-ca1fecc7e3c7'),(1834,1834,1,'Family Practice Gets Financial Boost From Hair Salon','family-practice-gets-financial-boost-from-hair-salon','family-practice-gets-financial-boost-from-hair-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A local family practice has received a welcome financial boost thanks to staff and customers at The Leading Edge Hair &amp; Beauty Salon. The salon with branches in Hyde and Stockport held a bazaar evening and a raffle to fundraise for the Alvanley Family Practice in Woodley.</p>\\n<p>Leading Edge owners Alan Havery and Barrie Aitken presented a cheque for £500 to grateful members of the Family Practice.\\n  </p>\\n<p>Speaking about the charity efforts Alan said; “We work with local charities each year and this year we came across the Family Practice Champions. They have a unique proposition helping people in the community by doing things nobody has ever done. We like innovation and we thought we must support these guys.”\\n  </p>\\n<p>Alan Barrie and their staff at The Leading Edge are planning to raise a further £500 before the year is out, much to the delight of Dave Chorlton who is chair of Alvanley Family Practice Health Champions.   </p>\\n<p>The Champions were formed 12 months ago. Explaining why, Dave said; “The NHS is in crisis. Part of the problem is not enough money to go around. What they’ve recognised is that probably one third of patients that go to the GP these days are going for unnecessary reasons. What they decided to do is send out a circular 12 months ago to see if anyone would be interested in forming a patient participation group. We called it the Health Champions. We’re completely autonomous from the practice and basically instead of somebody going to their GP when they are lonely we needed to come up with other solutions.”\\n  </p>\\n<p>The Health Champions have produced a list of over a dozen activities to improve the mental and physical well-being of patients at Alvanley Family Practice, such as a pram pushers walk for mothers and their babies, a sing-a-long group and a knit and natter group.\\n  </p>\\n<p>“All our members have had the various relevant training.” Dave said, “Some of our members phone up vulnerable patients just to chat and that might be the only phone call they get all week. We’ve got an allotment which is exciting. There is a lot of stuff going on.”\\n  </p>\\n<p>For more information on the Alvanley Family Practice Health Champions and their various activities you can email stoocg.healthchampions@nhs.net\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:45','76c2e49a-be9d-4abf-be2c-8f7599c280a3'),(1835,1835,1,'Family Practice Gets Financial Boost From Hair Salon','family-practice-gets-financial-boost-from-hair-salon','family-practice-gets-financial-boost-from-hair-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A local family practice has received a welcome financial boost thanks to staff and customers at The Leading Edge Hair &amp; Beauty Salon. The salon with branches in Hyde and Stockport held a bazaar evening and a raffle to fundraise for the Alvanley Family Practice in Woodley.</p>\\n<p>Leading Edge owners Alan Havery and Barrie Aitken presented a cheque for £500 to grateful members of the Family Practice.\\n  </p>\\n<p>Speaking about the charity efforts Alan said; “We work with local charities each year and this year we came across the Family Practice Champions. They have a unique proposition helping people in the community by doing things nobody has ever done. We like innovation and we thought we must support these guys.”\\n  </p>\\n<p>Alan Barrie and their staff at The Leading Edge are planning to raise a further £500 before the year is out, much to the delight of Dave Chorlton who is chair of Alvanley Family Practice Health Champions.   </p>\\n<p>The Champions were formed 12 months ago. Explaining why, Dave said; “The NHS is in crisis. Part of the problem is not enough money to go around. What they’ve recognised is that probably one third of patients that go to the GP these days are going for unnecessary reasons. What they decided to do is send out a circular 12 months ago to see if anyone would be interested in forming a patient participation group. We called it the Health Champions. We’re completely autonomous from the practice and basically instead of somebody going to their GP when they are lonely we needed to come up with other solutions.”\\n  </p>\\n<p>The Health Champions have produced a list of over a dozen activities to improve the mental and physical well-being of patients at Alvanley Family Practice, such as a pram pushers walk for mothers and their babies, a sing-a-long group and a knit and natter group.\\n  </p>\\n<p>“All our members have had the various relevant training.” Dave said, “Some of our members phone up vulnerable patients just to chat and that might be the only phone call they get all week. We’ve got an allotment which is exciting. There is a lot of stuff going on.”\\n  </p>\\n<p>For more information on the Alvanley Family Practice Health Champions and their various activities you can email stoocg.healthchampions@nhs.net\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:39','2025-08-01 09:46:39','172181ec-5c3d-40bb-a0d1-27c3c9f38598'),(1836,1836,1,'Beauty Services Back In Our Hyde Salon In Tameside','beauty-services-back-in-our-hyde-salon-in-tameside','beauty-services-back-in-our-hyde-salon-in-tameside','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce the arrival of Rabia who joins us from Lashious in Stockport town centre where she worked for 6 years attaining the position of salon manager. Rabia completed her 2 years training at Stockport College and The Beauty Accademy where she attained a VTCT level 2 in beauty therapy including Swedish Massage. She has also since completed a 2 year course for Microblading with Debbie Foster and qualified as a Nouveau Eye Lash Technician.</p>\\n<p>Rabia prides herself in delivering high quality work and will never rush any service she carries out as her goal is to ensure that she highlights your features and loves making clients happy by improving their appearance. Her customers return time and time again and always say how relaxed and calm she makes them feel so we are sure that you will be extremely happy with any service that Rabia provides for you in our beauty room.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','6ee5a788-0a32-4526-9b57-248a7936e930'),(1837,1837,1,'Beauty Services Back In Our Hyde Salon In Tameside','beauty-services-back-in-our-hyde-salon-in-tameside','beauty-services-back-in-our-hy