Privacy policy</b>\\n  </p>\\n<p>The Leading Edge Hair &amp; Beauty are committed to protecting your privacy. There are various ways that you might interact with The Leading Edge Hair &amp; Beauty, and the information you provide when doing so allows us to improve our services. By using this website and our related websites (collectively, the “Site”) and by supplying your details to The Leading Edge Hair &amp; Beauty, you consent to The Leading Edge Hair &amp; Beauty collecting and processing your information.\\n  </p>\\n<p>Our privacy policy explains:\\n  </p>\\n<p>What information we collect, and why we collect it;\\n  </p>\\n<p>How we use that information;\\n  </p>\\n<p>How we protect that information;\\n  </p>\\n<p>How you can control your information, including accessing, updating and deleting what we store; and\\n  </p>\\n<p>How we share information collected.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Compliance</b>\\n  </p>\\n<p>The Leading Edge Hair &amp; Beauty adheres to UK and international statutes and regulations which govern the protection of personal information. In the UK The Leading Edge Hair &amp; Beauty adheres to the General Data Protection Regulation Act (“GDPR”).   </p>\\n<p> \\n  </p>\\n<p><b>Information we collect and share</b>\\n  </p>\\n<p>We may collect or record basic personal information (e.g., name, e-mail address, mailing address, phone number) which you voluntarily provide through forms on our Site, through electronic mail you send to us, or through other means of communication between you and us.\\n  </p>\\n<p>We only collect personal information of a more sensitive nature (e.g. D.O.B, medical conditions &amp; allergies, credit card details and account numbers) where it is appropriate or necessary for conducting business. This information will be collected, stored, accessed and processed in a secure manner. We may also collect general non-personal information pertaining to users of our sites, including IP addresses, source domain names, specific web pages, length of time spent, and pages accessed. This information is collected, among other things, to aggregate statistical information, facilitate system administration and improve the Site. We recognise and have controls in place to ensure that the privacy of personal information about an identifiable individual used in the course of commercial activity is protected and managed\\n  </p>\\n<p>We also collect, use, and disclose identifiable information about individual contacts for our customers (“Business Contact Information”) in the ordinary course of our business for managing and maintaining customer relationships. In particular, we may obtain the following types of Business Contact Information: name, address, invoice information including bank account information, and order information. Unless otherwise specified or prohibited, we may share information with affiliates, business partners, service providers, subsidiaries or contractors who are required to provide you with services which you have requested from us.\\n  </p>\\n<p>We may also post links to third party websites as a service to you. These third party websites are operated by companies that are outside of our control, and your activities at those third party websites will be governed by the policies and practices of those third parties. We encourage you to review the privacy policies of these third parties before disclosing any information, as we are not responsible for the privacy policies of those websites.\\n  </p>\\n<p> \\n  </p>\\n<p><b>How we use information</b>\\n  </p>\\n<p>We use the information we collect to provide you with services which you request and to improve our existing services and the content of our Site. When you contact us, we may keep a record of your communication to help solve any issues that you might be facing. Your information may be retained for a reasonable time for use in future contact with you, or for future improvements to our services. You have the option to opt-out or opt-in for further communications from us.\\n  </p>\\n<p>We may also use or disclose your personal information when we believe, in good faith, that such use or disclosure is reasonably necessary to (i) comply with law, (ii) enforce or apply the terms of any of our user agreements, or (iii) protect our rights, property or safety,, or the rights, property or safety of our users, or others. We reserve the right to transfer and disclose your information if we become involved in a business divestiture, change of control, sale, merger, or acquisition of all or a part of our business.\\n  </p>\\n<p>In certain cases, we also operate as an information processor for our business customers. Our business customers remain the information controllers with respect to any customer information that they provide to us for our provision of services. We therefore act in accordance with the instructions of such customers regarding the collection, processing, storage, deletion and transfer of customer information, as well as other matters such as the provision of access to and rectification of customer information.\\n  </p>\\n<p>We do not sell our services to children. As such, our Sites are designed for adult user interaction. We do not intentionally collect personally identifiable information from children under the age of 13.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Web User Tracking – Use of Cookies, IP Addresses and Aggregate Information</b>\\n  </p>\\n<p>Cookies are a technology that can be used to help personalise your use of a website. A cookie is an element of information that a website can send to your browser, which may then store it on your system. You can set your browser to notify you when you receive a cookie, giving you the chance to decide whether to accept it or decline at any time. To enable us to assess the effectiveness and usefulness of this Site, and to give you the best user experience, we collect and store information such as pages viewed by you, your domain names and similar information. Our Site makes use of anonymous cookies for the purposes of:\\n  </p>\\n<p>Completion and support of Site activity;\\n  </p>\\n<p>Site and system administration;\\n  </p>\\n<p>Research and development; and\\n  </p>\\n<p>Anonymous user analysis, user profiling, and decision-making.\\n  </p>\\n<p>An Internet Protocol (“IP”) address is associated with your computer’s connection to the internet. We may use your IP address to help diagnose problems with our server, to administer the Site and to maintain contact with you as you navigate through the Site. Your computer’s IP address also may be used to provide you with information based upon your navigation through the Site.\\n  </p>\\n<p>Aggregate information is used to measure the visitors’ interest in, and use of, various areas of the Site and the various programs that we administer. We will rely upon aggregate information, which is information that does not identify you, such as statistical and navigational information. With this aggregate information, we may undertake statistical and other summary analyses of the visitors’ behaviours and characteristics.\\n  </p>\\n<p>Although we may share this aggregate information with third parties, none of this information will allow anyone to identify you, or to determine anything else personal about you.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Collection and use of employee personal information</b>\\n  </p>\\n<p>We also collect personal information from our employees and from job applicants (human resource data) in connection with administration of our human resources programs and functions. These programs and functions include, but are not limited to: job applications and hiring programs, compensation and benefit programs, performance appraisals, training, access to our facilities and computer networks, employee profiles, employee directories, human resource recordkeeping, and other employment related purposes. It is our policy to keep all past and present employee information private from disclosure to third parties. There are certain business related exceptions and they are:\\n  </p>\\n<p>To comply with municipal, regional, provincial or local government agency requests;\\n  </p>\\n<p>Inquiries from third parties with a signed authorisation from the employee to release the information, except in situations where limited verbal verifications are acceptable (see below);\\n  </p>\\n<p>Third parties with which we have contractual agreements to assist in administration of company sponsored benefits.\\n  </p>\\n<p>Prospective employers, government agencies, financial institutions, and residential property managers routinely contact us requesting information on a former or current employee’s work history and salary. All such requests of this type shall be referred to and completed on a confidential basis by the human resources department or payroll department. For written verification of employment requests, information will be provided on the form only when it is accompanied by an employee’s signed authorization to release information. The form will be returned directly to the requesting party and filed as part of the human resources or payroll department’s confidential records.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Security</b>\\n  </p>\\n<p>The security of your personal information is important to us. We follow generally accepted industry standards to protect the personal information submitted to us, both during transmission and once we receive it fully complying with the General Data Protection Regulations.\\n  </p>\\n<p>We use reasonable measures to safeguard personally identifiable information, which measures are appropriate to the type of information maintained, and follows applicable laws regarding the safeguarding of any such information under our control. In addition, in some areas of our Sites, we may use encryption technology to enhance information privacy and help prevent loss, misuse, or alteration of the information under our control.\\n  </p>\\n<p>We also employ industry-standard measures and processes for detecting and responding to inappropriate attempts to breach our systems.\\n  </p>\\n<p>No method of transmission over the Internet, or method of electronic storage, can be 100% secure. Therefore, we cannot guarantee the absolute security of your information.\\n  </p>\\n<p>The Internet by its nature is a public forum, and we encourage you to use caution when disclosing information online. Often, you are in the best situation to protect yourself online. You are responsible for protecting your username and password from third party access, and for selecting passwords that are secure.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Monitoring and enforcement</b>\\n  </p>\\n<p>We regularly review our compliance with our privacy policy. We also adhere to several self-regulatory frameworks in addition to complying with applicable law. If we receive formal written complaints, we will follow up with the person making the complaint. We work with the appropriate regulatory authorities to resolve any complaints that cannot be resolved directly ans are a member of the Trading Standards Body.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Social media and online engagement</b>\\n  </p>\\n<p>We occasionally use a variety of new technologies and social media options to communicate and interact with customers, potential customers, employees and potential employees. These sites and applications include popular social networking and media sites, open source software communities and more. To better engage the public in ongoing dialogue, certain of our businesses use certain third-party platforms including, but not limited to, Facebook, Twitter and LinkedIn. Third-Party Websites and Applications (TPWA) are Web-based technologies that are not exclusively operated or controlled by us. When interacting on those websites, you may reveal certain personal information to us or to third parties. Other than when used by our employees for the purpose of responding to a specific message or request, we will not use, share, or retain your personal information.\\n  </p>\\n<p> \\n  </p>\\n<p>The Facebook privacy policy is available at: http://www.facebook.com/policy.php.\\n  </p>\\n<p>The Twitter privacy policy is available at: http://twitter.com/privacy.\\n  </p>\\n<p>The LinkedIn privacy policy is available at: http://www.linkedin.com/static?key=privacy_policy.\\n  </p>\\n<p>Changes to this privacy policy\\n  </p>\\n<p>We may change this privacy policy from time to time. If this privacy policy changes, the revised privacy policy will be posted at the “Privacy Policy” link on the Site’s home page. In the event that the change is significant or material, we will notify you of such a change by revising the link on the home page to read “Newly Revised Privacy Policy.” Please check the privacy policy frequently. Your continued use of the Site constitutes acceptance of such changes in the privacy policy, except where further steps are required by applicable law. This privacy policy was last updated on the date set out at the end of the policy.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Contacting us</b>\\n  </p>\\n<p>Questions regarding this privacy policy should be directed to The Leading Edge Hair &amp; Beauty; telephone 0161 368 9999; e-mail enquiries@leadingedgehairandbeauty.co.uk\\n  </p>\\n<p> \\n  </p>\\n<p>LAST UPDATED: February, 2018\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','46cd8360-8b3f-4f1c-98db-4941b51fb9dd'),(1839,1839,1,'Privacy Policy','privacy-policy','privacy-policy','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><b>Website disclaimer</b></p>\\n<p>Whilst The Leading edge Hair &amp; Beauty Limited has made every effort to ensure the accuracy and currency of information provided on this site, The Leading Edge Hair &amp; Beauty Limited does not warrant the accuracy and completeness of the material on this website and cannot ac