a) in connection with administration of our human resources programs and functions. These programs and functions include, but are not limited to: job applications and hiring programs, compensation and benefit programs, performance appraisals, training, access to our facilities and computer networks, employee profiles, employee directories, human resource recordkeeping, and other employment related purposes. It is our policy to keep all past and present employee information private from disclosure to third parties. There are certain business related exceptions and they are:\\n  </p>\\n<p>To comply with municipal, regional, provincial or local government agency requests;\\n  </p>\\n<p>Inquiries from third parties with a signed authorisation from the employee to release the information, except in situations where limited verbal verifications are acceptable (see below);\\n  </p>\\n<p>Third parties with which we have contractual agreements to assist in administration of company sponsored benefits.\\n  </p>\\n<p>Prospective employers, government agencies, financial institutions, and residential property managers routinely contact us requesting information on a former or current employee’s work history and salary. All such requests of this type shall be referred to and completed on a confidential basis by the human resources department or payroll department. For written verification of employment requests, information will be provided on the form only when it is accompanied by an employee’s signed authorization to release information. The form will be returned directly to the requesting party and filed as part of the human resources or payroll department’s confidential records.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Security</b>\\n  </p>\\n<p>The security of your personal information is important to us. We follow generally accepted industry standards to protect the personal information submitted to us, both during transmission and once we receive it fully complying with the General Data Protection Regulations.\\n  </p>\\n<p>We use reasonable measures to safeguard personally identifiable information, which measures are appropriate to the type of information maintained, and follows applicable laws regarding the safeguarding of any such information under our control. In addition, in some areas of our Sites, we may use encryption technology to enhance information privacy and help prevent loss, misuse, or alteration of the information under our control.\\n  </p>\\n<p>We also employ industry-standard measures and processes for detecting and responding to inappropriate attempts to breach our systems.\\n  </p>\\n<p>No method of transmission over the Internet, or method of electronic storage, can be 100% secure. Therefore, we cannot guarantee the absolute security of your information.\\n  </p>\\n<p>The Internet by its nature is a public forum, and we encourage you to use caution when disclosing information online. Often, you are in the best situation to protect yourself online. You are responsible for protecting your username and password from third party access, and for selecting passwords that are secure.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Monitoring and enforcement</b>\\n  </p>\\n<p>We regularly review our compliance with our privacy policy. We also adhere to several self-regulatory frameworks in addition to complying with applicable law. If we receive formal written complaints, we will follow up with the person making the complaint. We work with the appropriate regulatory authorities to resolve any complaints that cannot be resolved directly ans are a member of the Trading Standards Body.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Social media and online engagement</b>\\n  </p>\\n<p>We occasionally use a variety of new technologies and social media options to communicate and interact with customers, potential customers, employees and potential employees. These sites and applications include popular social networking and media sites, open source software communities and more. To better engage the public in ongoing dialogue, certain of our businesses use certain third-party platforms including, but not limited to, Facebook, Twitter and LinkedIn. Third-Party Websites and Applications (TPWA) are Web-based technologies that are not exclusively operated or controlled by us. When interacting on those websites, you may reveal certain personal information to us or to third parties. Other than when used by our employees for the purpose of responding to a specific message or request, we will not use, share, or retain your personal information.\\n  </p>\\n<p> \\n  </p>\\n<p>The Facebook privacy policy is available at: http://www.facebook.com/policy.php.\\n  </p>\\n<p>The Twitter privacy policy is available at: http://twitter.com/privacy.\\n  </p>\\n<p>The LinkedIn privacy policy is available at: http://www.linkedin.com/static?key=privacy_policy.\\n  </p>\\n<p>Changes to this privacy policy\\n  </p>\\n<p>We may change this privacy policy from time to time. If this privacy policy changes, the revised privacy policy will be posted at the “Privacy Policy” link on the Site’s home page. In the event that the change is significant or material, we will notify you of such a change by revising the link on the home page to read “Newly Revised Privacy Policy.” Please check the privacy policy frequently. Your continued use of the Site constitutes acceptance of such changes in the privacy policy, except where further steps are required by applicable law. This privacy policy was last updated on the date set out at the end of the policy.\\n  </p>\\n<p> \\n  </p>\\n<p><b>Contacting us</b>\\n  </p>\\n<p>Questions regarding this privacy policy should be directed to The Leading Edge Hair &amp; Beauty; telephone 0161 368 9999; e-mail enquiries@leadingedgehairandbeauty.co.uk\\n  </p>\\n<p> \\n  </p>\\n<p>LAST UPDATED: February, 2018\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','ec36b875-a6b6-41d3-b1ad-6555e78604e0'),(1840,1840,1,'Were through to \"The Regional Finals\" for the 2nd year in a row.','were-through-to-the-regional-finals-for-the-2nd-year-in-a-row','were-through-to-the-regional-finals-for-the-2nd-year-in-a-row','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"http://www.esteticamagazine.co.uk/ukeventnews/item/20666-wella-professionals-launches-uk-ireland-trendvision-award-2018\\\">Wella Trend Vision 2018</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','eeba76cc-6bc2-4720-944c-0a03c22fb507'),(1841,1841,1,'Were through to \"The Regional Finals\" for the 2nd year in a row.','were-through-to-the-regional-finals-for-the-2nd-year-in-a-row','were-through-to-the-regional-finals-for-the-2nd-year-in-a-row','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"http://www.esteticamagazine.co.uk/ukeventnews/item/20666-wella-professionals-launches-uk-ireland-trendvision-award-2018\\\">Wella Trend Vision 2018</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','cde975bd-0a83-4a15-9009-6643adc160bb'),(1842,1842,1,'Charity Christmas Toy Appeal','charity-christmas-toy-appeal','charity-christmas-toy-appeal','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A big thanks to all our customers and staff who donated toys for Christmas 2017. Tameside4good have sent this update so you can see what a difference you all made.</p>\\n<p><br /></p>\\n<p>Dear Alan,   </p>\\n<p> \\n  </p>\\n<p>Thank you to The Leading Edge Hair &amp; Beauty for donating to the Tameside Christmas Toy Appeal.   </p>\\n<p> On behalf of ourselves and partners, we would like to reiterate our thanks for taking part in the Toy Appeal. Your gifts and those of your staff, together with other participating organisations, have meant nearly 1000 toys were collected, enabling children in over 100 families to receive gifts on Christmas Day. </p>\\n<p> We have received several wonderful reports on the difference the appeal makes, which we would like to share with you.</p>\\n<p><em> “I would like to say a huge thank you to everyone who contributed! We had every different type of toy you can imagine and some people clearly dedicated lots of time and effort, as there were hand-knitted dolls that were beautiful and unique gifts for children who would otherwise have gone without. It was heart-warming to see the generosity of the people of Tameside and made us all well and truly feels the spirit of Christmas!”</em></p>\\n<p><em> “Thank you so much! It was a God-send. And one of the presents I got for my son, a chess set, was perfect for him as he’s in a chess club in school.”</em></p>\\n<p> One of the Family Support workers said</p>\\n<p><em> “We gave to one family with a child,  and the toys were the main presents he got.”</em></p>\\n<p><em> “Another family was staying in emergency accommodation fleeing Domestic Violence, and was very grateful for the gifts”</em></p>\\n<p> The Tameside Christmas Toy Appeal was organised by Tameside 4 Good, Tameside Reporter/ Tameside Radio, Tameside Rotary and Tameside Council\'s Early Help Team. We would like to thank you again for your contributions.</p>\\n<p> Please let us know if you will be joining us again this December, by responding to this email.</p>\\n<p> We are planning future fundraising events to support local causes, see our website <a href=\\\"https://www.actiontogether.org.uk/our-impact-0\\\">https://www.actiontogether.org.uk/our-impact-0</a></p>\\n<p>for details of the impact your support is having.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','6b9f1021-45af-41ef-a425-f4b8d78649ee'),(1843,1843,1,'Charity Christmas Toy Appeal','charity-christmas-toy-appeal','charity-christmas-toy-appeal','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A big thanks to all our customers and staff who donated toys for Christmas 2017. Tameside4good have sent this update so you can see what a difference you all made.</p>\\n<p><br /></p>\\n<p>Dear Alan,   </p>\\n<p> \\n  </p>\\n<p>Thank you to The Leading Edge Hair &amp; Beauty for donating to the Tameside Christmas Toy Appeal.   </p>\\n<p> On behalf of ourselves and partners, we would like to reiterate our thanks for taking part in the Toy Appeal. Your gifts and those of your staff, together with other participating organisations, have meant nearly 1000 toys were collected, enabling children in over 100 families to receive gifts on Christmas Day. </p>\\n<p> We have received several wonderful reports on the difference the appeal makes, which we would like to share with you.</p>\\n<p><em> “I would like to say a huge thank you to everyone who contributed! We had every different type of toy you can imagine and some people clearly dedicated lots of time and effort, as there were hand-knitted dolls that were beautiful and unique gifts for children who would otherwise have gone without. It was heart-warming to see the generosity of the people of Tameside and made us all well and truly feels the spirit of Christmas!”</em></p>\\n<p><em> “Thank you so much! It was a God-send. And one of the presents I got for my son, a chess set, was perfect for him as he’s in a chess club in school.”</em></p>\\n<p> One of the Family Support workers said</p>\\n<p><em> “We gave to one family with a child,  and the toys were the main presents he got.”</em></p>\\n<p><em> “Another family was staying in emergency accommodation fleeing Domestic Violence, and was very grateful for the gifts”</em></p>\\n<p> The Tameside Christmas Toy Appeal was organised by Tameside 4 Good, Tameside Reporter/ Tameside Radio, Tameside Rotary and Tameside Council\'s Early Help Team. We would like to thank you again for your contributions.</p>\\n<p> Please let us know if you will be joining us again this December, by responding to this email.</p>\\n<p> We are planning future fundraising events to support local causes, see our website <a href=\\\"https://www.actiontogether.org.uk/our-impact-0\\\">https://www.actiontogether.org.uk/our-impact-0</a></p>\\n<p>for details of the impact your support is having.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','398bfad9-5b0b-42d8-b6c4-30f5a9b769d8'),(1844,1844,1,'Barber Apprentice','barber-apprentice','barber-apprentice','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Apply Apprentice Barber</a></p><p><a href=\\\"https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021\\\">https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','eefcdbdd-35ee-4584-8fdc-34ac55e0dec0'),(1845,1845,1,'Barber Apprentice','barber-apprentice','barber-apprentice','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Apply Apprentice Barber</a></p><p><a href=\\\"https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021\\\">https://www.findapprenticeship.service.gov.uk/apprenticeship/-275021</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','af61dbc5-2339-4151-99fb-b9f2eb8f335b'),(1846,1846,1,'Why not download our APP','why-not-download-our-app','why-not-download-our-app','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.facebook.com/leadingedgehairandbeauty/videos/10156319530078150/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">See how to download our APP for online bookings, vouchers and products.</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','a961a8b8-c808-40ed-93ad-0fc8f3f33f47'),(1847,1847,1,'Why not download our APP','why-not-download-our-app','why-not-download-our-app','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.facebook.com/leadingedgehairandbeauty/videos/10156319530078150/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">See how to download our APP for online bookings, vouchers and products.</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','ecf375e4-6eba-4a7e-b340-753243c1375e'),(1848,1848,1,'Men\'s and Ladies Perms','mens-and-ladies-perms','mens-and-ladies-perms','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Keep ahead of the trends with our Men\'s and Ladies <a href=\\\"https://www.heart.co.uk/showbiz/celebrities/celebrity-photos/perm/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">perming</a> services. We use only the industry\'s best perming products supplied from Wella to deliver your required look.</p><p>Their new solutions contain a combination of high-conditioning ingredients to deliver shinier hair with more bounce and less frizz. </p><p>The <a href=\\\"https://www.liverpoolecho.co.uk/news/nostalgia/how-liverpool-led-way-hairdressing-12624774\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">80\'s</a> are on the way back. We are seeing more and more demand from discerning customers looking to create the iconic look. The permed bouffant became very fashionable among both men and women and was adorned by musicians, actors and sports personalities. We can create the look you desire by delivering full curls, soft curls, tight curls or a simple demi wave to give fullness and movement. </p><p>Call the salon for further details and book in for a free consultation.</p><p><br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','aa2a3680-dbcc-4f07-bb00-9cd7895740b3'),(1849,1849,1,'Men\'s and Ladies Perms','mens-and-ladies-perms','mens-and-ladies-perms','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Keep ahead of the trends with our Men\'s and Ladies <a href=\\\"https://www.heart.co.uk/showbiz/celebrities/celebrity-photos/perm/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">perming</a> services. We use only the industry\'s best perming products supplied from Wella to deliver your required look.</p><p>Their new solutions contain a combination of high-conditioning ingredients to deliver shinier hair with more bounce and less frizz. </p><p>The <a href=\\\"https://www.liverpoolecho.co.uk/news/nostalgia/how-liverpool-led-way-hairdressing-12624774\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">80\'s</a> are on the way back. We are seeing more and more demand from discerning customers looking to create the iconic look. The permed bouffant became very fashionable among both men and women and was adorned by musicians, actors and sports personalities. We can create the look you desire by delivering full curls, soft curls, tight curls or a simple demi wave to give fullness and movement. </p><p>Call the salon for further details and book in for a free consultation.</p><p><br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','e156a477-f63c-42af-8db2-e7582d22be23'),(1850,1850,1,'Charity Golf Day Event (Tameside 4 Good)','charity-golf-day-event-tameside-4-good','charity-golf-day-event-tameside-4-good','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Tameside 4 Good are hosting a Charity Golf Day on Fri 7 September. Any golfers who would be interested please contact Tameside 4 Good.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','e99bf25b-5c2e-4cfd-827d-f38cbdc40b0a'),(1851,1851,1,'Charity Golf Day Event (Tameside 4 Good)','charity-golf-day-event-tameside-4-good','charity-golf-day-event-tameside-4-good','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Tameside 4 Good are hosting a Charity Golf Day on Fri 7 September. Any golfers who would be interested please contact Tameside 4 Good.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','53f6c823-a034-45d2-b09e-0635c0ac6e16'),(1852,1852,1,'In Loving Memory of Monika Nos','in-loving-memory-of-monika-nos','in-loving-memory-of-monika-nos','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>It is with great sadness and a heavy heart to tell you all that our beloved Monika Nos passed away in the early hours on Saturday 6th October 2018. As you all know Monika was a big part of The Leading Edge team. Monika originally worked at the Hyde salon and most recently started at our Great Moor salon, so we know that all of her lovely clients will feel the same pain and sadness that we do. Our thoughts are now with Shak, her family and friends as they go through this very sorrowful time. More information on Monika’s passing will be posted on our website in due course.    </p>\\n<p>We thank you all for your kind thoughts and prayers.   </p>\\n<p>The Leading Edge team.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','6d90b18d-17b9-4d07-8029-5e5cb64c796d'),(1853,1853,1,'In Loving Memory of Monika Nos','in-loving-memory-of-monika-nos','in-loving-memory-of-monika-nos','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>It is with great sadness and a heavy heart to tell you all that our beloved Monika Nos passed away in the early hours on Saturday 6th October 2018. As you all know Monika was a big part of The Leading Edge team. Monika originally worked at the Hyde salon and most recently started at our Great Moor salon, so we know that all of her lovely clients will feel the same pain and sadness that we do. Our thoughts are now with Shak, her family and friends as they go through this very sorrowful time. More information on Monika’s passing will be posted on our website in due course.    </p>\\n<p>We thank you all for your kind thoughts and prayers.   </p>\\n<p>The Leading Edge team.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','a539754d-ada7-42e9-8e9b-a1d15f89c797'),(1854,1854,1,'Book Of Condolence','book-of-condolence','book-of-condolence','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The partner and family of Monika have asked if we would provide a book of condolence so that we can gather your thoughts and memories to pass on to them. </p><p>So if your passing or in the Hyde area please pop into the salon and share your thoughts and memories of such a special person.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','f81d3b73-5fa5-4aa7-9fb5-bc4abb971b87'),(1855,1855,1,'Book Of Condolence','book-of-condolence','book-of-condolence','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The partner and family of Monika have asked if we would provide a book of condolence so that we can gather your thoughts and memories to pass on to them. </p><p>So if your passing or in the Hyde area please pop into the salon and share your thoughts and memories of such a special person.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','ed2d13f3-9ddd-406d-802b-9932dbf8c6e3'),(1856,1856,1,'Hyde Salon Christmas Opening Hours 2018','hyde-salon-christmas-opening-hours-2018','hyde-salon-christmas-opening-hours-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hyde Salon Christmas Opening Hours 2018</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','1cf4eb6e-1a65-472c-9cb1-a5d6d1c00431'),(1857,1857,1,'Hyde Salon Christmas Opening Hours 2018','hyde-salon-christmas-opening-hours-2018','hyde-salon-christmas-opening-hours-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hyde Salon Christmas Opening Hours 2018</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','6b84b0e8-706b-4eb5-a068-a2c8ab43853c'),(1858,1858,1,'Stockport Christmas Opening Hours 2018','stockport-christmas-opening-hours-2018','stockport-christmas-opening-hours-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Great Moor, Stockport, Christmas Opening Hours 2018</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','2b21ba46-298b-4b15-8d45-b3f1168f58e7'),(1859,1859,1,'Stockport Christmas Opening Hours 2018','stockport-christmas-opening-hours-2018','stockport-christmas-opening-hours-2018','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Great Moor, Stockport, Christmas Opening Hours 2018</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','a61f732d-1394-48a6-a67d-6d1819f1a388'),(1860,1860,1,'Microblading Services Now Available','microblading-services-nowavailable','microblading-services-nowavailable','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are now fully accredited by Tameside Council to deliver Microblading Services.</p>\\n<p>Microblading is a semi-permanent tattooing technique. It can be sometimes referred to as SPMU, micro-stroking and even eyebrow tattooing. It creates hairlike strokes to fill in thinning or sparse brows. Its a very popular treatment that allows you to have your desired brow shape, giving an effortless full brow, removing the need for expensive brow gels or pencils. </p><p>Whether you have got naturally sparse brows, suffer from thinning hair or alopecia, or if you just fancy a little more definition microblading is for you.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','aefac75d-3c40-47a8-beeb-3cc1019582dc'),(1861,1861,1,'Microblading Services Now Available','microblading-services-nowavailable','microblading-services-nowavailable','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are now fully accredited by Tameside Council to deliver Microblading Services.</p>\\n<p>Microblading is a semi-permanent tattooing technique. It can be sometimes referred to as SPMU, micro-stroking and even eyebrow tattooing. It creates hairlike strokes to fill in thinning or sparse brows. Its a very popular treatment that allows you to have your desired brow shape, giving an effortless full brow, removing the need for expensive brow gels or pencils. </p><p>Whether you have got naturally sparse brows, suffer from thinning hair or alopecia, or if you just fancy a little more definition microblading is for you.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','3bf8c488-2d18-46d5-8b4b-1dd558c2a517'),(1862,1862,1,'Bazaar Evening In Memory Of Monika Wednesday 28th November 6pm - 8.30pm','bazaar-evening-in-memory-of-monika-wednesday-28th-november','bazaar-evening-in-memory-of-monika-wednesday-28th-november','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>PURCHASE YOUR RAFFLE TICKETS IN EITHER OF OUR SALONS</p>\\n<p>We have over 8 unique stalls selling bespoke products including candles, cakes, Bodyshop, Neals Yard, handbags, artisan gifts, wella haircare, fashion clothing along with free consultations for hair colouring, reflexology, diet care, microblading, and a full range of aesthetic services. </p><p>We are also delighted to announce that Adam from Twisted Etiquette will be singing some of Shak &amp; Monikas favourite songs. </p>\\n<p>We are also selling tickets now in the salons to raise funds to build a memorial for Monika. We have over £800 worth of prizes available. The draw will take place on the evening of the Bazaar event which starts at 6pm until 8pm.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','47e3bf46-c574-4b7f-b347-d04dea501a4f'),(1863,1863,1,'Bazaar Evening In Memory Of Monika Wednesday 28th November 6pm - 8.30pm','bazaar-evening-in-memory-of-monika-wednesday-28th-november','bazaar-evening-in-memory-of-monika-wednesday-28th-november','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>PURCHASE YOUR RAFFLE TICKETS IN EITHER OF OUR SALONS</p>\\n<p>We have over 8 unique stalls selling bespoke products including candles, cakes, Bodyshop, Neals Yard, handbags, artisan gifts, wella haircare, fashion clothing along with free consultations for hair colouring, reflexology, diet care, microblading, and a full range of aesthetic services. </p><p>We are also delighted to announce that Adam from Twisted Etiquette will be singing some of Shak &amp; Monikas favourite songs. </p>\\n<p>We are also selling tickets now in the salons to raise funds to build a memorial for Monika. We have over £800 worth of prizes available. The draw will take place on the evening of the Bazaar event which starts at 6pm until 8pm.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','c9878d9f-702a-47ef-80c2-a5eb25ae6323'),(1864,1864,1,'Reflexology Services Now Available','reflexology-services-now-available','reflexology-services-now-available','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Welcome to Dragonfly Reflexology with Sarah Selbie<br /></p>\\n<p>Sarah will be available for treatments at The Leading-Edge Salon in Hyde from December 2018 every Friday.\\n </p>\\n<p>Help your body to heal naturally with Sarah who is a highly experienced Reflexologist.</p>\\n<p>Sarah believes in a holistic approach to treatments, incorporating mind body and spirit.\\n </p>\\n<p>Sarah became interested in holistic therapies following personal health issues in the late 1990’s as she was looking for alternative ways to improve her wellbeing. She successfully completed Level 2 and Level 3 in Reflexology by 2002. sarah is a member of the Federation of Holistic Therapists and follows a professional code of conduct. She has had experience practising Reflexology in various settings. A mobile therapist working in individuals’ own homes, beauty salons, nursing homes, Social services and NHS community Homes and working with staff in their own workplaces.\\n </p>\\n<p>She can adapt her treatments for your individual requirements and support you to enable your body to rebalance and restore itself.</p>\\n<p>Reflexology is an ancient natural non-invasive treatment involving the stimulation of reflexes on feet or hands which correlate to body organs and systems and a relaxing massage. This has evolved over centuries and it is believed encourages free flow of natural body energy. 80% of illness can be caused by our stressful lifestyles and lack of self-care, this can cause blockages and pain and disease. It is believed as your body relaxes it will activate a natural rebalancing of your body and healing can occur.</p>\\n<p>An initial consultation will take place, you will then be positioned comfortably in a reclining chair with your feet elevated. The treatment will last for 45-60 minutes.\\n </p>\\n<p>Benefits of Reflexology </p>\\n<p>Relaxation and reduction of stress, improved circulation, increased energy levels, regulation of sleep patterns, reduction of pain, regulation of menstrual cycles, reduction in migraines, relief from constipation, feeling of improved general well-being.\\n </p>\\n<p>It\'s Sarah\'s intention that you will have a relaxing treatment. All reactions are subjective/personal to every individual. Some side effects may occur up to 48 hours following the treatment as your body is rebalancing. Follow up aftercare advise will be given at the end of each session.\\n </p>\\n<p>For more information or to book a treatment please contact Sarah on 07808477988 or </p>\\n<p>e-mail <a href=\\\"mailto:seselbie@gmail.com\\\">seselbie@gmail.com</a>\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:45','c96c71d4-a871-4ed5-8905-55d1b9fb9ba4'),(1865,1865,1,'Reflexology Services Now Available','reflexology-services-now-available','reflexology-services-now-available','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Welcome to Dragonfly Reflexology with Sarah Selbie<br /></p>\\n<p>Sarah will be available for treatments at The Leading-Edge Salon in Hyde from December 2018 every Friday.\\n </p>\\n<p>Help your body to heal naturally with Sarah who is a highly experienced Reflexologist.</p>\\n<p>Sarah believes in a holistic approach to treatments, incorporating mind body and spirit.\\n </p>\\n<p>Sarah became interested in holistic therapies following personal health issues in the late 1990’s as she was looking for alternative ways to improve her wellbeing. She successfully completed Level 2 and Level 3 in Reflexology by 2002. sarah is a member of the Federation of Holistic Therapists and follows a professional code of conduct. She has had experience practising Reflexology in various settings. A mobile therapist working in individuals’ own homes, beauty salons, nursing homes, Social services and NHS community Homes and working with staff in their own workplaces.\\n </p>\\n<p>She can adapt her treatments for your individual requirements and support you to enable your body to rebalance and restore itself.</p>\\n<p>Reflexology is an ancient natural non-invasive treatment involving the stimulation of reflexes on feet or hands which correlate to body organs and systems and a relaxing massage. This has evolved over centuries and it is believed encourages free flow of natural body energy. 80% of illness can be caused by our stressful lifestyles and lack of self-care, this can cause blockages and pain and disease. It is believed as your body relaxes it will activate a natural rebalancing of your body and healing can occur.</p>\\n<p>An initial consultation will take place, you will then be positioned comfortably in a reclining chair with your feet elevated. The treatment will last for 45-60 minutes.\\n </p>\\n<p>Benefits of Reflexology </p>\\n<p>Relaxation and reduction of stress, improved circulation, increased energy levels, regulation of sleep patterns, reduction of pain, regulation of menstrual cycles, reduction in migraines, relief from constipation, feeling of improved general well-being.\\n </p>\\n<p>It\'s Sarah\'s intention that you will have a relaxing treatment. All reactions are subjective/personal to every individual. Some side effects may occur up to 48 hours following the treatment as your body is rebalancing. Follow up aftercare advise will be given at the end of each session.\\n </p>\\n<p>For more information or to book a treatment please contact Sarah on 07808477988 or </p>\\n<p>e-mail <a href=\\\"mailto:seselbie@gmail.com\\\">seselbie@gmail.com</a>\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:40','2025-08-01 09:46:40','6bef99c6-6c24-4b35-bc00-841eb13741ef'),(1866,1866,1,'Raffle Winners from Monika\'s Memorial','raffle-winners-from-monikas-memorial','raffle-winners-from-monikas-memorial','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce the following winners and prizes from our fund raising Bazaar evening in aid of our dear colleague Monika Nos.</p>\\n<p>Hand Bag won by Louise</p>\\n<p>Perfume won by Mike from Diet Care</p>\\n<p>1 hour facial by RS Beauty won by Rachael Howson</p>\\n<p>Norah Lane PCSO Diet care book won by Egle Prelgausk</p>\\n<p>Neilds Yard Skin Care kit won by Jessica</p>\\n<p>1 Set of Gel nails by Natasha won by Angela knight</p>\\n<p>Diet Care Coarse worth £90 won by Angela Nuttall</p>\\n<p>£25 voucher for Lisa Jay Aesthetics won by Cheryl Williams</p>\\n<p>3 Bottles of wine won by Shelly</p>\\n<p>3 Holdalls won by Carol Johnson</p>\\n<p>Bodyshop voucher for Pamper &amp; Prosecco Night won by Amy Peart</p>\\n<p>Vic\'s special keepsakes Bee light wonby Rachael Howson</p>\\n<p>Luxury Pedicure and Gel Polish by Greta won by Michelle Scully</p>\\n<p>Simply Cakes Chocolate Orange Cake won by Suzanne</p>\\n<p>1 Hour facial by RS Beauty won by Lucy Sidebottom</p>\\n<p>Melted Ego pot wax and burner won by Louise</p>\\n<p>