get you some positive comments for just £65. </p><p>To book in either call the salon or book on line.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','28bb2897-294b-4a5d-aec8-d2084b807d7e'),(1876,1876,1,'Hyde Salon 9 day Madness','hyde-salon-9-day-madness','hyde-salon-9-day-madness','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Save 50% on your colour service.</p><p>Are you looking to create that new look for 2019, or just want to look your best for Valentines night?. </p><p>Well here at The Leading Edge we use only the best colours in the industry and have been a <a href=\\\"https://www.wella.com/professional/en-UK/?cid=uk_search_google_wella_exact_wella_pro_uk_google_brand_exact&amp;gclid=Cj0KCQiAheXiBRD-ARIsAODSpWOGcIYK2hjQt4G0Tf-LQP1MwX3coIn7frBUscDQPW1AWh24VaznLa0aAtwPEALw_wcB\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Wella</a> Gold salon for over 8 years. So why don\'t you book in with one of our expert colourists who will help you choose and provide you with that amazing colour you have always wanted.</p><p>This is a limited offer available between Tuesday 5th February and Friday 15th February inclusive. you must use the code Madness9 when booking to qualify.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:45','6d57122a-53da-40ae-a5ab-94f0edf6f9c4'),(1877,1877,1,'Hyde Salon 9 day Madness','hyde-salon-9-day-madness','hyde-salon-9-day-madness','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Save 50% on your colour service.</p><p>Are you looking to create that new look for 2019, or just want to look your best for Valentines night?. </p><p>Well here at The Leading Edge we use only the best colours in the industry and have been a <a href=\\\"https://www.wella.com/professional/en-UK/?cid=uk_search_google_wella_exact_wella_pro_uk_google_brand_exact&amp;gclid=Cj0KCQiAheXiBRD-ARIsAODSpWOGcIYK2hjQt4G0Tf-LQP1MwX3coIn7frBUscDQPW1AWh24VaznLa0aAtwPEALw_wcB\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Wella</a> Gold salon for over 8 years. So why don\'t you book in with one of our expert colourists who will help you choose and provide you with that amazing colour you have always wanted.</p><p>This is a limited offer available between Tuesday 5th February and Friday 15th February inclusive. you must use the code Madness9 when booking to qualify.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','f32cd333-52a6-463d-862b-6de468cd0ad8'),(1878,1878,1,'Tameside\'s Hair & Beauty business of the Year 2017','tamesides-hair-beauty-business-of-the-year-2017','tamesides-hair-beauty-business-of-the-year-2017','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>PRIDE OF TAMESIDE BUSINESS AWARDS</p><p><strong><em>We are proud to have won Tameside\'s Hair &amp; Beauty Business of the Year 2017</em></strong></p>\\n<p>The <a href=\\\"https://www.prideoftameside.co.uk/entry-form\\\">Pride of Tameside Business Awards</a> celebrate the outstanding work of businesses from different sectors and inspirational individuals from across the region.\\n</p>\\n<p>The awards are <strong>free to enter </strong>and feature categories for businesses across all sectors as well as awards for individual entrepreneurs and services. \\n</p>\\n<p>The 2017 awards were judged by a <a href=\\\"https://www.prideoftameside.co.uk/judges\\\">panel</a> made up of internal and external representatives. Judging is a two-stage process including pre-scoring to determine shortlists and a final judging session to decide the winners.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:45','ba636110-97fb-4cb7-9742-f6505c09dcbd'),(1879,1879,1,'Tameside\'s Hair & Beauty business of the Year 2017','tamesides-hair-beauty-business-of-the-year-2017','tamesides-hair-beauty-business-of-the-year-2017','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>PRIDE OF TAMESIDE BUSINESS AWARDS</p><p><strong><em>We are proud to have won Tameside\'s Hair &amp; Beauty Business of the Year 2017</em></strong></p>\\n<p>The <a href=\\\"https://www.prideoftameside.co.uk/entry-form\\\">Pride of Tameside Business Awards</a> celebrate the outstanding work of businesses from different sectors and inspirational individuals from across the region.\\n</p>\\n<p>The awards are <strong>free to enter </strong>and feature categories for businesses across all sectors as well as awards for individual entrepreneurs and services. \\n</p>\\n<p>The 2017 awards were judged by a <a href=\\\"https://www.prideoftameside.co.uk/judges\\\">panel</a> made up of internal and external representatives. Judging is a two-stage process including pre-scoring to determine shortlists and a final judging session to decide the winners.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','2dceca0c-8316-4e13-a3ea-cbb080af4580'),(1880,1880,1,'Gino Tuzzolino (formally Vidal Sassoon) comes to Great Moor','gino-tuzzolino-formally-vidal-sassoon-comes-to-great-moor','gino-tuzzolino-formally-vidal-sassoon-comes-to-great-moor','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce that Gino Tuzzolino will be joining our team in Great Moor, Stockport.\\n</p>\\n<p>Gino brings a wealth of experience with him, having successfully operated several successful family salons for over four decades training and developing his teams along the way where many now have their own hair and beauty salons.\\n</p>\\n<p>Gino learnt his skills in our fashion capital, London at the much-acclaimed Vidal Sassoon. It was here where his Italian influences came to the fore gaining him enviable recognition amongst his peers for his cutting work.\\n</p>\\n<p>After working in London Gino then moved up North working in Macclesfield, Stockport and Stalybridge building a strong client base and sharing his skills and techniques with many students over the years. Looking for a new stylist? Then we guarantee that you will not be disappointed with his sharp, clean geometric cutting skills.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:45','2f676318-9756-4c77-af90-c51d85552bc9'),(1881,1881,1,'Gino Tuzzolino (formally Vidal Sassoon) comes to Great Moor','gino-tuzzolino-formally-vidal-sassoon-comes-to-great-moor','gino-tuzzolino-formally-vidal-sassoon-comes-to-great-moor','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce that Gino Tuzzolino will be joining our team in Great Moor, Stockport.\\n</p>\\n<p>Gino brings a wealth of experience with him, having successfully operated several successful family salons for over four decades training and developing his teams along the way where many now have their own hair and beauty salons.\\n</p>\\n<p>Gino learnt his skills in our fashion capital, London at the much-acclaimed Vidal Sassoon. It was here where his Italian influences came to the fore gaining him enviable recognition amongst his peers for his cutting work.\\n</p>\\n<p>After working in London Gino then moved up North working in Macclesfield, Stockport and Stalybridge building a strong client base and sharing his skills and techniques with many students over the years. Looking for a new stylist? Then we guarantee that you will not be disappointed with his sharp, clean geometric cutting skills.\\n</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','83f2ed7f-f4ea-4ad2-a88d-376af993e101'),(1882,1882,1,'Abigail is through to the Wella \"Trend Vision Regional Finals\"','abigail-is-through-to-the-wella-trend-vision-regional-finals','abigail-is-through-to-the-wella-trend-vision-regional-finals','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As a Wella Professional salon we are pleased to announce that <a href=\\\"https://www.leadingedgehairandbeauty.co.uk/hyde-salon/meet-the-team#abigail\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Abigail</a> from out Hyde salon has made it through to the Regional Finals of \\\"<a href=\\\"https://www.wella.com/professional/m/_master/TrendVision/PDF/TVA-Photographic-Winners-2019.pdf?fbclid=IwAR2_F2EyibGyJf2YQkQaUcKrplMmcKcKys6MMvOPfe3f2mZfeI1DCBOjOcw\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Trend Vision</a>\\\" 2019 at <a href=\\\"https://www3.hilton.com/en/hotels/united-kingdom/hilton-manchester-deansgate-MANDGHI/index.html\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Hilton Hotel Manchester</a>.</p>\\n<p>This contest is much coveted in the Hair Industry and is both exciting and compelling. The programme is complemented by unrivaled face to face mentoring at every stage. Whist the pressure will be on the experience and mentoring is designed to bring out the very best in all participants and enhance their skills and knowledge.</p>\\n<p>So keep an eye out for <a href=\\\"https://www.leadingedgehairandbeauty.co.uk/hyde-salon/meet-the-team#abigail\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Abigail\'s</a> amazing colour work which we will publish photographs of once the competition is over.</p>\\n<p>Best Wishes Abigail </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:45','9b088650-ae9a-4533-a034-908aef8657c8'),(1883,1883,1,'Abigail is through to the Wella \"Trend Vision Regional Finals\"','abigail-is-through-to-the-wella-trend-vision-regional-finals','abigail-is-through-to-the-wella-trend-vision-regional-finals','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As a Wella Professional salon we are pleased to announce that <a href=\\\"https://www.leadingedgehairandbeauty.co.uk/hyde-salon/meet-the-team#abigail\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Abigail</a> from out Hyde salon has made it through to the Regional Finals of \\\"<a href=\\\"https://www.wella.com/professional/m/_master/TrendVision/PDF/TVA-Photographic-Winners-2019.pdf?fbclid=IwAR2_F2EyibGyJf2YQkQaUcKrplMmcKcKys6MMvOPfe3f2mZfeI1DCBOjOcw\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Trend Vision</a>\\\" 2019 at <a href=\\\"https://www3.hilton.com/en/hotels/united-kingdom/hilton-manchester-deansgate-MANDGHI/index.html\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Hilton Hotel Manchester</a>.</p>\\n<p>This contest is much coveted in the Hair Industry and is both exciting and compelling. The programme is complemented by unrivaled face to face mentoring at every stage. Whist the pressure will be on the experience and mentoring is designed to bring out the very best in all participants and enhance their skills and knowledge.</p>\\n<p>So keep an eye out for <a href=\\\"https://www.leadingedgehairandbeauty.co.uk/hyde-salon/meet-the-team#abigail\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Abigail\'s</a> amazing colour work which we will publish photographs of once the competition is over.</p>\\n<p>Best Wishes Abigail </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','a1a8f265-9710-4ddf-aa26-14b6217eb09a'),(1884,1884,1,'MioCare Steve & Ben Corless','miocare-steve-ben-corless','miocare-steve-ben-corless','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>See what a great job Steve and his fellow volunteers did to raise over 900 Easter Eggs for Children and families within the borough.</p><p><a href=\\\"https://www.miocare.co.uk/post/?permalink=happy-easter\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">See More....</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:46','b0faed43-2d47-4411-b71f-6039e2f1bbb6'),(1885,1885,1,'MioCare Steve & Ben Corless','miocare-steve-ben-corless','miocare-steve-ben-corless','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>See what a great job Steve and his fellow volunteers did to raise over 900 Easter Eggs for Children and