f-46e1-b30d-9f531e413542'),(1889,1889,1,'Charity Football Match Woodley Sports','charity-football-match-woodley-sports','charity-football-match-woodley-sports','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Wish Upon A Star</p>\\n<p>We\'re SO excited to announce that Lukes Real Life Superheroes Vs Hollyoaks Football Match is BACK!!!! <br /><br />On Sunday 30th June 2019!!!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','04ddaaad-bb43-4827-92cf-2770acd28ec0'),(1890,1890,1,'Eating every 15 minutes can help PCOS sufferers','eating-every-15-minutes-can-help-pcos-sufferers','eating-every-15-minutes-can-help-pcos-sufferers','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Norah Cozens provides a clinic in our Hyde salon on Tuesday, Thursday and Saturday mornings.</p>\\n<p>See the latest article in the Daily Mirror <a href=\\\"https://www.mirror.co.uk/lifestyle/health/could-eating-every-15-minutes-16495505\\\">https://www.mirror.co.uk/lifestyle/health/could-eating-every-15-minutes-16495505</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:46','11b0400d-56cb-441d-a50d-207f0a70e17a'),(1891,1891,1,'Eating every 15 minutes can help PCOS sufferers','eating-every-15-minutes-can-help-pcos-sufferers','eating-every-15-minutes-can-help-pcos-sufferers','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Norah Cozens provides a clinic in our Hyde salon on Tuesday, Thursday and Saturday mornings.</p>\\n<p>See the latest article in the Daily Mirror <a href=\\\"https://www.mirror.co.uk/lifestyle/health/could-eating-every-15-minutes-16495505\\\">https://www.mirror.co.uk/lifestyle/health/could-eating-every-15-minutes-16495505</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','cda2cac4-cba3-4c28-9e69-3d49d214afeb'),(1892,1892,1,'Hair Perming is Returning','perming-is-returning','perming-is-returning','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Yes, its true, the perm is on its way back but the only problem is that the art of perming hasn\'t been taught as part of the hairdressing syllabus for man years and finding a salon that can offer you this service can be a real challenge.</p>\\n<p>Don\'t worry anymore as we offer a full range of perming services for both men and women both in our Hyde and Stockport salons.</p>\\n<p>For the men the Top Perm is making a real statement led by both musicians and footballers whilst the resurgence of the curly blow-wave has meant that a permanent curl is more the requirement for the ladies.</p>\\n<p><a href=\\\"https://www.theguardian.com/fashion/2019/may/21/hair-raising-the-return-of-the-perm\\\">https://www.theguardian.com/fashion/2019/may/21/hair-raising-the-return-of-the-perm</a><br /></p>\\n<p><br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:46','e0ff1e33-74b3-408a-a338-3676c89ab217'),(1893,1893,1,'Hair Perming is Returning','perming-is-returning','perming-is-returning','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Yes, its true, the perm is on its way back but the only problem is that the art of perming hasn\'t been taught as part of the hairdressing syllabus for man years and finding a salon that can offer you this service can be a real challenge.</p>\\n<p>Don\'t worry anymore as we offer a full range of perming services for both men and women both in our Hyde and Stockport salons.</p>\\n<p>For the men the Top Perm is making a real statement led by both musicians and footballers whilst the resurgence of the curly blow-wave has meant that a permanent curl is more the requirement for the ladies.</p>\\n<p><a href=\\\"https://www.theguardian.com/fashion/2019/may/21/hair-raising-the-return-of-the-perm\\\">https://www.theguardian.com/fashion/2019/may/21/hair-raising-the-return-of-the-perm</a><br /></p>\\n<p><br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','a682095e-9777-4d1b-8a42-8cd796ffb9fb'),(1894,1894,1,'Kerastraight Service','kerastraight-service','kerastraight-service','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>So yesterday the whole of TLE team had training on Kerastraight. And we learnt a lot!<br /></p>\\n<p>We learnt that Kerastraight isn’t just for curly, thick, unruly hair. It’s First and foremost a Treatment to build the Proteins back up in your hair. It is perfect for anyone who has problematic hair. </p>\\n<p>⭐️ My hair takes to long to dry<br /></p>\\n<p>⭐️ My hair is dry/damaged</p>\\n<p>⭐️ My hair is bulky </p>\\n<p>⭐️ My hair is frizzy </p>\\n<p>⭐️ My hair is unhealthy</p>\\n<p>Does any of the above sound familiar? </p>\\n<p>Get booked in for your free 15 minute Consultation with one of our Stylist to find out more!</p>\\n<p>Kerastraight Ultimate should (if maintained correctly) last up to 4 months. </p>\\n<p>We can also apply a booster treatment in between Kerastraight Ultimate treatments to get the best results and the most out of this service.</p>\\n<p>Kerastraight Ultimate takes around 2-3 hours and the prices start from £145.00, this includes a 250ml Shampoo and Conditioner to maintain your hair.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:46','1378905d-502b-4dce-a90a-a2e182b157e8'),(1895,1895,1,'Kerastraight Service','kerastraight-service','kerastraight-service','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>So yesterday the whole of TLE team had training on Kerastraight. And we learnt a lot!<br /></p>\\n<p>We learnt that Kerastraight isn’t just for curly, thick, unruly hair. It’s First and foremost a Treatment to build the Proteins back up in your hair. It is perfect for anyone who has problematic hair. </p>\\n<p>⭐️ My hair takes to long to dry<br /></p>\\n<p>⭐️ My hair is dry/damaged</p>\\n<p>⭐️ My hair is bulky </p>\\n<p>⭐️ My hair is frizzy </p>\\n<p>⭐️ My hair is unhealthy</p>\\n<p>Does any of the above sound familiar? </p>\\n<p>Get booked in for your free 15 minute Consultation with one of our Stylist to find out more!</p>\\n<p>Kerastraight Ultimate should (if maintained correctly) last up to 4 months. </p>\\n<p>We can also apply a booster treatment in between Kerastraight Ultimate treatments to get the best results and the most out of this service.</p>\\n<p>Kerastraight Ultimate takes around 2-3 hours and the prices start from £145.00, this includes a 250ml Shampoo and Conditioner to maintain your hair.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:41','724b19ef-0d83-4498-afd3-e331c91af274'),(1896,1896,1,'Proud to announce','proud-to-announce','proud-to-announce','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are very proud that our apprentice barber has been shortlisted for The Pride of Tameside Apprentice of the year 2019. Ben has worked extremely hard and has managed to overcome many obstacles on his journey and we are pleased that this shortlisting has recognised his efforts. Best of luck Ben form us all. </p><p><a href=\\\"https://www.prideoftameside.co.uk/2019-shortlist\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">View the full 2019 Shortlist Pride of Tameside Awards</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:41','2025-08-01 09:46:46','cdf13408-b24a-43b4-bdd1-2407222a3cb7'),(1897,1897,1,'Proud to announce','proud-to-announce','proud-to-announce','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are very proud that our apprentice barber has been shortlisted for The Pride of Tameside Apprentice of the year 2019. Ben has worked extremely hard and has managed to overcome many obstacles on his journey and we are pleased that this shortlisting has recognised his efforts. Best of luck Ben form us all. </p><p><a href=\\\"https://www.prideoftameside.co.uk/2019-shortlist\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">View the full 2019 Shortlist Pride of Tameside Awards</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:42','ddffa052-5e8d-40ac-b231-af2fa29d0f54'),(1898,1898,1,'World Mental Health Day','world-mental-health-day','world-mental-health-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.who.int/news-room/events/detail/2019/10/10/default-calendar/world-mental-health-day-2019-focus-on-suicide-prevention\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">It’s World Mental Health Day!</a> I’m so happy mental health is finally getting recognized! Mindset is everything right!? Pampering yourself when you’re down in the dumps can be a great way to overcome the mighty blues and pick yourself up by feeling good and having a refreshing chat with your stylist, nail technician or beautician and get back to a positive state of mind.</p>\\n<p>Help others and share what do you do to get your mind in a better state?</p>\\n<p>IN MEMORY OF OUR BEAUTIFUL MONIKA</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:46','fd768894-4e76-45cf-bb33-a61e971804cd'),(1899,1899,1,'World Mental Health Day','world-mental-health-day','world-mental-health-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://www.who.int/news-room/events/detail/2019/10/10/default-calendar/world-mental-health-day-2019-focus-on-suicide-prevention\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">It’s World Mental Health Day!</a> I’m so happy mental health is finally getting recognized! Mindset is everything right!? Pampering yourself when you’re down in the dumps can be a great way to overcome the mighty blues and pick yourself up by feeling good and having a refreshing chat with your stylist, nail technician or beautician and get back to a positive state of mind.</p>\\n<p>Help others and share what do you do to get your mind in a better state?</p>\\n<p>IN MEMORY OF OUR BEAUTIFUL MONIKA</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:42','97bc4cdc-8a04-4193-98f6-9225eecf7d5b'),(1900,1900,1,'We are SO proud of our TEAM','we-are-so-proud-of-our-team','we-are-so-proud-of-our-team','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>HELLO! You’ve probably seen my familiar face in the salon. I’m Alan. And along with Barrie we founded The Leading Edge 9 years ago and we are so proud of our team that we wanted to share a few of our recent customer reviews with you. </p><p><strong>Abigail</strong>; from Barbara who visited 26th September 2019</p><p>Visited the salon today for a colour and cut by Abbie. I was greeted with a warm welcome from Ben along with a lovely cup of coffee. As usual with The Leading Edge the level of customer care and service was second to none. Abbie helped me decide what I wanted doing with my hair and explained in detail what she was going to do and how it would lol. I\'m absolutely over the moon with how my hair looks. Thank you Abbie you are amazing.<br /></p><p><strong>Lauren</strong>; from Katie who visited 9th October 2019</p><p>This was my first time going to The Leading Edge Hair and Beauty Salon and after not having my hair done for a very long time, it was very weak and dull. Lauren was absolutely amazing, I showed her a picture of how I would like my hair and she worked her magic and got the result exactly how I wanted. She was very knowledgeable and had so much time to provide me with advice on how I can continue to look after my hair at home. All the staff were lovely and very friendly and the salon itself is very welcoming. I would definitely recommend this salon and have already booked my next appointment! Thank you Lauren!</p><p><strong>Gary</strong>; from Gretta who visited 10th October 2019</p><p>The Leading Edge Hair And Beauty Salon is a very friendly welcoming and relaxing experience for me as was my first time visiting this salon. All the staff are friendly and professional in their dealings with customers..Although I came to the salon for a wash/blow dry and was there for quite sometime I was given lots of useful information from Gary for colour to use on my hair in the future . I will definitely use the Leading Edge Salon in the future for my usual all over colour cut and wash/blow dry . I will also use their beauty area for certain treatments needed in the future.<br /></p><p><strong>Ben</strong>; from Ryan who visited 1st October 2019</p><p>Ben\'s a sound guy, second cut by him now and will keep returning, great place.<br /></p><p><strong>Barrie</strong>; from John who visited 1st October 2019</p><p>Barry\'s choice of jazz is not conducive with one\'s breakfast......but his skill is second to none.<br /></p><p>To read the remaining 2,730 reviews <a href=\\\"https://www.mylocalsalon.co.uk/leadingedge.html#reviews\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">click here</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:46','64c12853-2ec5-459c-93cc-89c41ad01815'),(1901,1901,1,'We are SO proud of our TEAM','we-are-so-proud-of-our-team','we-are-so-proud-of-our-team','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>HELLO! You’ve probably seen my familiar face in the salon. I’m Alan. And along with Barrie we founded The Leading Edge 9 years ago and we are so proud of our team that we wanted to share a few of our recent customer reviews with you. </p><p><strong>Abigail</strong>; from Barbara who visited 26th September 2019</p><p>Visited the salon today for a colour and cut by Abbie. I was greeted with a warm welcome from Ben along with a lovely cup of coffee. As usual with The Leading Edge the level of customer care and service was second to none. Abbie helped me decide what I wanted doing with my hair and explained in detail what she was going to do and how it would lol. I\'m absolutely over the moon with how my hair looks. Thank you Abbie you are amazing.<br /></p><p><strong>Lauren</strong>; from Katie who visited 9th October 2019</p><p>This was my first time going to The Leading Edge Hair and Beauty Salon and after not having my hair done for a very long time, it was very weak and dull. Lauren was absolutely amazing, I showed her a picture of how I would like my hair and she worked her magic and got the result exactly how I wanted. She was very knowledgeable and had so much time to provide me with advice on how I can continue to look after my hair at home. All the staff were lovely and very friendly and the salon itself is very welcoming. I would definitely recommend this salon and have already booked my next appointment! Thank you Lauren!</p><p><strong>Gary</strong>; from Gretta who visited 10th October 2019</p><p>The Leading Edge Hair And Beauty Salon is a very friendly welcoming and relaxing experience for me as was my first time visiting this salon. All the staff are friendly and professional in their dealings with customers..Although I came to the salon for a wash/blow dry and was there for quite sometime I was given lots of useful information from Gary for colour to use on my hair in the future . I will definitely use the Leading Edge Salon in the future for my usual all over colour cut and wash/blow dry . I will also use their beauty area for certain treatments needed in the future.<br /></p><p><strong>Ben</strong>; from Ryan who visited 1st October 2019</p><p>Ben\'s a sound guy, second cut by him now and will keep returning, great place.<br /></p><p><strong>Barrie</strong>; from John who visited 1st October 2019</p><p>Barry\'s choice of jazz is not conducive with one\'s breakfast......but his skill is second to none.<br /></p><p>To read the remaining 2,730 reviews <a href=\\\"https://www.mylocalsalon.co.uk/leadingedge.html#reviews\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">click here</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:42','365843c5-ac94-4296-a452-2f2bad71d9f6'),(1902,1902,1,'We Love Your Feedback','we-love-your-feedback','we-love-your-feedback','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We have some of the best clients walk through our doors. They’re always full of loving compliments… Sometimes we can’t get them to stop talking about us LOL! We frequently hear them say \\\"I love the vibe of this place\\\" and \\\"everyone’s so passionate.\\\" Hearing these kind words makes all our hearts sing and fills us with immense joy. You don\'t know how much reading these keeps us all going and makes the day so enjoyable. </p><p>Thanks for your support your all so amazing!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:46','55d5cd55-597b-48e4-bb74-9ecfa2649264'),(1903,1903,1,'We Love Your Feedback','we-love-your-feedback','we-love-your-feedback','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We have some of the best clients walk through our doors. They’re always full of loving compliments… Sometimes we can’t get them to stop talking about us LOL! We frequently hear them say \\\"I love the vibe of this place\\\" and \\\"everyone’s so passionate.\\\" Hearing these kind words makes all our hearts sing and fills us with immense joy. You don\'t know how much reading these keeps us all going and makes the day so enjoyable. </p><p>Thanks for your support your all so amazing!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:42','2c99aa52-85d8-4370-b6ec-48d090bc1885'),(1904,1904,1,'But We Do Perms!','but-we-do-perms','but-we-do-perms','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p><a href=\\\"https://youtu.be/qDItKtkrTNQ\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">We Do Perms</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:42','2025-08-01 09:46:46','d642fa26-be47-41f2-ae6d-09766b02aa87'),(1905,1905,1,'But We Do Perms!','but-we-do-perms','but-we-do-perms','{\"89