1qbaHeAGgURsJgkvOm7U-cIykWWweQaUsQ12rHEgVqxwCoUJeUPhFHjMQ4ncfCwJ-cXB3EK0V0ZdbRejVN_q9v2g7XwdMm5uSLeqYJFAoxgkgDsKzONBtzfc1j_KlSW32rskgeIwKIxw0IiG2uG3cE3nN7MzxH4txHxZUT6V4hdkY4YIKThsM02mgt8vPodPriNzmVBHqqClbG6w\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\"></a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:43','2025-08-01 09:46:43','b1067ca4-9827-4750-a45e-184e8713a8ea'),(1940,1940,1,'The Leading Edge Covid19 Important Visit Information','important-visit-information','important-visit-information','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In light of the current COVID-19 pandemic, we wanted to give you an update on the changes we are making in the salon to ensure your safety is our main priority.<br /></p>\\n<p>We are closely monitoring the government and industry advice, and have made some changes in how we operate under their best guidance.</p>\\n<p><strong>We have introduced a \\\"Covid19 surcharge of £2 for each client to cover our additional costs of making the salon environment a safe place for clients and staff alike whilst providing a PERSONALISED PACK that will contain a Face Mask, towel, disposable gown and cape.</strong></p>\\n<p><strong>Guidelines mean there will be no dry cuts available during this Covid19 period.</strong></p>\\n<p><strong>Arrive for your appointment 5 mins early and wait in your car or in a safe place and call the salon on 0161-368-9999 to let us know you have arrived and we will inform you when to come to the salon doors.</strong></p>\\n<p><strong>Ring the bell upon arrival and you will be met by the receptionist.</strong></p>\\n<p><strong>No need to wear a face mask as one will be provided to you in your pack.</strong></p>\\n<p><strong>Please try to attend without LARGE bags and coats (weather permitting).</strong></p>\\n<p><strong>Attend your appointment on your own.</strong></p>\\n<p><strong>Staff &amp; clients will have their temperature checked before entering the salon.</strong></p>\\n<p><strong>We are taking extra care to ensure we are sanitising and cleaning between each client in the chairs.</strong></p>\\n<p><strong>We have introduced sanitation-stations with hand sanitiser – please use these, as much and as often as you can.</strong></p>\\n<p><strong>The toilet facilities will remain available upon request to your stylist.</strong></p>\\n<p><strong>We are still committed to your comfort while at The Leading Edge however you will notice we have begun serving our refreshments teas &amp; coffees in disposable cups and we promise we are doing our best to recycle and dispose of these ethically.</strong></p>\\n<p><strong>You may also notice that we have removed magazines, again, this is to reduce germ transfer. Please feel free to bring in your own reading materials.</strong></p>\\n<p><strong>All our salon stations adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</strong></p>\\n<p><strong>Our team are following government recommendations and will all be isolating if they show flu-like symptoms, so we ask for your patience and understanding if we need to reschedule your appointment.</strong></p>\\n<p><strong>If you are unwell, or have come into contact with someone with COVID-19 in the last 14 days, please reschedule your appointment, even if you do not have any symptoms.<br /></strong></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:43','2025-08-01 09:46:46','c6e135d7-38f4-4862-be64-109161df45e6'),(1941,1941,1,'The Leading Edge Covid19 Important Visit Information','important-visit-information','important-visit-information','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In light of the current COVID-19 pandemic, we wanted to give you an update on the changes we are making in the salon to ensure your safety is our main priority.<br /></p>\\n<p>We are closely monitoring the government and industry advice, and have made some changes in how we operate under their best guidance.</p>\\n<p><strong>We have introduced a \\\"Covid19 surcharge of £2 for each client to cover our additional costs of making the salon environment a safe place for clients and staff alike whilst providing a PERSONALISED PACK that will contain a Face Mask, towel, disposable gown and cape.</strong></p>\\n<p><strong>Guidelines mean there will be no dry cuts available during this Covid19 period.</strong></p>\\n<p><strong>Arrive for your appointment 5 mins early and wait in your car or in a safe place and call the salon on 0161-368-9999 to let us know you have arrived and we will inform you when to come to the salon doors.</strong></p>\\n<p><strong>Ring the bell upon arrival and you will be met by the receptionist.</strong></p>\\n<p><strong>No need to wear a face mask as one will be provided to you in your pack.</strong></p>\\n<p><strong>Please try to attend without LARGE bags and coats (weather permitting).</strong></p>\\n<p><strong>Attend your appointment on your own.</strong></p>\\n<p><strong>Staff &amp; clients will have their temperature checked before entering the salon.</strong></p>\\n<p><strong>We are taking extra care to ensure we are sanitising and cleaning between each client in the chairs.</strong></p>\\n<p><strong>We have introduced sanitation-stations with hand sanitiser – please use these, as much and as often as you can.</strong></p>\\n<p><strong>The toilet facilities will remain available upon request to your stylist.</strong></p>\\n<p><strong>We are still committed to your comfort while at The Leading Edge however you will notice we have begun serving our refreshments teas &amp; coffees in disposable cups and we promise we are doing our best to recycle and dispose of these ethically.</strong></p>\\n<p><strong>You may also notice that we have removed magazines, again, this is to reduce germ transfer. Please feel free to bring in your own reading materials.</strong></p>\\n<p><strong>All our salon stations adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</strong></p>\\n<p><strong>Our team are following government recommendations and will all be isolating if they show flu-like symptoms, so we ask for your patience and understanding if we need to reschedule your appointment.</strong></p>\\n<p><strong>If you are unwell, or have come into contact with someone with COVID-19 in the last 14 days, please reschedule your appointment, even if you do not have any symptoms.<br /></strong></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:43','2025-08-01 09:46:43','cf9f7a72-e20c-4575-a9cf-eb4977eda7be'),(1942,1942,1,'Clearance Event','clearance-event','clearance-event','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This Saturday 20th June between 11am and 4pm we will be holding a clearance event with bags from £9 and purses from £4., whilst jewellery and a selection of hair care products are greatly reduced.</p><p> Social distancing rules will be in place and only 4 customers at a time will be allowed into the salon.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:43','2025-08-01 09:46:46','faa1a357-6d1e-4df4-a517-c8417ca1310c'),(1943,1943,1,'Clearance Event','clearance-event','clearance-event','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This Saturday 20th June between 11am and 4pm we will be holding a clearance event with bags from £9 and purses from £4., whilst jewellery and a selection of hair care products are greatly reduced.</p><p> Social distancing rules will be in place and only 4 customers at a time will be allowed into the salon.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:43','2025-08-01 09:46:43','ec47b7f1-ed09-431f-9edc-949941e0ff68'),(1944,1944,1,'Room for rent','room-for-rent','room-for-rent','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Lovely upstairs room for rent that would suit, <a href=\\\"https://www.facebook.com/hashtag/beautician?__eep__=6&amp;source=feed_text