ber until Wednesday 2nd December all being well.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','f11cbdb8-a0da-44d6-90a1-ec7989260b54'),(1989,1989,1,'Our Scissors Are Down','our-scissors-are-down','our-scissors-are-down','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We will be closed from Thursday 5th November until Wednesday 2nd December all being well.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','275e4266-052d-4619-a3ac-151489af9b28'),(1990,1990,1,'Award winning salon praised for adapting to Coronavirus','award-winning-salon-praised-for-adapting-to-coronavirus','award-winning-salon-praised-for-adapting-to-coronavirus','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We have made sure that our procedures and disciplines have delivered a Covid19 safe environment for our staff and customer alike whilst maintaining our high service standards to try and make the experience as normal as is possible.</p>\\n<p>Thanks to all our visitors for their honest feedback.</p>\\n<p><a href=\\\"https://www.tameside.gov.uk/Newsroom/Articles/Award-winning-salon-praised-for-adapting-to-corona\\\">https://www.tameside.gov.uk/Ne...<br /></a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','2cd567db-0f2e-4ba9-adcb-ede4c94f0d83'),(1991,1991,1,'Award winning salon praised for adapting to Coronavirus','award-winning-salon-praised-for-adapting-to-coronavirus','award-winning-salon-praised-for-adapting-to-coronavirus','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We have made sure that our procedures and disciplines have delivered a Covid19 safe environment for our staff and customer alike whilst maintaining our high service standards to try and make the experience as normal as is possible.</p>\\n<p>Thanks to all our visitors for their honest feedback.</p>\\n<p><a href=\\\"https://www.tameside.gov.uk/Newsroom/Articles/Award-winning-salon-praised-for-adapting-to-corona\\\">https://www.tameside.gov.uk/Ne...<br /></a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','47f06644-a2dc-42bb-8a70-f519c13d9c67'),(1992,1992,1,'Lockdown crazy','lockdown-crazy','lockdown-crazy','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Let’s talk about all things quarantine! We want to get to know our followers better so give us your answers in the comments! What has your crazy quarantine looked like?\\n\\n1. I work from home full time, throw my hair in a bun each morning and call it a day!\\n2. I work from the office full time and must look the part.\\n3. I work half in the office, half at home and getting ready each day has been a saviour!\\n4. I work half and half, but a messy bun is my best friend!\\n5. I work from home full time and I make an effort each morning to get all dolled up!\\n\\nNone of the above? Let us know!</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','58112b2c-1d14-4627-8f8c-8bb35f65437a'),(1993,1993,1,'Lockdown crazy','lockdown-crazy','lockdown-crazy','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Let’s talk about all things quarantine! We want to get to know our followers better so give us your answers in the comments! What has your crazy quarantine looked like?\\n\\n1. I work from home full time, throw my hair in a bun each morning and call it a day!\\n2. I work from the office full time and must look the part.\\n3. I work half in the office, half at home and getting ready each day has been a saviour!\\n4. I work half and half, but a messy bun is my best friend!\\n5. I work from home full time and I make an effort each morning to get all dolled up!\\n\\nNone of the above? Let us know!</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','10c9a3e9-3a77-4384-bbb1-9ae678299e29'),(1994,1994,1,'Christmas Cheer','christmas-cheer','christmas-cheer','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Merry Christmas to all of our amazing clients. I trust you’re spending this holiday with your loved ones. We are hoping you round off this crazy year with some joyful cheer and celebration! We are so lucky and grateful to have such wonderful clients like YOU! Stay safe today and soak in all the Christmas cheer!</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','30edf317-cfa7-4871-a31f-92f23aae7cb4'),(1995,1995,1,'Christmas Cheer','christmas-cheer','christmas-cheer','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Merry Christmas to all of our amazing clients. I trust you’re spending this holiday with your loved ones. We are hoping you round off this crazy year with some joyful cheer and celebration! We are so lucky and grateful to have such wonderful clients like YOU! Stay safe today and soak in all the Christmas cheer!</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','23686909-bc62-48c8-bb8e-8a652ef320e1'),(1996,1996,1,'New Year New You','new-year-new-you','new-year-new-you','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Bring in the New Year with a color change! If you can’t change your surroundings, change your hair colour!. After the year that’s been why don’t you try a new hair style?. What’s everyone’s hair plans for 2021?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','1b3d911f-02ee-4e0f-b54b-7c17f787091c'),(1997,1997,1,'New Year New You','new-year-new-you','new-year-new-you','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Bring in the New Year with a color change! If you can’t change your surroundings, change your hair colour!. After the year that’s been why don’t you try a new hair style?. What’s everyone’s hair plans for 2021?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','d1bd5992-104b-41df-9256-d73beb5fa76e'),(1998,1998,1,'Happy New Year','happy-new-year','happy-new-year','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Happy New Year to all our beautiful clients. Sending lots of love from our team to your family. We can’t thank you enough for sticking with us through 2020! This year has been full of so many ups and downs. We’re so blessed to be surrounded by amazing people like you. We’re riddled with excitement to start the New Year feeling rested and refreshed! Have a fantastic New Year and we’ll see you in 2021! X</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','0c1a8b26-d13f-41cc-8991-bd5901228ab8'),(1999,1999,1,'Happy New Year','happy-new-year','happy-new-year','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Happy New Year to all our beautiful clients. Sending lots of love from our team to your family. We can’t thank you enough for sticking with us through 2020! This year has been full of so many ups and downs. We’re so blessed to be surrounded by amazing people like you. We’re riddled with excitement to start the New Year feeling rested and refreshed! Have a fantastic New Year and we’ll see you in 2021! X</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','5d1f47cb-810f-4303-8913-f88fe4ae0de9'),(2000,2000,1,'Online Store Launch','online-store-launch','online-store-launch','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Our new online store is filled with all your favourite hair products from Wella, Milkshake, Olaplex, Amarican Crew &amp; Olaplex all available with FREE local delivery.</p>\\n<p>We have also managed to add a good selection of our best selling scarves and handbags. We hope you enjoy and look forward to delivering some goodies to your door.</p>\\n<p><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/\\\">https://shop.leadingedgehairan...</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:46','86e301b8-e11d-417b-be37-910051bcd6a7'),(2001,2001,1,'Online Store Launch','online-store-launch','online-store-launch','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Our new online store is filled with all your favourite hair products from Wella, Milkshake, Olaplex, Amarican Crew &amp; Olaplex all available with FREE local delivery.</p>\\n<p>We have also managed to add a good selection of our best selling scarves and handbags. We hope you enjoy and look forward to delivering some goodies to your door.</p>\\n<p><a href=\\\"https://shop.leadingedgehairandbeauty.co.uk/\\\">https://shop.leadingedgehairan...</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:45','2025-08-01 09:46:45','96cf89d8-0eae-4b02-bc0f-687353c8c8d6'),(2002,2002,1,'LockDown','lockdown','lockdown','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We will be back to serve as soon as we are allowed to. See you in 2021.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:46','2025-08-01 09:46:53','e5b8e88e-e5b2-4200-9763-bba1cf881bea'),(2003,2003,1,'LockDown','lockdown','lockdown','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We will be back to serve as soon as we are allowed to. See you in 2021.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:46','2025-08-01 09:46:46','bd71de31-488e-442e-9adb-c08301158989'),(2004,2004,1,'Tips & Tricks','tips-tricks','tips-tricks','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Want to know the not-so-secret secrets of the worlds best tressed? As a hairdresser I would MUCH rather empower my clients with the knowledge to keep your hair in tip-to-shape (plus it make my job much easier for your next appointment time)</p>\\n<p>For example did you know? </p>\\n<p>If you wash your hair with warm water and rinse the conditioner off with a blast of cold water at the end for a smooth finish and to reduce Frizz.</p>\\n<p>Stick to shampoo on your scalp and conditioner on your ends.</p>\\n<p>Try using an old cotton t-shirt for your dry off, its gentler than a cotton towel.</p>\\n<p>Don\'t use heat styling tools until your hair is completely dry (and air dry when you can).</p>\\n<p>Invest in a silk pillowcase.</p>\\n<p>If you have any burning questions drop us an email and will do our best to reply with the right advice.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:46','2025-08-01 09:46:53','bf703562-eb68-4c2d-8edd-915c9e4d3c04'),(2005,2005,1,'Tips & Tricks','tips-tricks','tips-tricks','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Want to know the not-so-secret secrets of the worlds best tressed? As a hairdresser I would MUCH rather empower my clients with the knowledge to keep your hair in tip-to-shape (plus it make my job much easier for your next appointment time)</p>\\n<p>For example did you know? </p>\\n<p>If you wash your hair with warm water and rinse the conditioner off with a blast of cold water at the end for a smooth finish and to reduce Frizz.</p>\\n<p>Stick to shampoo on your scalp and conditioner on your ends.</p>\\n<p>Try using an old cotton t-shirt for your dry off, its gentler than a cotton towel.</p>\\n<p>Don\'t use heat styling tools until your hair is completely dry (and air dry when you can).</p>\\n<p>Invest in a silk pillowcase.</p>\\n<p>If you have any burning questions drop us an email and will do our best to reply with the right advice.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:46','2025-08-01 09:46:46','ab1bede0-cda0-4e3d-8c89-f42f80e09e0c'),(2006,2006,1,'Love Your Pet Day','love-your-pet-day','love-your-pet-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>HAPPY LOVE YOUR PET DAY! A day to celebrate our favorite floofs, workout partners, cuddle buddies, bed warmers and best friends. The ones who have been by our sides through it all so far and all that is yet to come! Nothing quite beats the feeling of coming home after a crazy day to a face of unwavering excitement and love. As challenging as 2020 was, it’s safe to say our companions weren’t too upset about all the Lockdowns, and probably helped save our sanity at times. Seriously, my furbaby deserves a medal. So embrace today with a shameless spam and be sure to share your favorite memories with us on our social pages.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','9ade42bd-fa42-416c-92f8-68b1b44f49ac'),(2007,2007,1,'Love Your Pet Day','love-your-pet-day','love-your-pet-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>HAPPY LOVE YOUR PET DAY! A day to celebrate our favorite floofs, workout partners, cuddle buddies, bed warmers and best friends. The ones who have been by our sides through it all so far and all that is yet to come! Nothing quite beats the feeling of coming home after a crazy day to a face of unwavering excitement and love. As challenging as 2020 was, it’s safe to say our companions weren’t too upset about all the Lockdowns, and probably helped save our sanity at times. Seriously, my furbaby deserves a medal. So embrace today with a shameless spam and be sure to share your favorite memories with us on our social pages.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','bd51bc64-85bc-4ae1-b41a-34b53c3a21fc'),(2008,2008,1,'Barber Required','barber-required','barber-required','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Barbers Vacancy</p>\\n<p>We now have an opening for a self employed Barber. We have a strong customer base and a great environment to work in. We have a flexible approach towards rent as we know it has to work for you. Feel like you need a change? then you have nothing to lose and everything to gain. So PM for a confidential chat and further details.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','0ee192aa-5759-4d96-a03f-9f45a435cd78'),(2009,2009,1,'Barber Required','barber-required','barber-required','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Barbers Vacancy</p>\\n<p>We now have an opening for a self employed Barber. We have a strong customer base and a great environment to work in. We have a flexible approach towards rent as we know it has to work for you. Feel like you need a change? then you have nothing to lose and everything to gain. So PM for a confidential chat and further details.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','b250da15-8a39-4304-9b61-b599e7d50cbf'),(2010,2010,1,'International Women\'s Day','international-womens-day','international-womens-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">May we know them, may we be them, may we raise them hands. Happy International Women’s Day. The future is female! We hope you continue to inspire and empower the women in your lives today and every day. Together we are changing the world and I couldn’t be prouder to stand beside and support the women in my life. Here at The Leading Edge Hair &amp; Beauty we are so grateful to be surrounded by the most amazing women and we cannot thank you enough for your support. We all hope that you take the time today to recognise the extraordinary women in your lives.</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','518ca986-e95d-449a-952e-26ccf1f535a0'),(2011,2011,1,'International Women\'s Day','international-womens-day','international-womens-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">May we know them, may we be them, may we raise them hands. Happy International Women’s Day. The future is female! We hope you continue to inspire and empower the women in your lives today and every day. Together we are changing the world and I couldn’t be prouder to stand beside and support the women in my life. Here at The Leading Edge Hair &amp; Beauty we are so grateful to be surrounded by the most amazing women and we cannot thank you enough for your support. We all hope that you take the time today to recognise the extraordinary women in your lives.</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','5a4ecbfd-6070-4a91-9e86-b0553d69a5e0'),(2012,2012,1,'Happy St Patrick\'s Day','happy-st-patricks-day','happy-st-patricks-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Happy St Patrick’s Day! Whether you hail from Ireland, India, Italy or anywhere in between, may the luck of the Irish be with you wherever you go. A holiday dedicated to drinking and dancing? You bet we’ll be toasting to that and making up for it once the Pubs are back open!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','1f2e0283-dc7d-48b3-9d48-ce1ad8ce3831'),(2013,2013,1,'Happy St Patrick\'s Day','happy-st-patricks-day','happy-st-patricks-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Happy St Patrick’s Day! Whether you hail from Ireland, India, Italy or anywhere in between, may the luck of the Irish be with you wherever you go. A holiday dedicated to drinking and dancing? You bet we’ll be toasting to that and making up for it once the Pubs are back open!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','54b37eed-5df9-432d-ac87-577bc9f4ee49'),(2014,2014,1,'Earth Hour 8.30pm','earth-hour-8-30pm','earth-hour-8-30pm','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Just one hour can change decades. Turn off your lights for our planet. Join us by taking part in Earth Hour at 8:30pm tonight to help raise awareness for the issues facing our planet. This is a movement supported by millions around the world, and every household and business counts! All you have to do is turn off your non-essential lights for 1 hour - plus it’s a perfect excuse for a candlelit night in. Even something as simple as switching off can spark change, so make today the day to make your mark! We’re in this together.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','417304cf-0d6f-4cb4-b0b8-a4c604dde55c'),(2015,2015,1,'Earth Hour 8.30pm','earth-hour-8-30pm','earth-hour-8-30pm','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Just one hour can change decades. Turn off your lights for our planet. Join us by taking part in Earth Hour at 8:30pm tonight to help raise awareness for the issues facing our planet. This is a movement supported by millions around the world, and every household and business counts! All you have to do is turn off your non-essential lights for 1 hour - plus it’s a perfect excuse for a candlelit night in. Even something as simple as switching off can spark change, so make today the day to make your mark! We’re in this together.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','4847128c-9afc-44db-955c-3492b378df55'),(2016,2016,1,'March Already!','march-already','march-already','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well that went quick! With the year truly in full swing now, I hope you’re all taking the time to reflect on your resolutions and goals (or get started - it’s never too late!). Regardless of where you’re trying to get to, take the time to pause and check on your mental health - your headspace is the home you never leave. 2020 and the start to 2021 certainly have took their toll on me and our team, but I’m so grateful for the habits it has taught me! Things I like to practice include:</p>\\n<p>Talking about my feelings </p>\\n<p> Journaling - especially gratitude! </p>\\n<p>Staying active </p>\\n<p>Making time for the things I love, like walking the dog and time in the garden </p>\\n<p>Eating well...but also treating myself shamelessly </p>\\n<p>Sneaking some sunlight when possible </p>\\n<p>Prioritizing sleep and rest </p>\\n<p>Meditation and mindfulness</p>\\n<p>Do I get it right all the time? Of course not, but we’re all in this journey together - so remember baby steps and celebrate your little wins. Do you have tips to share with our community, or a friend who deserves a shoutout for kicking goals and slaying the game? Let us know in the comments below xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','9fce3e08-24c9-4939-bd4b-0a1aeacd18b2'),(2017,2017,1,'March Already!','march-already','march-already','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well that went quick! With the year truly in full swing now, I hope you’re all taking the time to reflect on your resolutions and goals (or get started - it’s never too late!). Regardless of where you’re trying to get to, take the time to pause and check on your mental health - your headspace is the home you never leave. 2020 and the start to 2021 certainly have took their toll on me and our team, but I’m so grateful for the habits it has taught me! Things I like to practice include:</p>\\n<p>Talking about my feelings </p>\\n<p> Journaling - especially gratitude! </p>\\n<p>Staying active </p>\\n<p>Making time for the things I love, like walking the dog and time in the garden </p>\\n<p>Eating well...but also treating myself shamelessly </p>\\n<p>Sneaking some sunlight when possible </p>\\n<p>Prioritizing sleep and rest </p>\\n<p>Meditation and mindfulness</p>\\n<p>Do I get it right all the time? Of course not, but we’re all in this journey together - so remember baby steps and celebrate your little wins. Do you have tips to share with our community, or a friend who deserves a shoutout for kicking goals and slaying the game? Let us know in the comments below xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','bf5340f0-4989-487a-9816-f65ecebeac65'),(2018,2018,1,'Curls are a girls best friend','curls-are-a-girls-best-friend','curls-are-a-girls-best-friend','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Ladies, let’s be real, curls aren’t always a girl’s best friend, that’s why we’re here to help. </p>\\n<p>We know how busy life can get, but we don’t want that stopping you from looking your best! Have something coming up? Save yourself the time and stress and book in now by calling us on 368-9999 or booking online now.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','49266f18-09db-46f9-8115-548a7561756a'),(2019,2019,1,'Curls are a girls best friend','curls-are-a-girls-best-friend','curls-are-a-girls-best-friend','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Ladies, let’s be real, curls aren’t always a girl’s best friend, that’s why we’re here to help. </p>\\n<p>We know how busy life can get, but we don’t want that stopping you from looking your best! Have something coming up? Save yourself the time and stress and book in now by calling us on 368-9999 or booking online now.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','ddea8229-5d44-41a4-92b7-48a073898ac7'),(2020,2020,1,'Whats Your Cocktail','whats-your-cocktail','whats-your-cocktail','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A little cocktail never killed nobody. Lately I’ve been OBSESSED with all things sweet n fruity! No matter how crazy our lives get, unwinding will also be essential; which means there’s always time for a cheeky cocktail or a G&amp;T! My favorite part? </p>\\n<p>It’s a hobby and a pleasure! As a creative at heart, I’m all for experimenting (and yes that means all the latest TikTok concoctions too. My go-to would have to be Mojito ;- </p>\\n<p>Main alcohol: Rum</p>\\n<p>Ingredients: 1 1/2 oz White rum, 1 oz Fresh lime juice, 2 teaspoons Sugar, 6 leaves of Mint, Soda Water</p>\\n<p>Preparation: Mint sprigs muddled with sugar and lime juice. Rum added and topped with soda water. Garnished with sprig of mint leaves. Served with a straw.</p>\\n<p>Served: On the rocks; poured over ice</p>\\n<p>Standard garnish: Sprig of mint, Yerba buena</p>\\n<p>Drinkware: Collins glass</p>\\n<p>What should I serve up next? Let me know below please! </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','d314eff3-b4f5-4487-9893-7e8152dd9fe3'),(2021,2021,1,'Whats Your Cocktail','whats-your-cocktail','whats-your-cocktail','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A little cocktail never killed nobody. Lately I’ve been OBSESSED with all things sweet n fruity! No matter how crazy our lives get, unwinding will also be essential; which means there’s always time for a cheeky cocktail or a G&amp;T! My favorite part? </p>\\n<p>It’s a hobby and a pleasure! As a creative at heart, I’m all for experimenting (and yes that means all the latest TikTok concoctions too. My go-to would have to be Mojito ;- </p>\\n<p>Main alcohol: Rum</p>\\n<p>Ingredients: 1 1/2 oz White rum, 1 oz Fresh lime juice, 2 teaspoons Sugar, 6 leaves of Mint, Soda Water</p>\\n<p>Preparation: Mint sprigs muddled with sugar and lime juice. Rum added and topped with soda water. Garnished with sprig of mint leaves. Served with a straw.</p>\\n<p>Served: On the rocks; poured over ice</p>\\n<p>Standard garnish: Sprig of mint, Yerba buena</p>\\n<p>Drinkware: Collins glass</p>\\n<p>What should I serve up next? Let me know below please! </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','52d6ffa1-6c40-4026-9109-5b865e8823cd'),(2022,2022,1,'Personality is not th