1 09:46:53','168b4fb0-c5b6-4176-a5d9-4471a5f29222'),(2025,2025,1,'Quarantinis!','quarantinis','quarantinis','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Wherever you are in the world; in the office or even at home on the quarantinis! To love your hair is to love YOURSELF, so if you’re having a good day, go out there and get it (or at least take some fire iso-selfies)</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','9f3df617-8aa1-41a6-bedf-3332f601aa12'),(2026,2026,1,'Monday 12th April were back','monday-12th-april-were-back','monday-12th-april-were-back','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Each and every day, Pardon the pun, but we truly feel so blessed to have the most amazing and inspiring clients in our chairs (and for putting your unwavering faith in us, no matter the look). We can’t wait to see you all back in the salon from Monday 12<sup>th</sup> April. YIPPEEEEE</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','02e7f204-7add-46c8-8e7d-5ce5c67cb5b4'),(2027,2027,1,'Monday 12th April were back','monday-12th-april-were-back','monday-12th-april-were-back','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Each and every day, Pardon the pun, but we truly feel so blessed to have the most amazing and inspiring clients in our chairs (and for putting your unwavering faith in us, no matter the look). We can’t wait to see you all back in the salon from Monday 12<sup>th</sup> April. YIPPEEEEE</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','6ec80a21-c12b-45ae-97a9-7a84ba6d2ac6'),(2028,2028,1,'A Cut Above','a-cut-above','a-cut-above','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>And don’t you ever forget it! A woman who cuts her hair, is about to change the world. Your hair is the crown you never take off, so make sure you give it the love it deserves. Call us on 368-9999 or book on line to secure your next appointment. Availability 4<sup>th</sup> week of April on wards.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','91189463-bfd6-4205-bd59-3f57cdc15393'),(2029,2029,1,'A Cut Above','a-cut-above','a-cut-above','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>And don’t you ever forget it! A woman who cuts her hair, is about to change the world. Your hair is the crown you never take off, so make sure you give it the love it deserves. Call us on 368-9999 or book on line to secure your next appointment. Availability 4<sup>th</sup> week of April on wards.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','87e22398-28b6-4f44-8bbe-910c458aaf1c'),(2030,2030,1,'Challenges','challenges','challenges','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well, I think we all learnt this one way or another in the past year, so let this be a reminder to keep on pushing. Every day is a new opportunity to become the best version of you can be, so what challenges are you setting for yourself? Let us know in the comments below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','acca87e6-23f2-46be-a4b7-58a727708f70'),(2031,2031,1,'Challenges','challenges','challenges','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well, I think we all learnt this one way or another in the past year, so let this be a reminder to keep on pushing. Every day is a new opportunity to become the best version of you can be, so what challenges are you setting for yourself? Let us know in the comments below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','b2cc48c5-cf58-4ca8-8f67-ec7b337f64db'),(2032,2032,1,'Good Mental Health','good-mental-health','good-mental-health','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Or anything for that matter! Be unique and be YOU. If something ever gets you down, please remember we’re all here cheering for you, and we think you’re killing it. If you don’t feel like you’re living your life to the max, that’s okay! We’re all on our own journeys and every day is a chance for a fresh start! So if you feel like someone or something is no longer serving you, let this be your sign to let them go and start GLOWING.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','907d5403-5ab9-4473-9aa4-5bed86f0345c'),(2033,2033,1,'Good Mental Health','good-mental-health','good-mental-health','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Or anything for that matter! Be unique and be YOU. If something ever gets you down, please remember we’re all here cheering for you, and we think you’re killing it. If you don’t feel like you’re living your life to the max, that’s okay! We’re all on our own journeys and every day is a chance for a fresh start! So if you feel like someone or something is no longer serving you, let this be your sign to let them go and start GLOWING.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','eb8b6670-9be0-4016-9710-4606c516c23a'),(2034,2034,1,'Invest in sleep','invest-in-sleep','invest-in-sleep','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In times like these, looking after your health is more important than ever before! So if sleep hasn’t been your priority, let this be your sign to invest in rest. For me, embracing healthy sleep is the gateway to glowing skin and high energy levels. A good night’s sleep is the best tonic and it won’t cost you a cent! </p>\\n<p>During sleep, your skin’s blood flow increases, and the organ rebuilds its collagen and repairs damage from UV exposure, reducing wrinkles and age spots, sounds pretty good right!? So besides the myriads of benefits for the mind and body, it’s clear that this is something you simply can’t afford to overlook! But always be sure to give your face a cleanse first and apply moisturizer for extra hydration.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','797dfa43-535d-4a95-ac8e-7eac308a144f'),(2035,2035,1,'Invest in sleep','invest-in-sleep','invest-in-sleep','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In times like these, looking after your health is more important than ever before! So if sleep hasn’t been your priority, let this be your sign to invest in rest. For me, embracing healthy sleep is the gateway to glowing skin and high energy levels. A good night’s sleep is the best tonic and it won’t cost you a cent! </p>\\n<p>During sleep, your skin’s blood flow increases, and the organ rebuilds its collagen and repairs damage from UV exposure, reducing wrinkles and age spots, sounds pretty good right!? So besides the myriads of benefits for the mind and body, it’s clear that this is something you simply can’t afford to overlook! But always be sure to give your face a cleanse first and apply moisturizer for extra hydration.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','cf59f60a-57bc-44e3-b325-03d02b9aaac8'),(2036,2036,1,'Affirmation','affirmation','affirmation','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Looking to try something new? Lately we have been LOVING all things affirmations. If you can dream it you can do it, so by incorporating affirmations into your day, you’re well on your way to manifesting whatever you want out of life. A personal favourite for me as I pursue my goals this year is “be open to change and the challenges it brings”. What’s something you think we deserve to hear every day? Exchange your affirmations in the comments</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','38442103-9386-49ca-a279-bc4b2e2d5504'),(2037,2037,1,'Affirmation','affirmation','affirmation','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Looking to try something new? Lately we have been LOVING all things affirmations. If you can dream it you can do it, so by incorporating affirmations into your day, you’re well on your way to manifesting whatever you want out of life. A personal favourite for me as I pursue my goals this year is “be open to change and the challenges it brings”. What’s something you think we deserve to hear every day? Exchange your affirmations in the comments</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','f0c02176-3a8c-4df2-996a-ad78323dfde8'),(2038,2038,1,'Breakfast Spark','breakfast-spark','breakfast-spark','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>What’s my secret to slaying in the salon? BREAKFAST BABY - because if it doesn’t spark joy, there’s no way my work will. After spending time away from the scissors in isolation, like many of you I’ve rediscovered the beauty of baking (and no, I don’t just mean my face). Whether it’s banana, sourdough or any bread in between, experimenting in the kitchen has made my mornings even brighter. What recipe should I try next, let me know in our contact page.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','5f9b1b38-d6d3-4432-a821-30e9cdfaf2a8'),(2039,2039,1,'Breakfast Spark','breakfast-spark','breakfast-spark','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>What’s my secret to slaying in the salon? BREAKFAST BABY - because if it doesn’t spark joy, there’s no way my work will. After spending time away from the scissors in isolation, like many of you I’ve rediscovered the beauty of baking (and no, I don’t just mean my face). Whether it’s banana, sourdough or any bread in between, experimenting in the kitchen has made my mornings even brighter. What recipe should I try next, let me know in our contact page.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','00520dd2-e394-42f1-8df4-270cc82e1336'),(2040,2040,1,'Hairgicians','hairgicians','hairgicians','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey hey everyone, it’s Gary here. The thing I love most about our industry is that we get to embrace and express ourselves SHAMELESSLY through the beauty that is hairstyling. Whether it’s a big moment or a big change in your life, we are so lucky to be able bring out the beauty in you and have your trust if you’re experimenting with a new do. The formals, the weddings, the first dates and new jobs, the confidence good hair gifts you is something beyond compare! What style are you dying to try? Give me your thoughts below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','45673532-b636-40f0-8cd0-3da4679bd0e5'),(2041,2041,1,'Hairgicians','hairgicians','hairgicians','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey hey everyone, it’s Gary here. The thing I love most about our industry is that we get to embrace and express ourselves SHAMELESSLY through the beauty that is hairstyling. Whether it’s a big moment or a big change in your life, we are so lucky to be able bring out the beauty in you and have your trust if you’re experimenting with a new do. The formals, the weddings, the first dates and new jobs, the confidence good hair gifts you is something beyond compare! What style are you dying to try? Give me your thoughts below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','539135be-fe1d-4c3d-a824-6097f27954f5'),(2042,2042,1,'Every Second Counts','every-second-counts','every-second-counts','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Stop counting the days and make your days count. Whether you’re counting down the days to get to the next phase in your life or waiting for life as we know it to get back to ‘normal’, don’t let that stop you from taking time for yourself and others. So let this serve as a lil reminder to never forget the value of a moment before it becomes a memory. What special moments will you be savouring from this year? Let us know below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','b7ed034f-20b9-4888-a55e-a98441efd0f7'),(2043,2043,1,'Every Second Counts','every-second-counts','every-second-counts','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Stop counting the days and make your days count. Whether you’re counting down the days to get to the next phase in your life or waiting for life as we know it to get back to ‘normal’, don’t let that stop you from taking time for yourself and others. So let this serve as a lil reminder to never forget the value of a moment before it becomes a memory. What special moments will you be savouring from this year? Let us know below.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','1854880c-05c8-422b-b806-7b89b1489865'),(2044,2044,1,'Dead Ends','dead-ends','dead-ends','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Some people see shapes in clouds, we see them in piles of hair on the floor! LOL! We do what we do for the love of hair, it’s been a while since your last trip, sadly it’s time to part ways with those unruly ends. Appointments are only available for late April &amp; May to get your locks looking fresh and fabulous again. Head to our website and go to our online platform to discover our availability to kiss those ends goodbye.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','b0838022-cda7-4335-8175-dbbfd7df904c'),(2045,2045,1,'Dead Ends','dead-ends','dead-ends','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Some people see shapes in clouds, we see them in piles of hair on the floor! LOL! We do what we do for the love of hair, it’s been a while since your last trip, sadly it’s time to part ways with those unruly ends. Appointments are only available for late April &amp; May to get your locks looking fresh and fabulous again. Head to our website and go to our online platform to discover our availability to kiss those ends goodbye.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:47','188c2f22-1108-4c4f-931d-fb342b3164aa'),(2046,2046,1,'Please stick to the covid19 rules','please-stick-to-the-covid19-rules','please-stick-to-the-covid19-rules','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>By all working together and sticking to the guidelines we can help protect our Tameside community, and get back to doing the things we all love.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:47','2025-08-01 09:46:53','74a2bcd8-02f2-4792-9fe3-02d12d54c4e5'),(2047,2047,1,'Please stick to the covid19 rules','please-stick-to-the-covid19-rules','please-stick-to-the-covid19-rules','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>By all working together and sticking to the guidelines we can help protect our Tameside community, and get back to doing the things we all love.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','28edd3fe-bcf8-442f-8649-f3dbe821e4e2'),(2048,2048,1,'Looking forward to a haircut?','looking-forward-to-a-haircut','looking-forward-to-a-haircut','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>TAMESIDE businesses are working with the council on a new campaign to encourage residents to stick to the rules so we can all get back to things we love.<br /><br /><br />The Do the Right Thing campaign features owners and staff from local pubs, restaurants and hair and beauty salons – all venues people are looking forward to visiting when the easing of national restrictions allows. They are urging people to stick to covid rules so they can safely reopen their businesses and serve the local community soon.<br /><br />Covid rates have been falling consistently in recent weeks thanks to everyone’s commitment to following the rules. However in recent days the rate of decrease has levelled off, with Tameside currently having the second highest rate of new infections in Greater Manchester and 13th highest nationally.<br /><br />The changeable rates shows this is a very fragile situation and there are concerns that Tameside may be left behind with local restrictions, if the rates start to increase again, while the rest of the country moves forward with more relaxed rules.<br /><br /><br /><br />Residents can do their bit by not mixing households and also by keeping up the handwashing, wearing of face coverings and social distancing to protect eachother.<br /><br />They are urged get tested if they have symptoms, or if they don’t have symptoms but are a frontline worker/can’t work from home or if they are in a household or social bubble with a child attending school of member of teaching staff. This will all help to avoid them passing covid onto loved ones and others in their community.<br /><br />Tameside Council Executive Leader Cllr Brenda Warrington said: “There are certain aspects of life that we are all looking forward to when the easing of restrictions allows, and for many people this may be going for a pint in their local pub, getting their hair cut or eating out in a restaurant. But this can only happen if we can keep our infection rates down and we need the whole community to work with us in sticking to the rules to achieve this.<br /><br />“A big thank you to local businesses for teaming up with us to appeal to the community to do the right thing so that our favourite venues can reopen and serve us again soon. Working with our community has always been a key feature of our covid response and is great to have local businesses on board in highlighting safety messages.<br /><br />“Thank you to everyone for your continued support in abiding by the rules, if we all keep up our commitment to protecting ourselves and each other then we will hopefully be able to move onto living more of the lives we love very soon.”<br /><br />Bil Alam, Of Candolim restaurant in Stalybridge, who features in the campaign, said: “I am pleased to work with Tameside Council on this important issue and support them with the community compliance campaign. Hopefully our community will respect the rules placed on us by the government and won’t forget them once businesses start to reopen again. It’s not just people’s livelihoods at stake, it’s people’s lives which is the most important reason people still need to comply to the rules.”</p>\\n<p><br /></p>\\n<p><a href=\\\"https://www.tameside.gov.uk/Newsroom/Looking-forward-to-eating-out-or-getting-your-hair\\\">https://www.tameside.gov.uk/Ne...</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','b9b49933-5f44-443b-9b68-291947ea05a2'),(2049,2049,1,'Looking forward to a haircut?','looking-forward-to-a-haircut','looking-forward-to-a-haircut','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>TAMESIDE businesses are working with the council on a new campaign to encourage residents to stick to the rules so we can all get back to things we love.<br /><br /><br />The Do the Right Thing campaign features owners and staff from local pubs, restaurants and hair and beauty salons – all venues people are looking forward to visiting when the easing of national restrictions allows. They are urging people to stick to covid rules so they can safely reopen their businesses and serve the local community soon.<br /><br />Covid rates have been falling consistently in recent weeks thanks to everyone’s commitment to following the rules. However in recent days the rate of decrease has levelled off, with Tameside currently having the second highest rate of new infections in Greater Manchester and 13th highest nationally.<br /><br />The changeable rates shows this is a very fragile situation and there are concerns that Tameside may be left behind with local restrictions, if the rates start to increase again, while the rest of the country moves forward with more relaxed rules.<br /><br /><br /><br />Residents can do their bit by not mixing households and also by keeping up the handwashing, wearing of face coverings and social distancing to protect eachother.<br /><br />They are urged get tested if they have symptoms, or if they don’t have symptoms but are a frontline worker/can’t work from home or if they are in a household or social bubble with a child attending school of member of teaching staff. This will all help to avoid them passing covid onto loved ones and others in their community.<br /><br />Tameside Council Executive Leader Cllr Brenda Warrington said: “There are certain aspects of life that we are all looking forward to when the easing of restrictions allows, and for many people this may be going for a pint in their local pub, getting their hair cut or eating out in a restaurant. But this can only happen if we can keep our infection rates down and we need the whole community to work with us in sticking to the rules to achieve this.<br /><br />“A big thank you to local businesses for teaming up with us to appeal to the community to do the right thing so that our favourite venues can reopen and serve us again soon. Working with our community has always been a key feature of our covid response and is great to have local businesses on board in highlighting safety messages.<br /><br />“Thank you to everyone for your continued support in abiding by the rules, if we all keep up our commitment to protecting ourselves and each other then we will hopefully be able to move onto living more of the lives we love very soon.”<br /><br />Bil Alam, Of Candolim restaurant in Stalybridge, who features in the campaign, said: “I am pleased to work with Tameside Council on this important issue and support them with the community compliance campaign. Hopefully our community will respect the rules placed on us by the government and won’t forget them once businesses start to reopen again. It’s not just people’s livelihoods at stake, it’s people’s lives which is the most important reason people still need to comply to the rules.”</p>\\n<p><br /></p>\\n<p><a href=\\\"https://www.tameside.gov.uk/Newsroom/Looking-forward-to-eating-out-or-getting-your-hair\\\">https://www.tameside.gov.uk/Ne...</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','40b4ecf7-d274-4974-a1c3-1ed522dad397'),(2050,2050,1,'Visit guidelines to prepare you for your covid safe visit to our salon','visit-guidelines-to-prepare-you-for-your-covid-safe-visit-to-our-salon','visit-guidelines-to-prepare-you-for-your-covid-safe-visit-to-our-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In light of the current COVID-19 pandemic, we wanted to give you an update on the changes we are making in the salon to ensure your safety is our main priority.<br /></p>\\n<p>We are closely monitoring the government and industry advice, and have made some changes in how we operate under their best guidance.</p>\\n<p><strong>We have introduced a \\\"Covid19 surcharge of £2 for each client to cover our additional costs of making the salon environment a safe place for clients and staff alike whilst providing a PERSONALISED PACK that will contain a Face Mask, towel, disposable gown and cape.</strong></p>\\n<p><strong>Guidelines mean there will be no dry cuts available during this Covid19 period.</strong></p>\\n<p><strong>Arrive for your appointment 5 mins early and wait in your car or in a safe place and call the salon on 0161-368-9999 to let us know you have arrived and we will inform you when to come to the salon doors.</strong></p>\\n<p><strong>Ring the bell upon arrival and you will be met by the receptionist.</strong></p>\\n<p><strong>No need to wear a face mask as one will be provided to you in your pack.</strong></p>\\n<p><strong>Please try to attend without LARGE bags and coats.</strong></p>\\n<p><strong>Attend your appointment on your own.</strong></p>\\n<p><strong>Staff &amp; clients will have their temperature checked before entering the salon.</strong></p>\\n<p><strong>We are taking extra care to ensure we are sanitising and cleaning between each client in the chairs.</strong></p>\\n<p><strong>We have introduced sanitation-stations with hand sanitiser – please use these, as much and as often as you can.</strong></p>\\n<p><strong>The toilet facilities will remain available upon request to your stylist.</strong></p>\\n<p><strong>We are still committed to your comfort while at The Leading Edge however you will notice we have begun serving our refreshments teas &amp; coffees in disposable cups and we promise we are doing our best to recycle and dispose of these ethically.</strong></p>\\n<p><strong>You may also notice that we have removed magazines, again, this is to reduce germ transfer. Please feel free to bring in your own reading materials.</strong></p>\\n<p><strong>All our salon stations adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</strong></p>\\n<p><strong>Our team are following government recommendations and will all be isolating if they show flu-like symptoms, so we ask for your patience and understanding if we need to reschedule your appointment.</strong></p>\\n<p><strong>If you are unwell, or have come into contact with someone with COVID-19 in the last 14 days, please reschedule your appointment, even if you do not have any symptoms.</strong></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','00f61196-7484-49cd-a285-64409b3ffc0c'),(2051,2051,1,'Visit guidelines to prepare you for your covid safe visit to our salon','visit-guidelines-to-prepare-you-for-your-covid-safe-visit-to-our-salon','visit-guidelines-to-prepare-you-for-your-covid-safe-visit-to-our-salon','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>In light of the current COVID-19 pandemic, we wanted to g