 that we have removed magazines, again, this is to reduce germ transfer. Please feel free to bring in your own reading materials.</strong></p>\\n<p><strong>All our salon stations adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</strong></p>\\n<p><strong>Our team are following government recommendations and will all be isolating if they show flu-like symptoms, so we ask for your patience and understanding if we need to reschedule your appointment.</strong></p>\\n<p><strong>If you are unwell, or have come into contact with someone with COVID-19 in the last 14 days, please reschedule your appointment, even if you do not have any symptoms.</strong></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','988fb440-7b49-4111-afeb-bc3b15dea8ab'),(2052,2052,1,'Fools Day','fools-day','fools-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>April Fool’s Day, Thursday, 1st April Today is April Fool\'s Day. Believe nothing and trust no one....Except your Hair Stylist. Book your service today!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','ff233e41-8856-4704-ae9e-d750984603c3'),(2053,2053,1,'Fools Day','fools-day','fools-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>April Fool’s Day, Thursday, 1st April Today is April Fool\'s Day. Believe nothing and trust no one....Except your Hair Stylist. Book your service today!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','720e5274-c62a-4d5d-8e91-e7455246a9b8'),(2054,2054,1,'More than just a Stylist','more-than-just-a-stylist','more-than-just-a-stylist','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>When it hasn’t been your day, your month or even your year... I’ll be hair for you 😉💗 For those of you who aren’t familiar with Friends, let me fill you in on a little secret 🤫 According to the one and only Pheebs, lobsters ma