\\"16\\\" width=\\\"16\\\" alt=\\\"🙌\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t56/1.5/16/1f64c.png\\\" /></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','f417ddd1-73a3-41e2-8016-41c14b1de019'),(2060,2060,1,'Dua Lipa','dua-lipa','dua-lipa','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey hey stunners! I’m seriously OBSESSED with hair 💗 For me, it’s so much more than a job, I am living out my dreams day in and day out! I was drawn to the industry because I love to experiment, reinvent myself and inspire others to embrace whatever style they desire 🙌 It’s safe to say my look has been through its fair share of chops, changes and coloring - but it means I get to express whoever I want to be to the world on any given day, and I think that’s what’s truly beautiful 🌟 Currently, I’m channeling my colour and look around around Dua Lipa. Who’s your style inspo? Let me know in the comments! xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','50acfd22-4911-4f13-b306-a1a2bf686e5f'),(2061,2061,1,'Dua Lipa','dua-lipa','dua-lipa','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey hey stunners! I’m seriously OBSESSED with hair 💗 For me, it’s so much more than a job, I am living out my dreams day in and day out! I was drawn to the industry because I love to experiment, reinvent myself and inspire others to embrace whatever style they desire 🙌 It’s safe to say my look has been through its fair share of chops, changes and coloring - but it means I get to express whoever I want to be to the world on any given day, and I think that’s what’s truly beautiful 🌟 Currently, I’m channeling my colour and look around around Dua Lipa. Who’s your style inspo? Let me know in the comments! xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','02ea2662-3633-483c-bbd4-8560d31be0e1'),(2062,2062,1,'Champers?','cha