s 🤔 <br />Will it flatter your face shape? How are you going to part your hair? Middle, side or zig-zag part? Can you keep up with the maintenance costs? Bangs tend to need attention throughout the day, do you have the time?<br />If you’re still unsure if bangs are the right way to go for you personally, book in a consultation with one of our experienced stylists and they’ll tell you everything you need to know to come to a decision. x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','feab7006-287f-49bb-ad0b-f99da21e2048'),(2073,2073,1,'Bangs!','bangs','bangs','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Considering BANGS? Ask yourself these Q’s 🤔 <br />Will it flatter your face shape? How are you going to part your hair? Middle, side or zig-zag part? Can you keep up with the maintenance costs? Bangs tend to need attention throughout the day, do you have the time?<br />If you’re still unsure if bangs are the right way to go for you personally, book in a consultation with one of our experienced stylists and they’ll tell you everything you need to know to come to a decision. x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:48','bffa0692-6f10-4bba-923f-af891a653bd5'),(2074,2074,1,'Covid Blues','covid-blues','covid-blues','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>GIRLS! Has your COVID blues got you feeling down? Book your appointment to enjoy a moment of peace... Imagine coffee in one hand and your social media fix in the other while we work our magic on your hair. Doesn’t that sound just divine.</p>\\n<p>? You know what to do you’re a few clicks away from this becoming a reality. Book now for a slice of heaven!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:48','2025-08-01 09:46:53','42087501-3aba-4929-93b4-70cfb2ce36b4'),(2075,2075,1,'Covid Blues','covid-blues','covid-blues','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>