 09:46:49','2025-08-01 09:46:49','24e182d3-5ac0-4218-9b5e-ffda67e83ab0'),(2088,2088,1,'Give Away Prize Winner','give-away-prize-winner','give-away-prize-winner','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A BIG thanks for all your entries for our Dr Tangle Brush and a bottle of our best selling Whipped Cream leave in conditioner. The winner picked at random is Jenny Mellor. CONGRATULATIONS!</p>\\n<p>Please call Alan at the salon to agree a time to come and collect your prizes.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:53','ac37ac41-d5c3-408c-b3c5-38cd2ca1b9e1'),(2089,2089,1,'Give Away Prize Winner','give-away-prize-winner','give-away-prize-winner','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>A BIG thanks for all your entries for our Dr Tangle Brush and a bottle of our best selling Whipped Cream leave in conditioner. The winner picked at random is Jenny Mellor. CONGRATULATIONS!</p>\\n<p>Please call Alan at the salon to agree a time to come and collect your prizes.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','a7848b05-889c-4956-b2dc-bc9b5f43b3dd'),(2090,2090,1,'We are pleased to be stockists of a new professional eco-ethical brand.','we-are-pleased-to-be-stockists-of-wedo-a-new-professional-eco-ethical-brand-offering-a-range-of-vegan-and-cruelty-free-care-products-with-minimal-ingredients-with-100-recyclable-packaging-and-professional-performance','we-are-pleased-to-be-stockists-of-wedo-a-new-professional-eco-ethical-brand-offering-a-range-of-vegan-and-cruelty-free-care-products-with-minimal-ingredients-with-100-recyclable-packaging-and-professional-performance','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<figure class=\\\"media\\\"><oembed url=\\\"https://www.youtube.com/embed/4OdPtrvIz-0\\\"></oembed></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','3ceba8a3-9617-403c-bedf-82a418a57