ch your regrowth. But the number one reason is if the regrowth is left any longer, you can start to experience what we call ‘banding’ in your color – which means your color will be uneven 😭. Banding happens when the bleach closest to your scalp processes faster than the bleach further from your scalp – which only becomes a problem if your regrowth touch-up appointment is left longer than the 8 week mark. Basically there’s too much regrowth for the bleach to process evenly! Interesting hey! Give us a call today to book in your regrowth touch-up</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','6749a061-6eb6-4aa0-87b6-0b79a6b2c89a'),(2094,2094,1,'Hairdresser','hairdresser','hairdresser','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>There is seriously no better therapy than sitting in your stylists chair! Am I right!? Believe us we’ve heard ALL types of juicy secrets behind the chair. As the Friend\'s theme song says, “I’ll be there for you.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','a7ff956d-4eba-4e70-8783-be0420129ef0'),(2095,2095,1,'Hairdresser','hairdresser','hairdresser','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>There is seriously no better therapy than sitting in your stylists chair! Am I right!? Believe us we’ve heard ALL types of juicy secrets behind the chair. As the Friend\'s theme song says, “I’ll be there for you.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','f783bf9c-4631-4174-b9b5-ef287d42f2a9'),(2096,2096,1,'Show Your Body Some Love','show-your-body-some-love','show-your-body-some-love','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>No matter the season there’s no better way to show your body and mind some love than with a good ol’ bubble bath 🛀 But we know you ain’t basic, so next time you unwind with some bubbles, be sure to add a little bit of spice ✨ Now, we’re not opposed to a glass of bubbles either, but our top tip would have to be investing in a soap that not only nourishes your skin, but smells oh-so-sweet too! Personally, my go-to would have to be Ro\'s Argan body conditioner because it moisturises and has a scent like no other. What’s your fav way to treat your body?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','8eefaedc-0df9-40c8-b965-b9f8e6bdfff7'),(2097,2097,1,'Show Your Body Some Love','show-your-body-some-love','show-your-body-some-love','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>No matter the season there’s no better way to show your body and mind some love than with a good ol’ bubble bath 🛀 But we know you ain’t basic, so next time you unwind with some bubbles, be sure to add a little bit of spice ✨ Now, we’re not opposed to a glass of bubbles either, but our top tip would have to be investing in a soap that not only nourishes your skin, but smells oh-so-sweet too! Personally, my go-to would have to be Ro\'s Argan body conditioner because it moisturises and has a scent like no other. What’s your fav way to treat your body?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','4a72cd2d-6445-4c32-8301-e7ac45ed9ec2'),(2098,2098,1,'Going Blonde','going-blonde','going-blonde','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Going, going, BLONDE! Come into The Leading Edge and try one of our balayage / highlight coloring] services! Mention this social post and receive a free sample of shampoo &amp; conditioner at your next appointment. Can’t wait to see you in the chair gorgeous! x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','a8b88fb0-27ff-488c-a226-b21ff28b7ff8'),(2099,2099,1,'Going Blonde','going-blonde','going-blonde','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Going, going, BLONDE! Come into The Leading Edge and try one of our balayage / highlight coloring] services! Mention this social post and receive a free sample of shampoo &amp; conditioner at your next appointment. Can’t wait to see you in the chair gorgeous! x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','3f449dca-b982-4444-836b-3ea9d207cfd0'),(2100,2100,1,'Hair Style & Colour','hair-style-colour','hair-style-colour','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>When switching up your style, the best way to show what you want is through inspiration pics! Trust us, we love when clients show us their dreamy Pinterest boards. Yeah, you could describe what you’re looking for, but to avoid getting too much cut off or a different version of your vision, give us a real solid picture of what you\'re envisioning. TIP! Show both pictures of styles, cuts and colours you don’t like so then you can show our stylist what not to do. Then narrow down the vision by showing one of our stylists your top 3-5 inspo pics. All our stylists are trained with colour, so they’ll steer you clear of anything that will wash out your skin tone or require any high maintenance. Sound good? Book in now to switch up your style. Link in bio to book x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','c65d46c2-ef3e-4763-8ac4-d4469d807511'),(2101,2101,1,'Hair Style & Colour','hair-style-colour','hair-style-colour','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>When switching up your style, the best way to show what you want is through inspiration pics! Trust us, we love when clients show us their dreamy Pinterest boards. Yeah, you could describe what you’re looking for, but to avoid getting too much cut off or a different version of your vision, give us a real solid picture of what you\'re envisioning. TIP! Show both pictures of styles, cuts and colours you don’t like so then you can show our stylist what not to do. Then narrow down the vision by showing one of our stylists your top 3-5 inspo pics. All our stylists are trained with colour, so they’ll steer you clear of anything that will wash out your skin tone or require any high maintenance. Sound good? Book in now to switch up your style. Link in bio to book x</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','b884d7be-d7cc-4931-ab5e-7ac60cf4f8a3'),(2102,2102,1,'Experienced Stylist Required','experienced-stylist-required','experienced-stylist-required','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Due to demand and coupled with maternity leave we require an experienced stylist to join our fantastic team to deliver quality hair services and amazing customer service. If you feel like this is you then please call Alan at the salon on 0161-368-9999</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','4a485bf9-727c-4901-b6bf-08ce71a12366'),(2103,2103,1,'Experienced Stylist Required','experienced-stylist-required','experienced-stylist-required','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Due to demand and coupled with maternity leave we require an experienced stylist to join our fantastic team to deliver quality hair services and amazing customer service. If you feel like this is you then please call Alan at the salon on 0161-368-9999</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','38408bbb-24ca-48a8-9bfa-f670b175fe30'),(2104,2104,1,'Back on the town','back-on-the-town','back-on-the-town','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>To say that the last year has been a strange one would be a understatement of the century, but thankfully that end-of-the-tunnel light everyone was banging on about is finally starting to get closer. From restaurants, bars, and night clubs looking to welcome you back with delicious plates of food to the true sound of the night club calling your name fresh from lockdown. We\'ve decided to celebrate with you! We are offering you a shampoo and blowdry for £12 and £17 for long hair. This will take the stress out of doing your hair and give you that glam look you want. Available from 22nd July with Emily or Liz on Thursday-Friday-Saturday call 0161-368-9999</p>\\n<p><a href=\\\"https://www.facebook.com/hashtag/nightout?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#nightout</a> <a href=\\\"https://www.facebook.com/hashtag/nightclub?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#nightclub</a> <a href=\\\"https://www.facebook.com/hashtag/onthetown?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#onthetown</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','1343caaa-514e-432e-ac20-f8a3abff5edf'),(2105,2105,1,'Back on the town','back-on-the-town','back-on-the-town','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>To say that the last year has been a strange one would be a understatement of the century, but thankfully that end-of-the-tunnel light everyone was banging on about is finally starting to get closer. From restaurants, bars, and night clubs looking to welcome you back with delicious plates of food to the true sound of the night club calling your name fresh from lockdown. We\'ve decided to celebrate with you! We are offering you a shampoo and blowdry for £12 and £17 for long hair. This will take the stress out of doing your hair and give you that glam look you want. Available from 22nd July with Emily or Liz on Thursday-Friday-Saturday call 0161-368-9999</p>\\n<p><a href=\\\"https://www.facebook.com/hashtag/nightout?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#nightout</a> <a href=\\\"https://www.facebook.com/hashtag/nightclub?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#nightclub</a> <a href=\\\"https://www.facebook.com/hashtag/onthetown?__cft__%5B0%5D=AZW_DjSbjMPG98_KhSadW_WX2VpC_-050jcdutRe-vZBSN_PDdd4bzGfKLJIgHmiwwWWhHsRuddTpfjN8RAak59n_kjFxldb3URw8KTHXRu78l0hawsOH60-CW3_3OU9CUvzJuAAQz8OT0Q6lC-BKyTh&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#onthetown</a></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','4d4c6e02-67bc-4cfd-bb4d-4ecae0fdb332'),(2106,2106,1,'End of Lockdown Visit Notes','end-of-lockdown-visit-notes','end-of-lockdown-visit-notes','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As we move forward into Step 4 of the Governments Road Map on Monday 19<sup>th</sup> July we would just like to share our plans going forward and express our thanks and gratitude for your support and understanding over this challenging time. </p>\\n<p>Here at The Leading Edge Hair &amp; Beauty we are still committed to provide both a safe and comfortable environment for staff and customers alike and although facemasks are not compulsory, we would out of respect for others encourage customers to still wear them as we carry out our close contact services.</p>\\n<p>When you arrive, please ring the doorbell for entry. We appreciate that you have all followed the Government Guidelines before you visit the salon. We will still provide sanitation-stations with hand sanitiser, and encourage you to use these as often as you like. </p>\\n<p>The Covid19 surcharge will be removed, however those still wanting personal Covid19 packs will be able to purchase them at £2.</p>\\n<p>We look forward to welcoming you in the salon soon.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','d4348c4e-fea8-4c49-9076-94a328d1cb34'),(2107,2107,1,'End of Lockdown Visit Notes','end-of-lockdown-visit-notes','end-of-lockdown-visit-notes','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As we move forward into Step 4 of the Governments Road Map on Monday 19<sup>th</sup> July we would just like to share our plans going forward and express our thanks and gratitude for your support and understanding over this challenging time. </p>\\n<p>Here at The Leading Edge Hair &amp; Beauty we are still committed to provide both a safe and comfortable environment for staff and customers alike and although facemasks are not compulsory, we would out of respect for others encourage customers to still wear them as we carry out our close contact services.</p>\\n<p>When you arrive, please ring the doorbell for entry. We appreciate that you have all followed the Government Guidelines before you visit the salon. We will still provide sanitation-stations with hand sanitiser, and encourage you to use these as often as you like. </p>\\n<p>The Covid19 surcharge will be removed, however those still wanting personal Covid19 packs will be able to purchase them at £2.</p>\\n<p>We look forward to welcoming you in the salon soon.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','58358300-b4ac-4a89-8f8b-60a02e5c5d0b'),(2108,2108,1,'Eye Lash Technician','eye-lash-technician','eye-lash-technician','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce the arrival of Georgia who is a fully trained and insured Eye Lash Technician offering Classic, Hybrid, Russian and Mega Volume styles.</p>\\n<p>Skin tests are not required so you can book online to secure your appointment at your convenience. </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:54','4e490aec-ae8d-468a-81a6-4cc4b12a8b90'),(2109,2109,1,'Eye Lash Technician','eye-lash-technician','eye-lash-technician','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>We are pleased to announce the arrival of Georgia who is a fully trained and insured Eye Lash Technician offering Classic, Hybrid, Russian and Mega Volume styles.</p>\\n<p>Skin tests are not required so you can book online to secure your appointment at your convenience. </p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:49','2025-08-01 09:46:49','fdd90b4d-0ea0-4753-9b35-30671b8b8ff7'),(2110,2110,1,'Salon Visit Procedures Update October 23rd 2021','salon-visit-procedures-update-october-23rd-2021','salon-visit-procedures-update-october-23rd-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As you will know the amount of positive Covid19 cases is rising across the country with Tameside having one of the highest rates in our region we have had to review our procedures to protect both our staff and our clients.</p>\\n<p>From Tuesday 26<sup>th</sup> October we will re-introduced a Covid19 surcharge of £2 for each client to cover our additional costs of making the salon environment a safe place. You will be provided with a PERSONALISED PACK that will contain a Face Mask, towel, disposable gown and cape.</p>\\n<p>Please ring the bell upon arrival and you will be met by the receptionist.</p>\\n<p>Try to attend your appointment on your own.</p>\\n<p>Staff &amp; clients will have their temperature checked before entering the salon.</p>\\n<p>We are taking extra care to ensure we are sanitising and cleaning between each client in the chairs.</p>\\n<p>We have introduced sanitation-stations with hand sanitiser – please use these, as much and as often as you can.</p>\\n<p>The toilet facilities will remain available upon request to your stylist.</p>\\n<p>All our salon stations are at least 2 metres apart and adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</p>\\n<p>We are still committed to your comfort while at The Leading Edge and will continue to provide you with refreshments and a safe environment in which to relax.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','0c580839-52c4-48ed-ab16-6c23bde574e8'),(2111,2111,1,'Salon Visit Procedures Update October 23rd 2021','salon-visit-procedures-update-october-23rd-2021','salon-visit-procedures-update-october-23rd-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>As you will know the amount of positive Covid19 cases is rising across the country with Tameside having one of the highest rates in our region we have had to review our procedures to protect both our staff and our clients.</p>\\n<p>From Tuesday 26<sup>th</sup> October we will re-introduced a Covid19 surcharge of £2 for each client to cover our additional costs of making the salon environment a safe place. You will be provided with a PERSONALISED PACK that will contain a Face Mask, towel, disposable gown and cape.</p>\\n<p>Please ring the bell upon arrival and you will be met by the receptionist.</p>\\n<p>Try to attend your appointment on your own.</p>\\n<p>Staff &amp; clients will have their temperature checked before entering the salon.</p>\\n<p>We are taking extra care to ensure we are sanitising and cleaning between each client in the chairs.</p>\\n<p>We have introduced sanitation-stations with hand sanitiser – please use these, as much and as often as you can.</p>\\n<p>The toilet facilities will remain available upon request to your stylist.</p>\\n<p>All our salon stations are at least 2 metres apart and adhere to the 2 metre social distancing guidelines and movement around the salon is restricted.</p>\\n<p>We are still committed to your comfort while at The Leading Edge and will continue to provide you with refreshments and a safe environment in which to relax.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','36e8a0fd-a384-497f-bb68-591371478ffc'),(2112,2112,1,'Merry Christmas 2021','merry-christmas-2021','merry-christmas-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Merry Christmas Kings &amp; Queens - wishing you and your family all the good food and drink your tummies can hold. have a fabulous and relaxing break.\\nIt’s the most wonderful time of the year. Happy Holidays everyone! From us ALL at The Leading Edge Hair &amp; Beauty</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','fdaecb99-b609-441e-9a42-e5efd75f5b16'),(2113,2113,1,'Merry Christmas 2021','merry-christmas-2021','merry-christmas-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<pre><code class=\\\"language-plaintext\\\">Merry Christmas Kings &amp; Queens - wishing you and your family all the good food and drink your tummies can hold. have a fabulous and relaxing break.\\nIt’s the most wonderful time of the year. Happy Holidays everyone! From us ALL at The Leading Edge Hair &amp; Beauty</code></pre>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','1f72eda6-b536-41ae-9b6f-87e025e9b454'),(2114,2114,1,'Bye Bye 2021','bye-bye-2021','bye-bye-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>That\'s a wrap guys &amp; gals!<br />So grab a glass of whatever it is you like best, and let\'s toast the closing of one hell of a crazy year! 2021 you will not be missed! <br />Let\'s bring on 2022 and celebrate the start of a (hopefully) less crazy and fabulous new year for all.<br />For my new year\'s resolution I am going to do my best to ensure that I have the health of the planet in my mind in all I do.<br />What\'s your new year\'s resolution?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','784b2a13-8b7a-42c2-94dd-679571598d81'),(2115,2115,1,'Bye Bye 2021','bye-bye-2021','bye-bye-2021','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>That\'s a wrap guys &amp; gals!<br />So grab a glass of whatever it is you like best, and let\'s toast the closing of one hell of a crazy year! 2021 you will not be missed! <br />Let\'s bring on 2022 and celebrate the start of a (hopefully) less crazy and fabulous new year for all.<br />For my new year\'s resolution I am going to do my best to ensure that I have the health of the planet in my mind in all I do.<br />What\'s your new year\'s resolution?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','d16c33e1-4ee6-413e-994c-d314409b67d4'),(2116,2116,1,'It\'s December 2021 Already','its-december-2021-already','its-december-2021-already','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well lovely people, we did it! We made it to the last month of 2021. <br />We don’t want to sound like a broken record, but how is it December already?! This year has flown by - it feels like I blinked and it was gone! <br />It’s been a wild year, that’s for sure, so let’s instead flip the focus and highlight some of the amazing moments we experienced this year.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','9d6f1fc8-b0d5-424d-a454-30c7ffbb058f'),(2117,2117,1,'It\'s December 2021 Already','its-december-2021-already','its-december-2021-already','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Well lovely people, we did it! We made it to the last month of 2021. <br />We don’t want to sound like a broken record, but how is it December already?! This year has flown by - it feels like I blinked and it was gone! <br />It’s been a wild year, that’s for sure, so let’s instead flip the focus and highlight some of the amazing moments we experienced this year.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','b7722a73-5ca0-4153-81e7-007d35a3e787'),(2118,2118,1,'Happy 2022','happy-2022','happy-2022','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Happy New Year! I am sure we can ALL agree that a fresh start and a new year was MUCH needed! With all the uncertainty &amp; difficulties of 2020, let’s start this new year off with a bang. Sooo… Welcome to 2021! What are some of your goals for this year? Personal goals? Professional goals? We want to hear them ALL! Tell us in the comments below 👇</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','e798defd-9e46-45df-84a3-2f444c563fd1'),(2119,2119,1,'Happy 2022','happy-2022','happy-2022','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Happy New Year! I am sure we can ALL agree that a fresh start and a new year was MUCH needed! With all the uncertainty &amp; difficulties of 2020, let’s start this new year off with a bang. Sooo… Welcome to 2021! What are some of your goals for this year? Personal goals? Professional goals? We want to hear them ALL! Tell us in the comments below 👇</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','716679cc-5e8e-48b4-83f8-cd44786b7e75'),(2120,2120,1,'Vivids are BEST','vivids-are-best','vivids-are-best','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is your sign to venture out of your comfort zone and experience the rainbow! <br />We adore experimenting different vivids to make your bold color dreams come true in our #salon. <br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','928f9f68-521a-40d2-bef3-079c13f594ac'),(2121,2121,1,'Vivids are BEST','vivids-are-best','vivids-are-best','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is your sign to venture out of your comfort zone and experience the rainbow! <br />We adore experimenting different vivids to make your bold color dreams come true in our #salon. <br /></p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','5e002a4c-4e34-45e9-a3fb-3f0e07bd29d2'),(2122,2122,1,'Sunday Sunday My Fun Day','sunday-sunday-my-fun-day','sunday-sunday-my-fun-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>My Sundays are so close to my heart / Who doesn’t love a Sunday switch-off?<br />For me, it’s one of the very few days where I can slow down and devote a little bit of time to myself.<br />My business, clients, family and friends always come first (and rightfully so!) but I know I also need to take some time for myself too at some point. Otherwise I’m constantly burning the candle at both ends with zero chance for rejuvenation!<br />I love to relax in a hot bath with my Badedas Bath Gel and a large G&amp;T<br />How do you like to relax? Pop your ideas in the comments below so I can try them out too! X</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','4b285ddd-c8b2-4a76-b3f8-2f2876811c1e'),(2123,2123,1,'Sunday Sunday My Fun Day','sunday-sunday-my-fun-day','sunday-sunday-my-fun-day','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>My Sundays are so close to my heart / Who doesn’t love a Sunday switch-off?<br />For me, it’s one of the very few days where I can slow down and devote a little bit of time to myself.<br />My business, clients, family and friends always come first (and rightfully so!) but I know I also need to take some time for myself too at some point. Otherwise I’m constantly burning the candle at both ends with zero chance for rejuvenation!<br />I love to relax in a hot bath with my Badedas Bath Gel and a large G&amp;T<br />How do you like to relax? Pop your ideas in the comments below so I can try them out too! X</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','d93fa827-fc55-494c-922b-ac7a655acb00'),(2124,2124,1,'Hair Colour Mixologist','hair-colour-mixologist','hair-colour-mixologist','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey Insta Facebook fam - it’s Emily here. <br />I like to think of myself as the resident mixologist at The Leading Edge aka the Queen of formulas if you will! <br />There’s so much that goes into mixing the perfect colour, bleach, treatment or toner for every client. You’re all so beautifully unique, and so is your #hair! <br />You all have different hair needs when it comes to the products we use and one of my special skills is being the #salon’s chemistry-wizard that can whip up the perfect hair cocktail to reach our desired end result. <br />it’s my absolute PASSION doing color transformations. So if you’re looking for a colour refresh or to dip your toes into something more bold, don’t be afraid to send me a DM today xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','ae69d374-1f01-47b5-aed7-f3841c3405bc'),(2125,2125,1,'Hair Colour Mixologist','hair-colour-mixologist','hair-colour-mixologist','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Hey Insta Facebook fam - it’s Emily here. <br />I like to think of myself as the resident mixologist at The Leading Edge aka the Queen of formulas if you will! <br />There’s so much that goes into mixing the perfect colour, bleach, treatment or toner for every client. You’re all so beautifully unique, and so is your #hair! <br />You all have different hair needs when it comes to the products we use and one of my special skills is being the #salon’s chemistry-wizard that can whip up the perfect hair cocktail to reach our desired end result. <br />it’s my absolute PASSION doing color transformations. So if you’re looking for a colour refresh or to dip your toes into something more bold, don’t be afraid to send me a DM today xx</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','fd8647fd-182c-4f5a-b222-c5cbe52c264b'),(2126,2126,1,'Main Event is your hair','main-event-is-your-hair','main-event-is-your-hair','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Your hair is the main event, whereas styling is the icing on the cake! <br />There are so many creative ways that you can style your locks - some are super quick and easy, and others take a little practice to get the hang of. <br />Here are some tips that you can try out today! <br />Try straighteners to tongs to curling wands. For a variety of looks. #wave #curls #straight <br />For a fuller look you can try a range of products from MilkShake to Wella and a variety of volumising products.<br />We have a styling product from Gorilla Hair Powder that is an amazing all rounder that will give lift, hold and style.<br />Happy styling 🥰</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','33095a4d-d9c7-4664-ab4c-b5c85a3a8894'),(2127,2127,1,'Main Event is your hair','main-event-is-your-hair','main-event-is-your-hair','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Your hair is the main event, whereas styling is the icing on the cake! <br />There are so many creative ways that you can style your locks - some are super quick and easy, and others take a little practice to get the hang of. <br />Here are some tips that you can try out today! <br />Try straighteners to tongs to curling wands. For a variety of looks. #wave #curls #straight <br />For a fuller look you can try a range of products from MilkShake to Wella and a variety of volumising products.<br />We have a styling product from Gorilla Hair Powder that is an amazing all rounder that will give lift, hold and style.<br />Happy styling 🥰</p>\", \"e7d8d3ad-81