ion* Boosts Shine &amp; Protects Colour* Softness &amp; Manageability* Helps to protect Split Ends* Refreshes Hairstyle<br />All this for just £16. Amazing Value</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','b2bb6f92-b7df-4863-8cab-16c7137b0ee1'),(2130,2130,1,'BREATHE','breathe','breathe','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Day to day life gets so hectic - it\'s important to take time for ourselves and just BREATHE. So take that deep breath, book an appointment and just relax. There is nothing like getting your hair, nails or eyelashes done to take a break, chill and unwind. So slide on down to the link in our bio and set a time to take a moment for you today,</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','ac432e7f-b0c0-400c-8253-bf98d145475e'),(2131,2131,1,'BREATHE','breathe','breathe','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Day to day life gets so hectic - it\'s important to take time for ourselves and just BREATHE. So take that deep breath, book an appointment and just relax. There is nothing like getting your hair, nails or eyelashes done to take a break, chill and unwind. So slide on down to the link in our bio and set a time to take a moment for you today,</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','8b7172a9-5baa-44ed-8c7c-7f6b341a7061'),(2132,2132,1,'Festive Traditions','festive-traditions','festive-traditions','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>It’s festive season, queens and kings! And that means all of my favorite festive season traditions are back. <br />While the lead up to the holidays can be mayhem, there’s nothing like kicking back and, spending time with loved ones and embracing traditions. <br />My favourite holiday tradition is mulled wine and mince pies. <br />Drop your festive season traditions in the comments below - and maybe we can all work a new tradition into our holidays this year!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','f83e9933-1654-43a1-b14c-3c1e9a7b32c6'),(2133,2133,1,'Festive Traditions','festive-traditions','festive-traditions','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>It’s festive season, queens and kings! And that means all of my favorite festive season traditions are back. <br />While the lead up to the holidays can be mayhem, there’s nothing like kicking back and, spending time with loved ones and embracing traditions. <br />My favourite holiday tradition is mulled wine and mince pies. <br />Drop your festive season traditions in the comments below - and maybe we can all work a new tradition into our holidays this year!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','99e1bd7a-e5f8-4bf8-8a31-ad239c69af15'),(2134,2134,1,'New Years Resolutions 2022','new-years-resolutions-2022','new-years-resolutions-2022','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>2020 and 2021 were crazy years! ! Well we didn’t have a great start to the 20’s did we? But now the new year is upon us, it\'s time to reset, refresh and embrace the future! Glow baby! <br />So tell us, what are some of your New Year’s Resolutions for 2022?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','4aac43e3-8629-48e3-af7d-cb44f96587c8'),(2135,2135,1,'New Years Resolutions 2022','new-years-resolutions-2022','new-years-resolutions-2022','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>2020 and 2021 were crazy years! ! Well we didn’t have a great start to the 20’s did we? But now the new year is upon us, it\'s time to reset, refresh and embrace the future! Glow baby! <br />So tell us, what are some of your New Year’s Resolutions for 2022?</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','b13b9171-5346-