g you down anyway 😘</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','23c4a944-967d-4300-9dfa-feac68776830'),(2142,2142,1,'Talk the Talk','talk-the-talk','talk-the-talk','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>There are those who try to walk the walk, and those who try to talk the talk, but the one thing you can never fake is RESULTS. Want to stun them with the bold new you? We can help. </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"😉\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb0/1.5/16/1f609.png\\\" /></figure><p> Give us a call and start your <a href=\\\"https://www.facebook.com/hashtag/hair?__cft__%5B0%5D=AZX1aiA5doDQKDbMT86S4pKo1bv8E9FDAxcvRBdgkQrqAxJ7FGa0Q76ZWzv1rwxk--7b3IpL2cdxX3THq3To63-JapbP6D6c35iAuUJGeSqwH7CGYHdC_gETs7j939fTOLg&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#hair</a> and or <a href=\\\"https://www.facebook.com/hashtag/nail?__cft__%5B0%5D=AZX1aiA5doDQKDbMT86S4pKo1bv8E9FDAxcvRBdgkQrqAxJ7FGa0Q76ZWzv1rwxk--7b3IpL2cdxX3THq3To63-JapbP6D6c35iAuUJGeSqwH7CGYHdC_gETs7j939fTOLg&amp;__tn__=*NK-R\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">#nail</a> journey today.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','40c0e3a4-b122-4863-9659-d5f613e46c03'),(2143,2143,1,'Talk the Talk','talk-the-talk','talk-the-talk','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>There are those who try to walk the walk, and those who try to talk the talk, but the one thing you can never fake is RESULTS. Want to stun them with the bold new you? We can help. </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"😉\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb0/1.5/16/1f609.png\\\" /></figure><p> Give us a call and start your <a href=\\\"https://www.facebook.com/hashtag/hair?__cft__%5B0%5D=AZX1aiA5doDQKDbMT86S4pKo1bv8E9FDAxcvR