tart? Well, you know what they say... If you can\'t change your mood, change your colour!<br />We’d love to help you get started on your hair colour transformation. So if you’re ready to rock your next bold look, give us a bell - our chair is always waiting.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:54','2fac2e97-507a-48a6-832a-64cf74c1cbb3'),(2147,2147,1,'Hair Colour Transformation','hair-colour-transformation','hair-colour-transformation','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Feeling like you need a bit of a change but don\'t know where to start? Well, you know what they say... If you can\'t change your mood, change your colour!<br />We’d love to help you get started on your hair colour transformation. So if you’re ready to rock your next bold look, give us a bell - our chair is always waiting.</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:50','2025-08-01 09:46:50','7e0dffb2-c9dd-4d6a-b729-272fd2183095'),(2148,2148,1,'Hair Irons','hair-irons','hair-irons','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Ok but wait a minute…., who remembers the days where people would actually straighten their hair using a clothes iron?! 😱 As a hairdresser I could neverrrrrr! <br />I’ve heard countless stories of gals (or guys!) in moments of desperation where they’ve forgotten or lost their straightener so took to the clothes iron and fried their hair within an inch of its life! <br />The reality is, a clothes iron is just far too hot for your hair. We recommend keeping your hot tools to a max of 350-375 degrees. <br />Remember to treat your hair with kindness, beautiful people ❤️</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:54','8d06def8-c5d7-4bbf-937a-78133461b6ca'),(2149,2149,1,'Hair Irons','hair-irons','hair-irons','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Ok but wait a minute…., who remembers the days where people would actually straighten their hair using a clothes iron?! 😱 As a hairdresser I could neverrrrrr! <br />I’ve heard countless stories of gals (or guys!) in moments of desperation where they’ve forgotten or lost their straightener so took to the clothes iron and fried their hair within an inch of its life! <br />The reality is, a clothes iron is just far too hot for your hair. We recommend keeping your hot tools to a max of 350-375 degrees. <br />Remember to treat your hair with kindness, beautiful people ❤️</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:51','dec7d5f1-fd49-4378-bc63-299521190cbb'),(2150,2150,1,'Bobby Pins','bobby-pins','bobby-pins','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Life status: Currently holding it together with one bobby pin.<br />Like all #hairstylists I have a huge stash of bobby pins, until I need one for an emergency, and then I can’t find a single one. <br />Who else can relate?! <br />Where’s the strangest place you’ve found a lost bobby pin - I want to hear some crazy stories!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:54','85ea5d5b-cd83-4707-a7d8-0527a7517f51'),(2151,2151,1,'Bobby Pins','bobby-pins','bobby-pins','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Life status: Currently holding it together with one bobby pin.<br />Like all #hairstylists I have a huge stash of bobby pins, until I need one for an emergency, and then I can’t find a single one. <br />Who else can relate?! <br />Where’s the strangest place you’ve found a lost bobby pin - I want to hear some crazy stories!</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:51','4a023938-d601-4962-99ec-df95fa65966c'),(2152,2152,1,'Therapy is expensive','therapy-is-expensive','therapy-is-expensive','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is your PSA that it’s ok to take a moment for yourself. There is no better time to dream about the future like what you want for yourself, your life, career, relationships and goals - than while sitting in our chair! <br />Our stylists are great listeners and we love chatting with our clients and hearing what’s on your mind.<br />So what are you waiting for? Book a sesh and let us work our magic ✨</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:54','fce8a91e-22d8-4720-95e0-d87ff27fb8c3'),(2153,2153,1,'Therapy is expensive','therapy-is-expensive','therapy-is-expensive','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>This is your PSA that it’s ok to take a moment for yourself. There is no better time to dream about the future like what you want for yourself, your life, career, relationships and goals - than while sitting in our chair! <br />Our stylists are great listeners and we love chatting with our clients and hearing what’s on your mind.<br />So what are you waiting for? Book a sesh and let us work our magic ✨</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:51','a367a736-7076-4cdd-866a-b5df36c37e86'),(2154,2154,1,'Nails Superpower','nails-superpower','nails-superpower','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>I may as well wear a cape at this point, just call me a nail master and be done with it!<br />I honestly LOVE doing nails. There’s no better feeling than getting to bring your ideas to life and flex my creative muscles! The best part about it is getting to see the look on my client’s face at the end of their appointment! <br />I’ve just posted a few of my favorite creations on my story - head there to check them out! If you see something you like, I can always recreate it for you at your next appointment 😘 nailsbynatashah</p>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:51','2025-08-01 09:46:54','40a2a1a5-7be4-421c-bdf5-6e04d87cd2ef'),(2155,2155,1,'Nails Superpower','nails-superpower','nails