this be your sign to go out there and get it </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"🔥\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta9/1.5/16/1f525.png\\\" /></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:52','2025-08-01 09:46:52','50f3561a-929f-4821-87b2-fc19ff92f26b'),(2180,2180,1,'Heaven','heavan','heavan','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The best part about your hair appointment? The complimentary head massage with every basin wash </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"🤤\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2c/1.5/16/1f924.png\\\" /></figure><p> We don’t need to tell you that it feels like HEAVEN! But good feels aside, it’s also a super helpful method to promote blood flow to your scalp and aid hair growth. It’s one of a hairdresser’s many secrets to healthy hair!Sound amazing? Give us a call or Book your appointment online today and don’t forget to add on those complementary head rubs. </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"😉\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb0/1.5/16/1f609.png\\\" /></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:52','2025-08-01 09:46:54','74e3f30d-28c7-4421-9a7d-1b4064a68010'),(2181,2181,1,'Heaven','heavan','heavan','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>The best part about your hair appointment? The complimentary head massage with every basin wash </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"🤤\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2c/1.5/16/1f924.png\\\" /></figure><p> We don’t need to tell you that it feels like HEAVEN! But good feels aside, it’s also a super helpful method to promote blood flow to your scalp and aid hair growth. It’s one of a hairdresser’s many secrets to healthy hair!Sound amazing? Give us a call or Book your appointment online today and don’t forget to add on those complementary head rubs. </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"😉\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb0/1.5/16/1f609.png\\\" /></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:52','2025-08-01 09:46:52','bad65ab9-b7b9-42e8-9db0-f51e04cf91a8'),(2182,2182,1,'Happiness','happiness','happiness','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>They say the only way to do great work is to love what you do, and I can say I’ve happily found that thanks to you. Happiness is an inside job, so figure out what type of work makes you feel happy and go for it! I love being a hairdresser because I can be creative and I make people happy.  Why does your work make you happy? Share your happiness in the comments below </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"🌞\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb8/1.5/16/1f31e.png\\\" /></figure><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"👇\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta8/1.5/16/1f447.png\\\" /></figure>\", \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-01 09:46:52','2025-08-01 09:46:54','3d1eb809-fece-457b-9057-7cb6708b1095'),(2183,2183,1,'Happiness','happiness','happiness','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>They say the only way to do great work is to love what you do, and I can say I’ve happily found that thanks to you. Happiness is an inside job, so figure out what type of work makes you feel happy and go for it! I love being a hairdresser because I can be creative and I make people happy.  Why does your work make you happy? Share your happiness in the comments below </p><figure class=\\\"image\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"🌞\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb8