d have a large waiting list for appointments and we often find ourselves with little or no time to fill them as people are just not showing for their booke',NULL,NULL,NULL,1,'2025-08-03 10:34:49','2025-08-03 10:34:49','ef484595-9de6-4d19-b2e6-e7f5cb46453e'),(2583,2583,1,'Wella 3 d Copy',NULL,NULL,NULL,1,'2025-08-03 10:34:49','2025-08-03 10:34:49','50fcd048-ccc8-41ad-9d53-96895c51d550'),(2584,2584,1,'White teeth',NULL,NULL,NULL,1,'2025-08-03 10:34:49','2025-08-03 10:34:49','2997cc2c-bbd3-4882-99a9-b6dc98e04531'),(2585,2585,1,'WMH Day',NULL,NULL,NULL,1,'2025-08-03 10:34:49','2025-08-03 10:34:49','a5e7776d-ac00-45cd-9448-3e7fb1c81ffb'),(2587,2587,1,'August 1st Price Increase','august-1st-price-increase','news/august-1st-price-increase','{\"89d6e74c-311b-4e96-a7f3-56d502e0cc13\": \"<p>Dear Valued Customer,</p><p>We hope this message finds you well. At The Leading Edge Hair &amp; Beauty, we are committed to delivering exceptional service using only the finest colours and products the industry has to offer. Your satisfaction and trust mean everything to us, and we take great pride in maintaining the highest standards in everything we do.</p><p>For the past 39 months, we have absorbed ongoing increases in supplier costs without passing them on to you. However, in order to continue providing the quality you expect and deserve, we will be introducing a small price increase from 1st August which is available to see on our website.</p><p>This change allows us to continue investing in the best products, training, and techniques to ensure you always receive excellent results and great value for money.</p><p>We truly appreciate your continued support and understanding. If you have any questions, please don’t hesitate to reach out.</p><p>Warm regards,</p><p>Alan Havery                                                                                                        The Leading Edge Hair &amp; Beauty</p>\", \"e3000e7f-1bdf-48db-91cc-30b73a438004\": [2298], \"e7d8d3ad-81d4-4164-b482-db5f8b283dcb\": false}',1,'2025-08-03 10:42:05','2025-08-03 10:42:05','389ad9d9-fa20-42a2-a65b-7c2f5db80107'),(2588,2588,1,'Default',NULL,NULL,NULL,1,'2025-08-03 11:10:47','2025-08-03 11:10:47','73ee2cd5-cc83-401b-9e5a-802fba42f945'),(2591,2591,1,'Lauren1',NULL,NULL,NULL,1,'2025-08-03 11:20:29','2025-08-03 11:20:29','ee6ac1d5-e482-474b-9f58-ab427b7ee3a3'),(2592,2592,1,'Lauren','lauren',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi, my name is Lauren,</p><p>I have been hairdressing now for 12 years with the past 10 years at The Leading Edge. I spent 3 years training and since then I have attended a number of courses covering colouring and cutting. Most recently I spent the day with Darren Ambrose looking at new techniques and cuts for me to apply to long and mid length hair.</p><p>My real passion lies within my colouring work from either drastic fashion colours through to discreet natural sunkissed colours. I also love working with highlights and have developed my free hand skills to produce beautiful balayage results as subtle or bold as you require.</p><p>If your looking for a change and want to update your look I Iove creating new styles and working with my clients to provide them with the change they are looking for.</p><p>I love meeting new people which is just one of the many things I love about hairdressing and I would welcome the chance to meet you into the salon to provide you with the colour and look of your dreams.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2591], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','9d969e1a-f40a-478b-8213-3c91c4a144d7'),(2593,2593,1,'Meet Our Team','meet-our-team','meet-the-team',NULL,1,'2025-08-03 11:20:36','2025-08-03 11:20:36','0533a80e-eb20-4074-903b-97ecd1ad3250'),(2594,2594,1,NULL,NULL,NULL,'{\"5794b33a-9aeb-415a-86ac-186366dc9e2a\": \"Meet Our Team\", \"da309fa1-70bd-497e-b18e-08c2f5fcf4ff\": \"The heart and soul of The Leading Edge – our talented professionals dedicated to your beauty journey.\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','ead5e2d2-7af9-4c81-b05c-dab107720d8e'),(2595,2595,1,'Lauren','lauren',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi, my name is Lauren,</p><p>I have been hairdressing now for 12 years with the past 10 years at The Leading Edge. I spent 3 years training and since then I have attended a number of courses covering colouring and cutting. Most recently I spent the day with Darren Ambrose looking at new techniques and cuts for me to apply to long and mid length hair.</p><p>My real passion lies within my colouring work from either drastic fashion colours through to discreet natural sunkissed colours. I also love working with highlights and have developed my free hand skills to produce beautiful balayage results as subtle or bold as you require.</p><p>If your looking for a change and want to update your look I Iove creating new styles and working with my clients to provide them with the change they are looking for.</p><p>I love meeting new people which is just one of the many things I love about hairdressing and I would welcome the chance to meet you into the salon to provide you with the colour and look of your dreams.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2591], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','9f0a864a-e441-4727-996d-b25b697d4d50'),(2596,2596,1,NULL,NULL,NULL,'{\"4b6e3b3a-86a2-43a7-a238-035fb72d0e71\": \"Our Team Values\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','95226039-32cd-4d99-aef2-9c6a1c1e0d70'),(2597,2597,1,'Continuous Education','continuous-education',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-graduation-cap\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"Our team regularly attends workshops, training sessions, and industry events to stay at the forefront of the latest techniques and trends.\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','7910174d-3a2c-44b9-b50c-0c24ff0a84bf'),(2598,2598,1,'Collaboration','collaborative',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-handshake\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"We believe in the power of teamwork and often collaborate on client services to ensure the best possible results for every individual.\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','f11e8d61-4b9c-4851-af05-b7c502cd8b45'),(2599,2599,1,'Passion for Service','passion-for-service',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-heart\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"Our team members are selected not just for their technical skills, but for their genuine passion for making clients feel beautiful and confident.\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','6bfcfe9a-a969-4ed7-ba54-66cea3f1b922'),(2600,2600,1,NULL,NULL,NULL,'{\"0f6396f5-63b5-46c2-a935-ed73bd4971c4\": \"Interested in Joining Our Team?\", \"5e3f4d2d-3e83-45c5-9de0-2efe8769f437\": {\"type\": \"entry\", \"label\": \"View Careers\", \"value\": \"{entry:2@1:url}\"}, \"d3b61915-e231-4081-a649-bb456eed60f6\": \"We\'re always looking for talented and passionate professionals to join The Leading Edge family. If you\'re dedicated to excellence and love what you do, we\'d love to hear from you.\"}',1,'2025-08-03 11:20:36','2025-08-03 11:20:36','6c1aded4-8fb5-495d-900b-52437a59e4ba'),(2601,2601,1,'Abigail1',NULL,NULL,NULL,1,'2025-08-03 11:21:10','2025-08-03 11:21:10','ede291dc-8e64-4e08-a117-4396a062b599'),(2602,2602,1,'Amanda Premier Aesthetics',NULL,NULL,NULL,1,'2025-08-03 11:21:10','2025-08-03 11:21:10','d43d27c2-ccdb-448b-9116-e864771bf433'),(2603,2603,1,'Annies Beauty Leading Edge',NULL,NULL,NULL,1,'2025-08-03 11:21:11','2025-08-03 11:21:11','9320a719-62fd-4203-9f7e-3b423233c73f'),(2604,2604,1,'Chloe',NULL,NULL,NULL,1,'2025-08-03 11:21:11','2025-08-03 11:21:11','16236bab-d41c-46bd-b28a-16126acfb510'),(2605,2605,1,'Dc6472bd dc3c 4a98 a4ae 958a38018ede',NULL,NULL,NULL,1,'2025-08-03 11:21:11','2025-08-03 11:21:11','58f4a517-590c-43ee-8a8c-b283bfda5171'),(2606,2606,1,'Emily Leading Edge Hair and Beauty',NULL,NULL,NULL,1,'2025-08-03 11:21:12','2025-08-03 11:21:12','25bfa995-1145-43b6-9091-1ba056d71860'),(2607,2607,1,'Gary',NULL,NULL,NULL,1,'2025-08-03 11:21:12','2025-08-03 11:21:12','e246f048-a87e-4ccf-8375-7742dccbe685'),(2608,2608,1,'Hall Marissa',NULL,NULL,NULL,1,'2025-08-03 11:21:12','2025-08-03 11:21:12','ca99b805-5c56-4338-b98a-fd7f993f6c3f'),(2609,2609,1,'Hayley',NULL,NULL,NULL,1,'2025-08-03 11:21:13','2025-08-03 11:21:13','29aff7c6-2d1c-4ceb-85a4-0b97b53b8ca3'),(2610,2610,1,'Jayne',NULL,NULL,NULL,1,'2025-08-03 11:21:13','2025-08-03 11:21:13','1e6d53ef-e78e-4a79-a188-e80cea1a6f3f'),(2611,2611,1,'Kellie',NULL,NULL,NULL,1,'2025-08-03 11:21:13','2025-08-03 11:21:13','12895158-b981-4e31-83c6-24abfb14814e'),(2612,2612,1,'Natasha',NULL,NULL,NULL,1,'2025-08-03 11:21:13','2025-08-03 11:21:13','108f3869-696d-4b77-a09a-efe7f236c091'),(2615,2615,1,'Stylist','stylist',NULL,NULL,1,'2025-08-03 11:22:03','2025-08-03 11:22:03','5e219abb-0404-4b1c-a283-fdf5f2e8c8c4'),(2618,2618,1,'Nails','nails',NULL,NULL,1,'2025-08-03 11:23:29','2025-08-03 11:23:29','1f174611-07cd-4bd1-bcbd-28924d4e8afd'),(2619,2619,1,'Gary','gary',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>It’s our great pleasure to welcome Gary to our team in Hyde. He has been given the name of \\\"The Hair Wizzard\\\" by a number of his clients. Gary joins us with a wealth of experience in both Men’s and Ladies colouring and cutting techniques. The first thing you will witness is his attention to detail and shear enthusiasm for his trade which is infectious. He works wonders with curly blowdrys and enjoys using his colouring skills to deliver the results you require. Gary also keeps well up to date with all the latest trends / cuts for the guys too. So why not book in and give him a try.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2607], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','d9ae0029-09f8-4636-a178-c542fea0aad4'),(2620,2620,1,'Abigail','abigail',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi everyone, Abigail here.</p><p>I have been in the hairdressing industry for over 9 years now. Starting at just 14, I took a 2 day release from school to go to college and learn the trade as a GCSE. I then went on to complete my apprenticeship with The Leading Edge and qualified at 18.</p><p>I am constantly looking for new challenges and wanting to learn new techniques. I will continue training on different courses to develop my skills further. This way I can keep up with new techniques and keep you lovely ladies up to date with the new trends.</p><p>Hairdressing is my passion, I will help you achieve your hair goals and give you the best advice possible on keeping your hair healthy. I look forward to meeting you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2254], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','ed380680-7292-48c5-bdd4-cacc065f0e57'),(2621,2621,1,'Natasha','natasha',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi I am Natasha,</p><p>I am a fully qualified Gel Nail Technician and I am very passionate about producing the best work I can. I enjoy the challenge of customers bringing images in which they want me to replicate.</p><p>A big part of my enjoyment in the job is building relationships and bonding with my clients during their visit whilst I create the desired look.</p><p>I look forward to meeting you and adding you to my growing client base.</p><p>Tasha x</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2612], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Gel Nail Technician\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2618]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','f80f9b17-0841-453c-b23a-50ecd8bdaccb'),(2622,2622,1,'Meet Our Team','meet-our-team','meet-the-team',NULL,1,'2025-08-03 11:23:35','2025-08-03 11:23:35','ae9c3de8-56ad-4afa-8de0-db2db12a3fae'),(2623,2623,1,'Gary','gary',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>It’s our great pleasure to welcome Gary to our team in Hyde. He has been given the name of \\\"The Hair Wizzard\\\" by a number of his clients. Gary joins us with a wealth of experience in both Men’s and Ladies colouring and cutting techniques. The first thing you will witness is his attention to detail and shear enthusiasm for his trade which is infectious. He works wonders with curly blowdrys and enjoys using his colouring skills to deliver the results you require. Gary also keeps well up to date with all the latest trends / cuts for the guys too. So why not book in and give him a try.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2607], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','a02a71c9-f2fb-4d89-9559-c349d02b266b'),(2624,2624,1,'Abigail','abigail',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi everyone, Abigail here.</p><p>I have been in the hairdressing industry for over 9 years now. Starting at just 14, I took a 2 day release from school to go to college and learn the trade as a GCSE. I then went on to complete my apprenticeship with The Leading Edge and qualified at 18.</p><p>I am constantly looking for new challenges and wanting to learn new techniques. I will continue training on different courses to develop my skills further. This way I can keep up with new techniques and keep you lovely ladies up to date with the new trends.</p><p>Hairdressing is my passion, I will help you achieve your hair goals and give you the best advice possible on keeping your hair healthy. I look forward to meeting you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2254], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','64075488-fc9c-4497-9fde-1edd6e2f2d55'),(2625,2625,1,'Natasha','natasha',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi I am Natasha,</p><p>I am a fully qualified Gel Nail Technician and I am very passionate about producing the best work I can. I enjoy the challenge of customers bringing images in which they want me to replicate.</p><p>A big part of my enjoyment in the job is building relationships and bonding with my clients during their visit whilst I create the desired look.</p><p>I look forward to meeting you and adding you to my growing client base.</p><p>Tasha x</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2612], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Gel Nail Technician\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2618]}',1,'2025-08-03 11:23:35','2025-08-03 11:23:35','39340523-4898-466d-8aa4-2949d605c8a7'),(2632,2632,1,'Hair','hair',NULL,NULL,1,'2025-08-03 11:27:14','2025-08-03 11:27:14','c311f22f-4a5c-462e-ad13-86b9dfef4097'),(2636,2636,1,'Aesthetics','aesthetics',NULL,NULL,1,'2025-08-03 11:30:05','2025-08-03 11:30:05','4f993585-116c-4c68-9b8b-4783d8fb847d'),(2638,2638,1,'Beauty','beauty',NULL,NULL,1,'2025-08-03 11:30:48','2025-08-03 11:30:48','248cee77-3cf9-43f0-883d-e1b1dd4ae28c'),(2639,2639,1,'Jayne','jayne',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Jayne has been working in the Hairdressing industry for 30 years gaining a wealth of knowledge and experience. Jayne has owned her own 2 floor salon in Hazel Grove and has also attended Lancaster University gaining a Degree in Education which then led onto the delivery of level 1,2,3 hairdressing skills to students with both Skills Solutions and then onto The Manchester College where she managed the Hair &amp; Beauty Department.</p><p>Jayne has worked for many years in the Hazel Grove area with A Cut Above and Chris Baker where she helped to open their training school before going on to open her own salon “The Hair Company” of Hazel Grove. Jayne had over 6 stylists operating over 2 floors trading successfully for over 8 years before moving into the field of training.</p><p>Having worked in the development of new stylists Jayne has always had to keep up to date with all the latest trends in both cutting and colouring and we are so pleased to be able to offer her unique skills and experience to our clients.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2610], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','57426484-95e2-40ed-8434-70901d8adb45'),(2640,2640,1,'Emily','emily',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi there! My name is Emily. I am 21 years old and I am fairly new to the hair industry, but never low on passion.</p><p>I am a very bubbly character, and a perfectionist when it comes to my work; whether it be a shaggy-layered 80s styled cut, a fresh new colour, or simply a beautiful bouncy blow - I\'m your girl.</p><p>I currently work with women and children of all hair types including Afro / Caribbean.</p><p>I\'m offering colour, cut and styling services and soon I will be available for bleach work and highlights too!</p><p>I am also wanting to work with Gents later on in my career. My aim is to be a colour specialist and promote alternative styles. I always aim for the highest quality, and use products which i believe will give you the most benefit, leaving your hair silky soft and manageable. I assure you\'ll leave my chair feeling fresh and new!</p><p>I look forward to welcoming you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2606], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','9630c9bf-7fbf-46be-8fa5-532f48b5d2d3'),(2641,2641,1,'Hayley','hayley',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi, I am Hayley and I am looking forward to meeting you in The Leading Edge after previuosly working at Paul Anthony\'s and Harvey Taylor both in Denton.</p><p>I have been in the hairdressing industry for over 40 years completing my level 3 at the outset. In 2011 I was awarded the prestigious Master Craftsman (for services to the hairdressing industry) by The Hairdressing Journal, to which I am very proud of.</p><p>I love all aspects of hairdressing including Perming, colouring and cutting and have a real paasion for Hair-Up. I cant wait to be of service to you the next time your looking for an appointment in the salon</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2609], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','2644bc37-808a-4754-868c-0e1666f166d4'),(2642,2642,1,'Kellie','kellie',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi All, I\'m looking forward to working with all the lovely ladies and staff at The Leading Edge Hair  Beauty.<br />I have over 30 years experience in the hairdressing industry mainly based in and around the Tameside area. I love making ladies feel fabulous and well looked after offering cuts and colours tailored to your specific requirements. I cant wait to welcome you into the salon and be of service to you. Best wishes Kellie.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2611], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','9ac42aef-5d4f-481e-a632-622199e746b7'),(2643,2643,1,'Chloe','chloe',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi I\'m Chloe. I\'m 18 years old and I have been completing my apprenticeship for the last 18 months. At the moment i\'m available for blowdrys and some root tints and toners. I am completing my course at Tameside college and The Leading Edge.</p><p>I am a friendly, motivated and passionate individual and welcome anyone into the salon and put 100% into all of my work. If anyone is willing to be a model for me in the future don\'t hesitate to give us a ring, I would really appreciate it and i\'ll look forward to meeting you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2604], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Apprentice Hairdresser\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2632]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','49546adc-9cd2-4b96-a17a-6d569e01e704'),(2644,2644,1,'Nina','nina',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi I\'m Nina<br />I have worked in the beauty industry for 2 years and there\'s nothing I love more than making my clients feel amazing after a service!<br />Building relationships with my clients is really what makes me love my job. So i look forward to meeting you and making you feel beautiful! x</p><p>I look forward to meeting you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2605], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Nail Technician\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2618]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','2758c3a9-f1a8-4761-8f6a-3e5d80b3a62b'),(2645,2645,1,'Marissa','marissa',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi , I’m Marissa </p><p>I’m so excited to be joining the team as a newly qualified biab nail technician. I have a real passion for helping people feel confident and beautiful after their appointment. </p><p>I beleive its more than just providing a service, I genuinely look forward to building lasting relationships with my clients, getting to know you, having great chats, and creating a space where you feel relaxed, valued, and completely yourself. I can’t wait to meet you and share this journey together! </p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2608], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Trainee Nail Technician\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2618]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','01953736-74bf-477e-9e62-d2f0148f8502'),(2646,2646,1,'Amanda','amanda',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hello, Im excited to introduce myself as a new member of the Leading Edge family 🫶</p><p>I am Amanda, a registered nurse with 8 years full time aesthetics experience.</p><p>I am an advanced practitioner in Dermal filler, Anti wrinkle treatments, medical grade skin treatments, skin boosters and injectable vitamins 👩‍⚕️</p><p>I am an accredited trainer for both foundation and advanced aesthetics and have earned over 100 ⭐️⭐️⭐️⭐️⭐️ reviews .</p><p>My goal is to enhance, lift and rejuvenate by softening unwanted lines and wrinkles.</p><p>I use advanced techniques to create natural results and boost your confidence.</p><p>Every treatment comes with a full consultation where we will discuss the results that YOU want to achieve.<br /> </p><p>I can’t wait to see old and new clients very soon ❤️</p><p><a href=\\\"https://www.facebook.com/premieraesthetic.clinic\\\">https://www.facebook.com/premi...</a></p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2258], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Aesthetics\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2636]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','49af7ac5-31af-4c37-a995-e2bf04d8cff9'),(2647,2647,1,'Annie','annie',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi everyone, I am Annie- (Annie’s Beauty) I am really excited to be joining the team here at The Leading Edge.</p><p>I have been in the Beauty &amp; Holistic Industry for over 20years, I started my career working in hotels such as the Malmasion, The Village Hotels and then went onto completing a Certificate in Education and did a spell of working in Colleges teaching Beauty.</p><p>I set up Annie’s Beauty in 2016 and offer all aspects of Beauty &amp; Holistic Treatments. I love what I do and everyone that comes through my door leaves as a friend.</p><p>I’m blessed to have amazing loyal clients and new ones are more than welcome too.</p><p>Looking forward to pampering you soon.</p><p><a href=\\\"https://www.facebook.com/anniesbeauty.atlotsmorestyle\\\">https://www.facebook.com/anniesbeauty.atlotsmorestyle</a></p><p><a href=\\\"https://www.instagram.com/annies.beauty_/profilecard/?igsh=MjA0eWhwaTZzcDJp\\\">https://www.instagram.com/annies.beauty_/profilecard/?igsh=MjA0eWhwaTZzcDJp</a></p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2261], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Beautician\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2638]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','ce177ade-33df-4bfe-89a0-10b144ae7288'),(2648,2648,1,'Meet Our Team','meet-our-team','meet-the-team',NULL,1,'2025-08-03 11:30:55','2025-08-03 11:30:55','a06e584c-4ec1-49b8-9fd9-d512f033406e'),(2649,2649,1,'Jayne','jayne',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Jayne has been working in the Hairdressing industry for 30 years gaining a wealth of knowledge and experience. Jayne has owned her own 2 floor salon in Hazel Grove and has also attended Lancaster University gaining a Degree in Education which then led onto the delivery of level 1,2,3 hairdressing skills to students with both Skills Solutions and then onto The Manchester College where she managed the Hair &amp; Beauty Department.</p><p>Jayne has worked for many years in the Hazel Grove area with A Cut Above and Chris Baker where she helped to open their training school before going on to open her own salon “The Hair Company” of Hazel Grove. Jayne had over 6 stylists operating over 2 floors trading successfully for over 8 years before moving into the field of training.</p><p>Having worked in the development of new stylists Jayne has always had to keep up to date with all the latest trends in both cutting and colouring and we are so pleased to be able to offer her unique skills and experience to our clients.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2610], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','806e8f62-dd22-4dd8-85d3-d73757738a24'),(2650,2650,1,'Emily','emily',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi there! My name is Emily. I am 21 years old and I am fairly new to the hair industry, but never low on passion.</p><p>I am a very bubbly character, and a perfectionist when it comes to my work; whether it be a shaggy-layered 80s styled cut, a fresh new colour, or simply a beautiful bouncy blow - I\'m your girl.</p><p>I currently work with women and children of all hair types including Afro / Caribbean.</p><p>I\'m offering colour, cut and styling services and soon I will be available for bleach work and highlights too!</p><p>I am also wanting to work with Gents later on in my career. My aim is to be a colour specialist and promote alternative styles. I always aim for the highest quality, and use products which i believe will give you the most benefit, leaving your hair silky soft and manageable. I assure you\'ll leave my chair feeling fresh and new!</p><p>I look forward to welcoming you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2606], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','c2f82804-2bc2-47b7-a52a-fd0dc3e18418'),(2651,2651,1,'Hayley','hayley',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi, I am Hayley and I am looking forward to meeting you in The Leading Edge after previuosly working at Paul Anthony\'s and Harvey Taylor both in Denton.</p><p>I have been in the hairdressing industry for over 40 years completing my level 3 at the outset. In 2011 I was awarded the prestigious Master Craftsman (for services to the hairdressing industry) by The Hairdressing Journal, to which I am very proud of.</p><p>I love all aspects of hairdressing including Perming, colouring and cutting and have a real paasion for Hair-Up. I cant wait to be of service to you the next time your looking for an appointment in the salon</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2609], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','ed0094a4-3d6f-471b-8cf5-cf7314a4fccb'),(2652,2652,1,'Kellie','kellie',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi All, I\'m looking forward to working with all the lovely ladies and staff at The Leading Edge Hair  Beauty.<br />I have over 30 years experience in the hairdressing industry mainly based in and around the Tameside area. I love making ladies feel fabulous and well looked after offering cuts and colours tailored to your specific requirements. I cant wait to welcome you into the salon and be of service to you. Best wishes Kellie.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2611], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Stylist\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2615]}',1,'2025-08-03 11:30:55','2025-08-03 11:30:55','94012e69-7455-4e3d-859e-99c0c0bfdbb6'),(2653,2653,1,'Chloe','chloe',NULL,'{\"7b604251-5c83-477c-98a3-1148494e0d26\": \"<p>Hi I\'m Chloe. I\'m 18 years old and I have been completing my apprenticeship for the last 18 months. At the moment i\'m available for blowdrys and some root tints and toners. I am completing my course at Tameside college and The Leading Edge.</p><p>I am a friendly, motivated and passionate individual and welcome anyone into the salon and put 100% into all of my work. If anyone is willing to be a model for me in the future don\'t hesitate to give us a ring, I would really appreciate it and i\'ll look forward to meeting you in the salon soon.</p>\", \"a002485b-6b34-4f64-9681-b48ec473cade\": [2604], \"b61bf591-76e4-4068-bd54-cf8a11ed496d\": \"Apprentice Hairdresser\", \"fdd05f4f-b125-4094-95a9-8cd20e626ea3\": [2