INSERT INTO `feedme_logs` VALUES (1116,4,'feed-me',1754041610.2572,'[News]','{\"message\":\"Data ready to import `{\\\"title\\\":\\\"Happy 2022\\\",\\\"slug\\\":\\\"happy-2022\\\",\\\"postDate\\\":{\\\"date\\\":\\\"2022-01-01 00:30:00.000000\\\",\\\"timezone_type\\\":1,\\\"timezone\\\":\\\"+00:00\\\"},\\\"articleText\\\":\\\"<p>Happy New Year! I am sure we can ALL agree that a fresh start and a new year was MUCH needed! With all the uncertainty &amp; difficulties of 2020, let’s start this new year off with a bang. Sooo… Welcome to 2021! What are some of your goals for this year? Personal goals? Professional goals? We want to hear them ALL! Tell us in the comments below 👇<\\\\\\/p>\\\"}`.\",\"feed\":\"News\",\"key\":\"mxeppwpceenekoyebfqv\"}'),(1117,4,'feed-me',1754041610.2959,'[News]','{\"message\":\"Entry [`#2118`](https:\\/\\/tle-2025.ddev.site\\/admin\\/entries\\/newsSection\\/2118-happy-2022) added successfully.\",\"feed\":\"News\",\"key\":\"mxeppwpceenekoyebfqv\"}'),(1118,4,'feed-me',1754041610.2959,'[News]','{\"message\":\"Finished processing of node `#59` in batch `2`.\",\"feed\":\"News\",\"key\":\"mxeppwpceenekoyebfqv\"}'),(1119,4,'feed-me',1754041610.297,'[News]','{\"message\":\"Starting processing of node `#60` in batch `2`.\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1120,4,'feed-me',1754041610.297,'[News]','{\"message\":\"Match existing element with data `{\\\"title\\\":\\\"Vivids are BEST\\\"}`.\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1121,4,'feed-me',1754041610.2988,'[News]','{\"message\":\"Search for existing asset with query `{\\\"status\\\":null,\\\"folderId\\\":1,\\\"kind\\\":null,\\\"limit\\\":1,\\\"filename\\\":\\\"4492\\\",\\\"includeSubfolders\\\":true}`\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1122,4,'feed-me',1754041610.3001,'[News]','{\"message\":\"Found `0` existing assets: `[]`\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1123,4,'feed-me',1754041610.3028,'[News]','{\"message\":\"Data ready to import `{\\\"title\\\":\\\"Vivids are BEST\\\",\\\"slug\\\":\\\"vivids-are-best\\\",\\\"postDate\\\":{\\\"date\\\":\\\"2021-12-09 11:58:00.000000\\\",\\\"timezone_type\\\":1,\\\"timezone\\\":\\\"+00:00\\\"},\\\"articleText\\\":\\\"<p>This is your sign to venture out of your comfort zone and experience the rainbow! <br \\\\\\/>We adore experimenting different vivids to make your bold color dreams come true in our #salon. <br \\\\\\/><\\\\\\/p>\\\"}`.\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1124,4,'feed-me',1754041610.3431,'[News]','{\"message\":\"Entry [`#2120`](https:\\/\\/tle-2025.ddev.site\\/admin\\/entries\\/newsSection\\/2120-vivids-are-best) added successfully.\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1125,4,'feed-me',1754041610.3431,'[News]','{\"message\":\"Finished processing of node `#60` in batch `2`.\",\"feed\":\"News\",\"key\":\"jtamboqblmfglnghfhyl\"}'),(1126,4,'feed-me',1754041610.3445,'[News]','{\"message\":\"Starting processing of node `#61` in batch `2`.\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1127,4,'feed-me',1754041610.3446,'[News]','{\"message\":\"Match existing element with data `{\\\"title\\\":\\\"Sunday Sunday My Fun Day\\\"}`.\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1128,4,'feed-me',1754041610.346,'[News]','{\"message\":\"Search for existing asset with query `{\\\"status\\\":null,\\\"folderId\\\":1,\\\"kind\\\":null,\\\"limit\\\":1,\\\"filename\\\":\\\"4496\\\",\\\"includeSubfolders\\\":true}`\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1129,4,'feed-me',1754041610.3475,'[News]','{\"message\":\"Found `0` existing assets: `[]`\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1130,4,'feed-me',1754041610.3501,'[News]','{\"message\":\"Data ready to import `{\\\"title\\\":\\\"Sunday Sunday My Fun Day\\\",\\\"slug\\\":\\\"sunday-sunday-my-fun-day\\\",\\\"postDate\\\":{\\\"date\\\":\\\"2021-12-12 12:18:00.000000\\\",\\\"timezone_type\\\":1,\\\"timezone\\\":\\\"+00:00\\\"},\\\"articleText\\\":\\\"<p>My Sundays are so close to my heart \\\\\\/ Who doesn’t love a Sunday switch-off?<br \\\\\\/>For me, it’s one of the very few days where I can slow down and devote a little bit of time to myself.<br \\\\\\/>My business, clients, family and friends always come first (and rightfully so!) but I know I also need to take some time for myself too at some point. Otherwise I’m constantly burning the candle at both ends with zero chance for rejuvenation!<br \\\\\\/>I love to relax in a hot bath with my Badedas Bath Gel and a large G&amp;T<br \\\\\\/>How do you like to relax? Pop your ideas in the comments below so I can try them out too! X<\\\\\\/p>\\\"}`.\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1131,4,'feed-me',1754041610.4095,'[News]','{\"message\":\"Entry [`#2122`](https:\\/\\/tle-2025.ddev.site\\/admin\\/entries\\/newsSection\\/2122-sunday-sunday-my-fun-day) added successfully.\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1132,4,'feed-me',1754041610.4095,'[News]','{\"message\":\"Finished processing of node `#61` in batch `2`.\",\"feed\":\"News\",\"key\":\"nqihfnhfmvditcaquyrd\"}'),(1133,4,'feed-me',1754041610.4112,'[News]','{\"message\":\"Starting processing of node `#62` in batch `2`.\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1134,4,'feed-me',1754041610.4112,'[News]','{\"message\":\"Match existing element with data `{\\\"title\\\":\\\"Hair Colour Mixologist\\\"}`.\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1135,4,'feed-me',1754041610.4143,'[News]','{\"message\":\"Search for existing asset with query `{\\\"status\\\":null,\\\"folderId\\\":1,\\\"kind\\\":null,\\\"limit\\\":1,\\\"filename\\\":\\\"4500\\\",\\\"includeSubfolders\\\":true}`\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1136,4,'feed-me',1754041610.4159,'[News]','{\"message\":\"Found `0` existing assets: `[]`\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1137,4,'feed-me',1754041610.4183,'[News]','{\"message\":\"Data ready to import `{\\\"title\\\":\\\"Hair Colour Mixologist\\\",\\\"slug\\\":\\\"hair-colour-mixologist\\\",\\\"postDate\\\":{\\\"date\\\":\\\"2021-12-04 05:30:00.000000\\\",\\\"timezone_type\\\":1,\\\"timezone\\\":\\\"+00:00\\\"},\\\"articleText\\\":\\\"<p>Hey Insta Facebook fam - it’s Emily here. <br \\\\\\/>I like to think of myself as the resident mixologist at The Leading Edge aka the Queen of formulas if you will! <br \\\\\\/>There’s so much that goes into mixing the perfect colour, bleach, treatment or toner for every client. You’re all so beautifully unique, and so is your #hair! <br \\\\\\/>You all have different hair needs when it comes to the products we use and one of my special skills is being the #salon’s chemistry-wizard that can whip up the perfect hair cocktail to reach our desired end result. <br \\\\\\/>it’s my absolute PASSION doing color transformations. So if you’re looking for a colour refresh or to dip your toes into something more bold, don’t be afraid to send me a DM today xx<\\\\\\/p>\\\"}`.\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1138,4,'feed-me',1754041610.4668,'[News]','{\"message\":\"Entry [`#2124`](https:\\/\\/tle-2025.ddev.site\\/admin\\/entries\\/newsSection\\/2124-hair-colour-mixologist) added successfully.\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1139,4,'feed-me',1754041610.4668,'[News]','{\"message\":\"Finished processing of node `#62` in batch `2`.\",\"feed\":\"News\",\"key\":\"chwmyoytqkcupzhnsvtf\"}'),(1140,4,'feed-me',1754041610.4685,'[News]','{\"message\":\"Starting processing of node `#63` in batch `2`.\",\"feed\":\"News\",\"key\":\"uedmonmsprhqakbjdwcb\"}'),(1141,4,'feed-me',1754041610.4685,'[News]','{\"message\":\"Match existing element with data `{\\\"title\\\":\\\"Main Event is your hair\\\"}`.\",\"feed\":\"News\",\"key\":\"uedmonmsprhqakbjdwcb\"}'),(1142,4,'feed-me',1754041610.4701,'[News]','{\"message\":\"Search for existing asset with query `{\\\"status\\\